sap.zen.AxisWrapper.prototype.getNameList = function(tDimensions)
{
	if (oFF.isNull(tDimensions) || tDimensions.isEmpty())
	{
		return oFF.XListOfString.create();
	}
	var ltDimensionNames = oFF.XListOfString.create();
	for (var lDimensionIndex = 0; lDimensionIndex < tDimensions.size(); lDimensionIndex++)
	{
		var loDimension = tDimensions.get(lDimensionIndex);
		if (oFF.isNull(loDimension))
		{
			continue;
		}
		if (loDimension.getUniversalDisplayHierarchy() === null)
		{
			ltDimensionNames.add(loDimension.getName());
		}
	}
	return ltDimensionNames;
};
sap.zen.AxisWrapper.prototype.applyAxisConfig = function(rows, columns)
{
	if (this.hasAxisContentChanged(rows, this.moQueryManager.getQueryModel().getRowsAxis()))
	{
		this.buildNewAxis(rows, this.moQueryManager.getQueryModel().getRowsAxis());
	}
	if (this.hasAxisContentChanged(columns, this.moQueryManager.getQueryModel().getColumnsAxis()))
	{
		this.buildNewAxis(columns, this.moQueryManager.getQueryModel().getColumnsAxis());
	}
};
sap.zen.AxisWrapper.prototype.buildNewAxis = function(tAxisDimensionNames, oAxis)
{
	if (oFF.isNull(oAxis))
	{
		return;
	}
	oAxis.clear();
	var loQueryModel = oAxis.getQueryModel();
	if (oFF.notNull(tAxisDimensionNames))
	{
		for (var lAxisIndex = 0; lAxisIndex < tAxisDimensionNames.size(); lAxisIndex++)
		{
			var lDimensionName = tAxisDimensionNames.get(lAxisIndex);
			if (oFF.isNull(lDimensionName))
			{
				continue;
			}
			var loDimension = loQueryModel.getDimensionByName(lDimensionName);
			if (oFF.isNull(loDimension))
			{
				continue;
			}
			oAxis.add(loDimension);
		}
	}
};
sap.zen.AxisWrapper.prototype.hasAxisContentChanged = function(tAxisDimensionNames, oAxis)
{
	var ltAxisDimensions = oAxis.getDimensions();
	if (ltAxisDimensions.size() !== tAxisDimensionNames.size())
	{
		return true;
	}
	for (var lDimensionIndex = 0; lDimensionIndex < ltAxisDimensions.size(); lDimensionIndex++)
	{
		var loAxisDimension = ltAxisDimensions.get(lDimensionIndex);
		if (oFF.isNull(loAxisDimension))
		{
			continue;
		}
		var lDimensionName = loAxisDimension.getName();
		if (!oFF.XString.isEqual(lDimensionName, tAxisDimensionNames.get(lDimensionIndex)))
		{
			return true;
		}
	}
	return false;
};

