sap.zen.MemberWrapper.prototype.getChildren = function(oMessageWriter)
{
	var loDimension = this.getDimension();
	if (oFF.isNull(loDimension))
	{
		return null;
	}
	var loInternalDimension = loDimension.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return null;
	}
	var loMessageWriter = oMessageWriter;
	if (oFF.isNull(loMessageWriter))
	{
		loMessageWriter = this.getDataSource().getMessageWriter();
	}
	if (this.isNode())
	{
		loInternalDimension.setSelectorHierarchyActive(true);
		loInternalDimension.setSelectorInitialDrillLevel(1);
		loInternalDimension.clearSelectorFilter();
		loInternalDimension.clearSelectorHierarchyNode();
		loInternalDimension.setSelectorHierarchyNodeByName(this.moInternalNode.getName());
		var ltMemberNodes = null;
		if (this.mVariableMode && oFF.notNull(this.moInternalVariable))
		{
			var loResult = loInternalDimension.processVarHelp(this.moInternalVariable.getName(), oFF.SyncType.BLOCKING, null, null);
			if (loResult.hasErrors() === false)
			{
				ltMemberNodes = loResult.getData();
			}
			else
			{
				loMessageWriter.createErrorMessage(loResult.getSummary());
			}
		}
		else
		{
			ltMemberNodes = sap.zen.DataSourceScriptApiUtils.getAllDimensionMembersHierarchical(loInternalDimension);
		}
		var ltMemberWrappers = oFF.XList.create();
		if (oFF.notNull(ltMemberNodes))
		{
			for (var lMemberNodeIndex = 0; lMemberNodeIndex < ltMemberNodes.size(); lMemberNodeIndex++)
			{
				var loMemberNode = ltMemberNodes.get(lMemberNodeIndex);
				if (oFF.isNull(loMemberNode))
				{
					continue;
				}
				if (!oFF.XString.isEqual(loMemberNode.getName(), this.moInternalNode.getName()))
				{
					var loMemberWrapper = sap.zen.MemberWrapper.createForNode(this.getDataSource(), loInternalDimension, loMemberNode, this.moMemberCache, this.mVariableMode, this.moInternalVariable);
					ltMemberWrappers.add(loMemberWrapper);
					this.moMemberCache.putMemberWrapper(loMemberWrapper);
				}
			}
		}
		return ltMemberWrappers;
	}
	return null;
};
