sap.zen.CharacteristicConfig.parseJSON = function(oJsonParser, jsonString)
{
	var lJson = jsonString;
	var ltCharacteristicConfig = oFF.XList.create();
	ltCharacteristicConfig = oFF.XList.create();
	if (oFF.isNull(lJson) || oFF.XString.size(lJson) === 0)
	{
		return ltCharacteristicConfig;
	}
	lJson = oFF.XString.replace(lJson, "name:", "\"name\":");
	var loJsonRootElement = oJsonParser.parse(jsonString);
	var loJsonListDimensions = loJsonRootElement.asList();
	var lAmountOfDimensions = loJsonListDimensions.size();
	for (var lDimensionIndex = 0; lDimensionIndex < lAmountOfDimensions; lDimensionIndex++)
	{
		var loJsonElementDimension = loJsonListDimensions.get(lDimensionIndex);
		if (oFF.isNull(loJsonElementDimension))
		{
			continue;
		}
		var loJsonStructureDimensions = loJsonElementDimension.asStructure();
		if (oFF.isNull(loJsonStructureDimensions))
		{
			continue;
		}
		var loCharacteristicConfig = new sap.zen.CharacteristicConfig();
		loCharacteristicConfig.mName = loJsonStructureDimensions.getStringByKey(sap.zen.CharacteristicConfig.NAME_KEY);
		ltCharacteristicConfig.add(loCharacteristicConfig);
	}
	return ltCharacteristicConfig;
};
sap.zen.CharacteristicConfig.instance = function(name)
{
	var config = new sap.zen.CharacteristicConfig();
	config.mName = name;
	return config;
};
