sap.zen.ZCrosstabColWidthHandler = function() {};
sap.zen.ZCrosstabColWidthHandler.prototype = new oFF.XObject();
sap.zen.ZCrosstabColWidthHandler.prototype._ff_c = "ZCrosstabColWidthHandler";

sap.zen.ZCrosstabColWidthHandler.create = function(oCrosstabControl)
{
	var loInstance = new sap.zen.ZCrosstabColWidthHandler();
	loInstance.initColWidthHandler(oCrosstabControl);
	return loInstance;
};
sap.zen.ZCrosstabColWidthHandler.prototype.mtColWidths = null;
sap.zen.ZCrosstabColWidthHandler.prototype.moCrosstabControl = null;
sap.zen.ZCrosstabColWidthHandler.prototype.initColWidthHandler = function(oCrosstabControl)
{
	this.mtColWidths = oFF.XHashMapByString.create();
	this.moCrosstabControl = oCrosstabControl;
};
sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidths = function()
{
	this.mtColWidths = this.getUserColWidthsFromInitParams(this.mtColWidths);
	return this.mtColWidths;
};
sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidth = function(colId)
{
	if (!this.isColIdValid(colId, true))
	{
		return null;
	}
	var lColumnWidthInfo = null;
	if (this.mtColWidths.containsKey(colId))
	{
		lColumnWidthInfo = this.mtColWidths.getByKey(colId);
	}
	else if (this.mtColWidths.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS))
	{
		lColumnWidthInfo = this.mtColWidths.getByKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS);
	}
	return lColumnWidthInfo;
};
sap.zen.ZCrosstabColWidthHandler.prototype.resetUserColWidth = function(colId)
{
	if (!this.isColIdValid(colId, false))
	{
		return;
	}
	var lColumnWidthInfo = null;
	if (oFF.XString.isEqual(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS, colId))
	{
		this.mtColWidths.clear();
	}
	else
	{
		if (!this.mtColWidths.containsKey(colId))
		{
			if (this.mtColWidths.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS))
			{
				lColumnWidthInfo = sap.zen.ZCrosstabColWidthInfo.create("", true);
				this.mtColWidths.put(colId, lColumnWidthInfo);
			}
		}
		else
		{
			this.mtColWidths.remove(colId);
		}
	}
};
sap.zen.ZCrosstabColWidthHandler.prototype.setUserColWidth = function(colId, width)
{
	var lColId = colId;
	var lWidth = width;
	if (!this.isColIdValid(lColId, false) || !this.isColWidthValid(lWidth))
	{
		return;
	}
	if (oFF.XString.isEqual("-1", lColId))
	{
		lColId = sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS;
	}
	if (oFF.XString.isEqual(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS, lColId))
	{
		this.mtColWidths.clear();
	}
	var lUseDefaultWidth = oFF.isNull(lWidth) || oFF.XString.isEqual(lWidth, "") || oFF.XInteger.convertFromString(lWidth) <= 0;
	if (lUseDefaultWidth)
	{
		lWidth = "";
	}
	var lColumnWidthInfo = null;
	if (this.mtColWidths.containsKey(lColId))
	{
		lColumnWidthInfo = this.mtColWidths.getByKey(lColId);
		lColumnWidthInfo.initMe(lWidth, lUseDefaultWidth);
	}
	else
	{
		lColumnWidthInfo = sap.zen.ZCrosstabColWidthInfo.create(lWidth, lUseDefaultWidth);
		this.mtColWidths.put(lColId, lColumnWidthInfo);
	}
};
sap.zen.ZCrosstabColWidthHandler.prototype.setUserColWidths = function(tColumnWidths)
{
	if (tColumnWidths.size() <= 0)
	{
		return;
	}
	var ltKeys = tColumnWidths.getKeysAsIteratorOfString();
	while (ltKeys.hasNext())
	{
		var lColId = ltKeys.next();
		var lColumnWidthInfo = tColumnWidths.getByKey(lColId);
		this.setUserColWidth(lColId, lColumnWidthInfo.getWidth());
	}
};
sap.zen.ZCrosstabColWidthHandler.prototype.isColIdValid = function(colId, strict)
{
	var lIsValid = true;
	var lColId = colId;
	if (!strict)
	{
		if (oFF.XString.isEqual(lColId, "-1"))
		{
			lColId = sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS;
		}
		if (oFF.XString.isEqual(lColId, sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS))
		{
			return true;
		}
	}
	var lColIndex = 0;
	try
	{
		lColIndex = oFF.XInteger.convertFromString(lColId);
	}
	catch (e)
	{
		lIsValid = false;
	}
	lIsValid = lColIndex >= 0;
	return lIsValid;
};
sap.zen.ZCrosstabColWidthHandler.prototype.isColWidthValid = function(colWidth)
{
	var lIsValid = true;
	var lWidth = 0;
	try
	{
		lWidth = oFF.XInteger.convertFromString(colWidth);
	}
	catch (e)
	{
		lIsValid = false;
	}
	lIsValid = lWidth >= 0 || lWidth === -1;
	return lIsValid;
};
sap.zen.ZCrosstabColWidthHandler.prototype.getUserColWidthsFromInitParams = function(tExistingColWidths)
{
	var ltColumnWidths;
	if (oFF.notNull(tExistingColWidths))
	{
		ltColumnWidths = tExistingColWidths.createMapByStringCopy();
	}
	else
	{
		ltColumnWidths = oFF.XHashMapByString.create();
	}
	var lColWidthDefNode = this.moCrosstabControl.getInitParameters().getFirstChildWithNameTag("CROSSTAB_USER_COL_WIDTH_LIST");
	if (oFF.isNull(lColWidthDefNode))
	{
		return ltColumnWidths;
	}
	var ltColWidthDefNodeValues = lColWidthDefNode.getChildren("property").getIterator();
	while (ltColWidthDefNodeValues.hasNext())
	{
		var lColWidthValue = ltColWidthDefNodeValues.next();
		var lColumnWidthInfo = new sap.zen.ZCrosstabColWidthInfo();
		var colWidthInfoList = lColWidthValue.getChildren("property");
		var colIdNode = colWidthInfoList.get(0);
		var lColId = null;
		if (oFF.XString.isEqual(colIdNode.getAttribute("name"), "CROSSTAB_COLID"))
		{
			lColId = colIdNode.getAttribute("value");
		}
		var colWidthNode = colWidthInfoList.get(1);
		if (oFF.XString.isEqual(colWidthNode.getAttribute("name"), "CROSSTAB_COLWIDTH"))
		{
			lColumnWidthInfo.setWidth(colWidthNode.getAttribute("value"));
		}
		var colIdIgnoreNode = colWidthInfoList.get(1);
		if (oFF.XString.isEqual(colIdNode.getAttribute("name"), "CROSSTAB_COLID_IGNORE"))
		{
			var sIsIgnore = colIdIgnoreNode.getAttribute("value");
			var bIsIgnore = false;
			if (oFF.XString.isEqual("X", sIsIgnore))
			{
				bIsIgnore = true;
			}
			lColumnWidthInfo.setIgnore(bIsIgnore);
		}
		if (!ltColumnWidths.containsKey(lColId))
		{
			if (oFF.notNull(tExistingColWidths) && tExistingColWidths.containsKey(lColId))
			{
				ltColumnWidths.put(lColId, tExistingColWidths.getByKey(lColId));
			}
			else if (oFF.notNull(tExistingColWidths) && tExistingColWidths.containsKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS))
			{
				ltColumnWidths.put(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS, tExistingColWidths.getByKey(sap.zen.ZCrosstabControl.COLID_ALL_COLUMNS));
			}
			else
			{
				ltColumnWidths.put(lColId, lColumnWidthInfo);
			}
		}
	}
	return ltColumnWidths;
};
sap.zen.ZCrosstabColWidthHandler.prototype.toString = function()
{
	return this.mtColWidths.toString();
};

