sap.zen.ZCrosstabHeaderDimensionInfo.prototype.initMe = function(oResultSetInfo, oDataSource)
{
	var loDimension = oResultSetInfo.getDimension();
	if (oFF.notNull(loDimension))
	{
		this.mDimensionName = loDimension.getName();
		this.mDimensionText = loDimension.getText();
		this.mIsStructure = loDimension.isStructure();
		this.mIsMeasureStructure = loDimension.isMeasureStructure();
	}
	var loInternalField = oResultSetInfo.getField();
	if (oFF.notNull(loInternalField))
	{
		var lPresentationType = loInternalField.getPresentationType();
		this.mIsKeyPresentation = lPresentationType.isEqualTo(oFF.PresentationType.KEY);
		this.mIsTextPresentation = !this.mIsKeyPresentation;
		var loInternalAttribute = loInternalField.getAttribute();
		var lIsAttribute = sap.zen.DataSourceScriptApiUtils.isAttribute(oDataSource, loInternalAttribute);
		if (lIsAttribute)
		{
			this.mAttributeName = loInternalAttribute.getName();
			this.mAttributeText = loInternalAttribute.getText();
		}
	}
	if (this.mIsStructure)
	{
		sap.zen.DataSourceScriptApiUtils.logGetResultSet(oDataSource.getPage(), oDataSource.getQueryManager(), "ZCrosstabHeaderDimensionInfo initMe");
		var lAmountOfMembers = 0;
		if (oFF.notNull(loDimension))
		{
			lAmountOfMembers = loDimension.getDimensionMembersInResultSet(-1).size();
		}
		this.mIsRemoveStructureAllowed = lAmountOfMembers < 2;
	}
	else
	{
		this.mIsRemoveStructureAllowed = false;
	}
};
