sap.zen.Grid.prototype.initialize = function()
{
	this.mRows = -1;
	this.mCols = -1;
	this.mDataRows = -1;
	this.mDataCols = -1;
	this.mRowHeaders = -1;
	this.mColHeaders = -1;
	this.mNoRowHeader = false;
	this.mNoColHeader = false;
	this.mtRowHeadersWithTotals = oFF.XHashMapByString.create();
	this.mtColHeadersWithTotals = oFF.XHashMapByString.create();
	this.mtRowSpans = oFF.XList.create();
	this.mtRowsLastProcessedTupleOfTupleElement = null;
	this.mtColSpans = oFF.XList.create();
	this.mtColsLastProcessedTupleOfTupleElement = null;
	this.mScalingFactorDisplayAxis = null;
	this.mScalingFactorDisplayAxisIndex = -1;
	var loResultSet = this.getResultSet();
	if (oFF.isNull(loResultSet) || loResultSet.hasErrors())
	{
		return;
	}
	this.mDataRows = loResultSet.getAmountOfRows();
	this.mDataCols = loResultSet.getAmountOfColumns();
	if (this.mDataRows === 0 && this.mDataCols === 0 || this.mDataRows === 0 && loResultSet.getAmountOfDimensionsOnAxis(oFF.AxisType.ROWS) > 0 || this.mDataCols === 0 && loResultSet.getAmountOfDimensionsOnAxis(oFF.AxisType.COLUMNS) > 0)
	{
		return;
	}
	this.provideAmountOfHeaders();
	this.mRows = this.mDataRows + this.mColHeaders;
	this.mCols = this.mDataCols + this.mRowHeaders;
};
sap.zen.Grid.prototype.provideAmountOfHeaders = function()
{
	var loQueryModel = this.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return;
	}
	var loResultSet = this.getResultSet();
	if (oFF.isNull(loResultSet))
	{
		return;
	}
	this.mRowHeaders = loResultSet.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.ROWS);
	this.mColHeaders = loResultSet.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.COLUMNS);
	if (this.mRowHeaders === 0)
	{
		var ltColDimensions = loQueryModel.getColumnsAxis().getDimensions();
		if (!ltColDimensions.isEmpty() && (ltColDimensions.size() > 1 || !ltColDimensions.get(0).isStructure()))
		{
			this.mRowHeaders = 1;
		}
		this.mNoRowHeader = true;
	}
	if (this.mColHeaders === 0)
	{
		var ltRowDimensions = loQueryModel.getRowsAxis().getDimensions();
		if (!ltRowDimensions.isEmpty() && (ltRowDimensions.size() > 1 || !ltRowDimensions.get(0).isStructure()))
		{
			this.mColHeaders = 1;
		}
		this.mNoColHeader = true;
	}
	if (this.isDisplayScalingFactorsInHeader())
	{
		var lMeasureDimensionAxis = loQueryModel.getMeasureDimension().getAxis();
		var lMeasureDimensionAxisType = lMeasureDimensionAxis.getType();
		this.mScalingFactorDisplayAxis = lMeasureDimensionAxisType;
		if (lMeasureDimensionAxisType === oFF.AxisType.ROWS)
		{
			this.mRowHeaders++;
			this.mScalingFactorDisplayAxisIndex = this.mRowHeaders - 1;
		}
		else if (lMeasureDimensionAxisType === oFF.AxisType.COLUMNS)
		{
			this.mColHeaders++;
			this.mScalingFactorDisplayAxisIndex = this.mColHeaders - 1;
		}
	}
};
