sap.zen.GridCell.prototype.initMe = function(oGrid, rowIndex, columnIndex, oDisplayArea)
{
	this.moGrid = oGrid;
	this.moDisplayArea = oDisplayArea;
	this.mRowIndex = rowIndex;
	this.mColIndex = columnIndex;
	this.mRowDataIndex = this.mRowIndex - this.moGrid.getColumnHeaders();
	this.mColDataIndex = this.mColIndex - this.moGrid.getRowHeaders();
	this.mAxis = null;
	this.mRowSpan = 0;
	this.mColSpan = 0;
	this.mStyle = 0;
	this.mValue = null;
	this.mValueType = null;
	this.mFormatString = null;
	this.mSortType = null;
	this.mSortDirection = null;
	this.mNodeState = null;
	this.mNodeLevel = 0;
	this.mNodeAlignment = null;
	this.mtHeaderData = oFF.XList.create();
	this.moResultDataCell = null;
	var lRowIndex = this.mRowIndex;
	var lColIndex = this.mColIndex;
	if (oFF.notNull(this.moDisplayArea))
	{
		lRowIndex = this.mRowIndex - this.moDisplayArea.getRowOffset();
		lColIndex = this.mColIndex - this.moDisplayArea.getColumnOffset();
		var lRowDataIndex = lRowIndex - this.moGrid.getColumnHeaders();
		var lColDataIndex = lColIndex - this.moGrid.getRowHeaders();
		if (lRowDataIndex < 0)
		{
			lRowDataIndex = -1;
		}
		else
		{
			lRowDataIndex = lRowDataIndex + this.moDisplayArea.getRowOffset();
		}
		if (lColDataIndex < 0)
		{
			lColDataIndex = -1;
		}
		else
		{
			lColDataIndex = lColDataIndex + this.moDisplayArea.getColumnOffset();
		}
	}
	if (lColIndex < this.moGrid.getRowHeaders())
	{
		if (lRowIndex < this.moGrid.getColumnHeaders())
		{
			this.provideDimensionHeaderCell(lRowIndex, lColIndex);
		}
		else
		{
			this.provideTupleElementHeaderCell(oFF.AxisType.ROWS, lRowIndex, lColIndex);
		}
	}
	else
	{
		if (lRowIndex < this.moGrid.getColumnHeaders())
		{
			this.provideTupleElementHeaderCell(oFF.AxisType.COLUMNS, lRowIndex, lColIndex);
		}
		else
		{
			this.provideDataCell();
		}
	}
};
