sap.zen.GridCell.prototype.getHeaderData = function()
{
	return this.mtHeaderData;
};
sap.zen.GridCell.prototype.getAxis = function()
{
	return this.mAxis;
};
sap.zen.GridCell.prototype.getSortType = function()
{
	return this.mSortType;
};
sap.zen.GridCell.prototype.getSortDirection = function()
{
	return this.mSortDirection;
};
sap.zen.GridCell.prototype.provideDimensionHeaderCell = function(rowIndex, colIndex)
{
	this.mRowSpan = 1;
	this.mColSpan = 1;
	this.mValue = "";
	this.mValueType = oFF.XValueType.STRING;
	this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_HEADER;
	var loResultSetInfo = null;
	var lIsScalingInfo = false;
	var ltHeaders = oFF.XList.create();
	if (rowIndex === this.moGrid.getColumnHeaders() - 1)
	{
		if (this.moGrid.hasRowHeader())
		{
			loResultSetInfo = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), oFF.AxisType.ROWS, -1, colIndex);
			ltHeaders.add(loResultSetInfo);
		}
		if (this.moGrid.hasColumnHeader())
		{
			if (colIndex === this.moGrid.getRowHeaders() - 1)
			{
				loResultSetInfo = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), oFF.AxisType.COLUMNS, -1, rowIndex);
				ltHeaders.add(loResultSetInfo);
			}
		}
	}
	else if (colIndex === this.moGrid.getRowHeaders() - 1)
	{
		loResultSetInfo = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), oFF.AxisType.COLUMNS, -1, rowIndex);
		ltHeaders.add(loResultSetInfo);
	}
	if (oFF.notNull(ltHeaders) && !ltHeaders.isEmpty())
	{
		var lHeaderIndex = 0;
		var loHeaderIterator = ltHeaders.getIterator();
		while (loHeaderIterator.hasNext())
		{
			loResultSetInfo = loHeaderIterator.next();
			if (oFF.isNull(loResultSetInfo))
			{
				continue;
			}
			this.mtHeaderData.add(loResultSetInfo);
			var loDimension = loResultSetInfo.getDimension();
			var loInternalField = loResultSetInfo.getField();
			lIsScalingInfo = this.isScalingFactorCell(loResultSetInfo, rowIndex, colIndex);
			var lDimensionHeader = null;
			if (!lIsScalingInfo && !loDimension.isMeasureStructure())
			{
				var lFieldName = null;
				if (oFF.notNull(loInternalField))
				{
					lFieldName = loInternalField.getName();
				}
				lDimensionHeader = loDimension.getHeaderText(lFieldName);
			}
			if (oFF.XStringUtils.isNullOrEmpty(this.mValue))
			{
				this.mValue = lDimensionHeader;
			}
			else
			{
				if (oFF.XStringUtils.isNotNullAndNotEmpty(lDimensionHeader))
				{
					this.mValue = oFF.XStringUtils.concatenate3(this.mValue, " | ", lDimensionHeader);
				}
			}
			if (lHeaderIndex > 0)
			{
				continue;
			}
			this.mAxis = loResultSetInfo.getAxis();
			this.provideSortInformation(loResultSetInfo, rowIndex, colIndex);
			lHeaderIndex++;
		}
	}
};
sap.zen.GridCell.prototype.provideTupleElementHeaderCell = function(axis, rowIndex, colIndex)
{
	var lAxisIndex = 0;
	var lAxisDataIndex = 0;
	var lOtherAxisIndex = 0;
	var lHasHeader = true;
	var lHeaders = 0;
	var ltAxisHeadersWithTotals = null;
	if (axis === oFF.AxisType.ROWS)
	{
		lAxisIndex = rowIndex;
		lAxisDataIndex = this.mRowDataIndex;
		lOtherAxisIndex = colIndex;
		lHasHeader = this.moGrid.hasRowHeader();
		lHeaders = this.moGrid.getRowHeaders();
		ltAxisHeadersWithTotals = this.moGrid.mtRowHeadersWithTotals;
	}
	else if (axis === oFF.AxisType.COLUMNS)
	{
		lAxisIndex = colIndex;
		lAxisDataIndex = this.mColDataIndex;
		lOtherAxisIndex = rowIndex;
		lHasHeader = this.moGrid.hasColumnHeader();
		lHeaders = this.moGrid.getColumnHeaders();
		ltAxisHeadersWithTotals = this.moGrid.mtColHeadersWithTotals;
	}
	else
	{
		return;
	}
	var lAxisSpan = 1;
	var lOtherAxisSpan = 1;
	var loResultSetInfo = null;
	var lIsScalingInfo = false;
	var lAxisIndexAsString = oFF.XInteger.convertToString(lAxisIndex);
	var lOtherAxisIndexAsString = oFF.XInteger.convertToString(lOtherAxisIndex);
	var lAxisKey = oFF.XStringUtils.concatenate3(lAxisIndexAsString, "/", lOtherAxisIndexAsString);
	if (lHasHeader)
	{
		loResultSetInfo = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), axis, lAxisDataIndex, lOtherAxisIndex);
		var loInternalMeasureDimension = this.moGrid.getQueryModel().getMeasureDimension();
		lIsScalingInfo = this.isScalingFactorCell(loResultSetInfo, rowIndex, colIndex);
		if (lIsScalingInfo)
		{
			var lMeasureIndexOnOtherAxis = lOtherAxisIndex;
			while (loResultSetInfo.getDimension().getInternalObject() !== loInternalMeasureDimension || loResultSetInfo.getTupleElement() === null)
			{
				lMeasureIndexOnOtherAxis = lMeasureIndexOnOtherAxis - 1;
				loResultSetInfo = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), axis, lAxisDataIndex, lMeasureIndexOnOtherAxis);
			}
		}
		if (lAxisDataIndex >= 0 && !lIsScalingInfo)
		{
			lAxisSpan = this.provideTupleElementAxisSpan(loResultSetInfo.getAxis(), lAxisDataIndex, loResultSetInfo.getTupleElement().getIndex());
		}
		if (lAxisSpan > 0)
		{
			if (loResultSetInfo.isTotal())
			{
				if (!ltAxisHeadersWithTotals.containsKey(lAxisKey))
				{
					ltAxisHeadersWithTotals.put(lAxisKey, this);
					lOtherAxisSpan = 1;
					for (var lLookaheadIndex = lOtherAxisIndex + 1; lLookaheadIndex < lHeaders; lLookaheadIndex++)
					{
						var loResultsetInfoLookAheadCol = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), axis, lAxisDataIndex, lLookaheadIndex);
						if (oFF.isNull(loResultsetInfoLookAheadCol))
						{
							continue;
						}
						if (loResultsetInfoLookAheadCol.isTotal())
						{
							var lLookAheadOtherAxisIndexAsString = oFF.XInteger.convertToString(lOtherAxisIndex + lOtherAxisSpan);
							var lLookAheadAxisKey = oFF.XStringUtils.concatenate3(lAxisIndexAsString, "/", lLookAheadOtherAxisIndexAsString);
							ltAxisHeadersWithTotals.put(lLookAheadAxisKey, this);
							lOtherAxisSpan++;
						}
						else
						{
							break;
						}
					}
				}
				else
				{
					if (this.getGrid().isMergeContent())
					{
						lOtherAxisSpan = 0;
					}
				}
			}
		}
	}
	else
	{
		lAxisDataIndex = -1;
	}
	this.mRowSpan = 1;
	this.mColSpan = 1;
	this.mValue = "";
	this.mValueType = oFF.XValueType.STRING;
	this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_HEADER;
	if (!this.getGrid().isMergeContent())
	{
		if (lOtherAxisSpan > 1)
		{
			lOtherAxisSpan = 1;
		}
	}
	if (axis === oFF.AxisType.ROWS)
	{
		this.mRowSpan = lAxisSpan;
		this.mColSpan = lOtherAxisSpan;
	}
	else if (axis === oFF.AxisType.COLUMNS)
	{
		this.mColSpan = lAxisSpan;
		this.mRowSpan = lOtherAxisSpan;
	}
	if (this.mRowSpan > 0 && this.mColSpan > 0)
	{
		if (oFF.notNull(loResultSetInfo))
		{
			this.mtHeaderData.add(loResultSetInfo);
			this.mAxis = loResultSetInfo.getAxis();
			var loDimension = loResultSetInfo.getDimension();
			var loDimensionMember = loResultSetInfo.getDimensionMember();
			var loInternalField = loResultSetInfo.getField();
			var loInternalFieldValue = loResultSetInfo.getFieldValue();
			var loTupleElement = loResultSetInfo.getTupleElement();
			var loRef = null;
			if (loResultSetInfo.isTotal())
			{
				loRef = ltAxisHeadersWithTotals.getByKey(lAxisKey);
				if (loRef === this)
				{
					loRef = null;
				}
			}
			if (oFF.notNull(loRef))
			{
				this.mValue = loRef.mValue;
				this.mValueType = loRef.mValueType;
				this.mStyle = loRef.mStyle;
				this.mFormatString = loRef.mFormatString;
				this.mNodeState = loRef.mNodeState;
				this.mNodeLevel = loRef.mNodeLevel;
				this.mNodeAlignment = loRef.mNodeAlignment;
				return;
			}
			this.mValue = sap.zen.DimensionMember.sGetDimensionMemberText(loDimensionMember, loInternalFieldValue);
			if (lIsScalingInfo)
			{
				if (loDimension.isMeasureStructure())
				{
					var lScalingFactor = loDimensionMember.getScalingFactor();
					if (lScalingFactor > 0)
					{
						this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_INTERNAL_VALUE;
						this.mValueType = oFF.XValueType.INTEGER;
						this.mValue = sap.zen.ResultDataCellWrapper.sGetScalingFactorValueAsStringFromScalingFactor(lScalingFactor);
						this.mFormatString = "* #,###";
					}
					else
					{
						this.mValueType = oFF.XValueType.STRING;
						this.mValue = "";
					}
				}
			}
			if (!lIsScalingInfo)
			{
				this.provideSortInformation(loResultSetInfo, rowIndex, colIndex);
			}
			if (loTupleElement.isTotal(true))
			{
				this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_TOTAL;
				this.mValueType = oFF.XValueType.STRING;
				if (loTupleElement.getIndex() <= 0)
				{
					this.mValue = sap.zen.CLocalizationDataSourceTexts.GRAND_TOTAL.getText(this.getGrid().getMessageLog().getLocalization(), null, null, null);
				}
				else
				{
					this.mValue = sap.zen.CLocalizationDataSourceTexts.TOTAL.getText(this.getGrid().getMessageLog().getLocalization(), null, null, null);
				}
			}
			var ltVisibleFields = loDimension.getResultSetFields();
			if (oFF.isNull(loInternalFieldValue) || oFF.XString.isEqual(ltVisibleFields.get(0), loInternalField.getName()))
			{
				if (loDimension.getProperties().isHierarchyActive() || loDimension.getProperties().isUDHActive() || loDimension.isStructure())
				{
					this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_HIERARCHICAL;
					this.mNodeState = loTupleElement.getCompactDrillState();
					this.mNodeLevel = loTupleElement.getDisplayLevel();
					this.mNodeAlignment = loTupleElement.getNodeAlignment();
				}
			}
		}
	}
};
sap.zen.GridCell.prototype.provideDataCell = function()
{
	this.mRowSpan = 1;
	this.mColSpan = 1;
	var lAmountOfRowTuples = this.moGrid.getResultSet().getAmountOfTuplesOnAxis(oFF.AxisType.ROWS);
	var lAmountOfColTuples = this.moGrid.getResultSet().getAmountOfTuplesOnAxis(oFF.AxisType.COLUMNS);
	var loRowTuple = null;
	var loColTuple = null;
	var lIsTotal = false;
	if (lAmountOfRowTuples > 0 && lAmountOfColTuples > 0)
	{
		loRowTuple = this.moGrid.getResultSet().getTuple(oFF.AxisType.ROWS, this.mRowDataIndex, null, null);
		loColTuple = this.moGrid.getResultSet().getTuple(oFF.AxisType.COLUMNS, this.mColDataIndex, null, null);
		lIsTotal = loRowTuple.isTotal() || loColTuple.isTotal();
	}
	else if (lAmountOfRowTuples > 0)
	{
		loRowTuple = this.moGrid.getResultSet().getTuple(oFF.AxisType.ROWS, this.mRowDataIndex, null, null);
		lIsTotal = loRowTuple.isTotal();
	}
	else if (lAmountOfColTuples > 0)
	{
		loColTuple = this.moGrid.getResultSet().getTuple(oFF.AxisType.COLUMNS, this.mColDataIndex, null, null);
		lIsTotal = loColTuple.isTotal();
	}
	var lNoData = !this.moGrid.getResultSet().hasDataCells();
	if (!lNoData)
	{
		try
		{
			this.moResultDataCell = this.moGrid.getResultSet().getResultDataCell(this.mRowDataIndex, this.mColDataIndex);
			this.mValueType = this.moResultDataCell.getValue().getValueType();
			this.mValue = this.moResultDataCell.getValueAsString();
			if (this.moResultDataCell.isDataEntryEnabled())
			{
				this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_INPUT_ENABLED;
			}
		}
		catch (exception)
		{
			lNoData = true;
		}
	}
	if (lNoData)
	{
		this.moResultDataCell = null;
		this.mValue = "";
		this.mValueType = oFF.XValueType.STRING;
	}
	if (lIsTotal)
	{
		this.mStyle = this.mStyle + sap.zen.GridCell.STYLE_TOTAL;
	}
};
sap.zen.GridCell.prototype.isScalingFactorCell = function(oResultSetInfo, rowIndex, colIndex)
{
	if (oFF.isNull(oResultSetInfo))
	{
		return false;
	}
	if (oResultSetInfo.getAxis() === this.moGrid.getScalingFactorDisplayAxis())
	{
		if (this.moGrid.getScalingFactorDisplayAxis() === oFF.AxisType.ROWS)
		{
			if (colIndex === this.moGrid.getScalingFactorDisplayAxisIndex())
			{
				return true;
			}
		}
		else
		{
			if (rowIndex === this.moGrid.getScalingFactorDisplayAxisIndex())
			{
				return true;
			}
		}
	}
	return false;
};
sap.zen.GridCell.prototype.provideSortInformation = function(oResultSetInfo, rowIndex, colIndex)
{
	if (oFF.isNull(oResultSetInfo))
	{
		return;
	}
	var lOtherAxisIndex = 0;
	var lHeaders = 0;
	if (oResultSetInfo.getAxis() === oFF.AxisType.ROWS)
	{
		lOtherAxisIndex = colIndex;
		lHeaders = this.moGrid.getRowHeaders();
	}
	else if (oResultSetInfo.getAxis() === oFF.AxisType.COLUMNS)
	{
		lOtherAxisIndex = rowIndex;
		lHeaders = this.moGrid.getColumnHeaders();
	}
	var loDimension = oResultSetInfo.getDimension();
	var loInternalField = oResultSetInfo.getField();
	var loTuple = oResultSetInfo.getTuple();
	var lSortAllowed = false;
	if (oFF.isNull(loTuple))
	{
		if (oResultSetInfo.getAxis() === oFF.AxisType.ROWS && !loDimension.isMeasureStructure())
		{
			lSortAllowed = true;
		}
	}
	else
	{
		if (oResultSetInfo.getAxis() === oFF.AxisType.COLUMNS && loDimension.isMeasureStructure())
		{
			lSortAllowed = true;
		}
	}
	if (loDimension.isUDH())
	{
		lSortAllowed = false;
	}
	if (lSortAllowed)
	{
		var ltSettings = null;
		if (oFF.notNull(loTuple))
		{
			if (oResultSetInfo.getTupleElement().getIndex() === this.moGrid.getResultSet().getAmountOfTupleElementsOnAxis(oResultSetInfo.getAxis()) - 1 || lOtherAxisIndex === lHeaders - 1)
			{
				for (var lHeaderIndex = 0; lHeaderIndex < lHeaders; lHeaderIndex++)
				{
					var loResultSetInfoHeader = sap.zen.ResultSetHelper.create(this.moGrid.getResultSet(), oResultSetInfo.getAxis(), oResultSetInfo.getTuple().getIndex(), lHeaderIndex);
					if (oFF.isNull(loResultSetInfoHeader))
					{
						continue;
					}
					if (loResultSetInfoHeader.getDimension().isMeasureStructure())
					{
						var loDimensionMember = oResultSetInfo.getDimensionMember();
						if (oFF.notNull(loDimensionMember))
						{
							ltSettings = oResultSetInfo.getDimension().getProperties().getSortOperation(loDimensionMember.getName());
						}
						break;
					}
				}
			}
		}
		else if (oFF.notNull(loInternalField))
		{
			ltSettings = oResultSetInfo.getDimension().getProperties().getSortOperation(loInternalField.getName());
		}
		this.mSortType = null;
		this.mSortDirection = null;
		if (oFF.notNull(ltSettings) && !ltSettings.isEmpty())
		{
			this.mSortType = ltSettings.getByKey(sap.zen.Dimension.SORT_PARAM_SORTTYPE);
			this.mSortDirection = ltSettings.getByKey(sap.zen.Dimension.SORT_PARAM_SORTDIRECTION);
		}
	}
};
sap.zen.GridCell.prototype.provideTupleElementAxisSpan = function(axis, axisDataIndex, tupleElementIndex)
{
	var lAxisDataIndex = axisDataIndex;
	var lTupleElements = this.moGrid.getResultSet().getAmountOfDimensionsOnAxis(axis);
	var lTuples = this.moGrid.getResultSet().getAmountOfTuplesOnAxis(axis);
	var lTupleIndex = 0;
	if (oFF.notNull(this.moDisplayArea))
	{
		var lOffset = 0;
		var lAmount = 0;
		if (axis === oFF.AxisType.ROWS)
		{
			lOffset = this.moDisplayArea.getRowOffset();
			lAmount = this.moDisplayArea.getAmountOfRows();
		}
		else if (axis === oFF.AxisType.COLUMNS)
		{
			lOffset = this.moDisplayArea.getColumnOffset();
			lAmount = this.moDisplayArea.getAmountOfColumns();
		}
		lAxisDataIndex = lAxisDataIndex - lOffset;
		lTuples = lTuples - lOffset;
		if (lTuples > lAmount)
		{
			lTuples = lAmount;
		}
	}
	var ltSpans = null;
	var ltLastProcessedTupleOfTupleElement = null;
	if (axis === oFF.AxisType.ROWS)
	{
		if (oFF.isNull(this.moGrid.mtRowSpans))
		{
			this.moGrid.mtRowSpans = oFF.XList.create();
		}
		ltSpans = this.moGrid.mtRowSpans;
		if (oFF.isNull(this.moGrid.mtRowsLastProcessedTupleOfTupleElement))
		{
			this.moGrid.mtRowsLastProcessedTupleOfTupleElement = oFF.XArrayOfInt.create(lTupleElements);
		}
		ltLastProcessedTupleOfTupleElement = this.moGrid.mtRowsLastProcessedTupleOfTupleElement;
	}
	else if (axis === oFF.AxisType.COLUMNS)
	{
		if (oFF.isNull(this.moGrid.mtColSpans))
		{
			this.moGrid.mtColSpans = oFF.XList.create();
		}
		ltSpans = this.moGrid.mtColSpans;
		if (oFF.isNull(this.moGrid.mtColsLastProcessedTupleOfTupleElement))
		{
			this.moGrid.mtColsLastProcessedTupleOfTupleElement = oFF.XArrayOfInt.create(lTupleElements);
		}
		ltLastProcessedTupleOfTupleElement = this.moGrid.mtColsLastProcessedTupleOfTupleElement;
	}
	else
	{
		return 1;
	}
	if (ltSpans.isEmpty())
	{
		for (var lTupleElementIndex = 0; lTupleElementIndex < lTupleElements; lTupleElementIndex++)
		{
			var ltTuplesArray = oFF.XArrayOfInt.create(lTuples);
			ltSpans.add(ltTuplesArray);
		}
	}
	if (this.moGrid.isMergeContent())
	{
		var lLastProcessedTuple = ltLastProcessedTupleOfTupleElement.get(tupleElementIndex);
		if (lLastProcessedTuple <= lAxisDataIndex)
		{
			for (lTupleIndex = lLastProcessedTuple; lTupleIndex < lTuples; lTupleIndex++)
			{
				var lCorrectTupleIndex = lTupleIndex;
				if (oFF.notNull(this.moDisplayArea))
				{
					if (axis === oFF.AxisType.ROWS)
					{
						lCorrectTupleIndex = lTupleIndex + this.moDisplayArea.getRowOffset();
					}
					else if (axis === oFF.AxisType.COLUMNS)
					{
						lCorrectTupleIndex = lTupleIndex + this.moDisplayArea.getColumnOffset();
					}
				}
				var loTuple = this.moGrid.getResultSet().getTuple(axis, lCorrectTupleIndex, null, null);
				var loTupleElement = loTuple.getTupleElement(tupleElementIndex, null);
				if (loTuple.isEqualTo(loTupleElement.getFirstTuple()) || lTupleIndex === 0)
				{
					ltSpans.get(tupleElementIndex).set(lTupleIndex, 1);
					ltLastProcessedTupleOfTupleElement.set(tupleElementIndex, lTupleIndex);
					if (lTupleIndex > lAxisDataIndex)
					{
						break;
					}
				}
				else
				{
					var lLastTupleOfTupleElement = ltLastProcessedTupleOfTupleElement.get(tupleElementIndex);
					var lSpan = ltSpans.get(tupleElementIndex).get(lLastTupleOfTupleElement) + 1;
					ltSpans.get(tupleElementIndex).set(lLastTupleOfTupleElement, lSpan);
					ltSpans.get(tupleElementIndex).set(lTupleIndex, 0);
				}
			}
		}
	}
	else
	{
		ltSpans.get(tupleElementIndex).set(lAxisDataIndex, 1);
	}
	return ltSpans.get(tupleElementIndex).get(lAxisDataIndex);
};
