sap.zen.ResultSetHelper.prototype.reset = function()
{
	this.moResultSet = null;
	this.mAxis = null;
	this.moTuple = null;
	this.moTupleElement = null;
	this.moDimension = null;
	this.moDimensionMember = null;
	this.moField = null;
	this.moFieldValue = null;
	this.mKey = null;
};
sap.zen.ResultSetHelper.prototype.initMe = function(oResultSet, axis, tupleIndex, index)
{
	this.reset();
	var lIndex = index;
	this.moResultSet = oResultSet;
	var loQueryModel = this.moResultSet.getDataSource().getQueryManager().getQueryModel();
	this.mAxis = loQueryModel.getAxis(axis).getType();
	if (tupleIndex >= 0)
	{
		this.moTuple = this.moResultSet.getTuple(this.mAxis, tupleIndex, null, null);
	}
	var ltDimensions = this.moResultSet.getAxisDimensions(this.mAxis);
	var lKey = "";
	var j = 0;
	if (oFF.notNull(ltDimensions) && !ltDimensions.isEmpty())
	{
		var loDimensionIterator = ltDimensions.getIterator();
		while (loDimensionIterator.hasNext())
		{
			this.moDimension = loDimensionIterator.next();
			if (oFF.isNull(this.moDimension))
			{
				continue;
			}
			var loInternalDimension = this.moDimension.getInternalObject();
			if (oFF.isNull(loInternalDimension))
			{
				continue;
			}
			var loTupleElement = null;
			if (oFF.notNull(this.moTuple))
			{
				loTupleElement = this.moTuple.getTupleElement(-1, this.moDimension);
			}
			if (oFF.notNull(loTupleElement))
			{
				var lDimensionMemberName = sap.zen.ResultSetHelper.getDimensionMemberName(loTupleElement.getDimensionMember());
				lKey = oFF.XStringUtils.concatenate2(lKey, lDimensionMemberName);
				lKey = oFF.XStringUtils.concatenate2(lKey, "/");
			}
			var ltVisibleFields = this.moDimension.getResultSetFields();
			var lVisibleFieldsCnt = ltVisibleFields.size();
			if (lIndex >= 0 && lIndex < j + lVisibleFieldsCnt)
			{
				lIndex = lIndex - j;
				var lVisibleFieldName = ltVisibleFields.get(lIndex);
				this.moField = loInternalDimension.getFieldByName(lVisibleFieldName);
				if (oFF.notNull(loTupleElement))
				{
					this.moTupleElement = loTupleElement;
					this.moDimension = loTupleElement.getDimension();
					this.moDimensionMember = loTupleElement.getDimensionMember();
					this.mKey = lKey;
					if (!this.moDimensionMember.isTotal())
					{
						var loInternalDimensionMember = this.moDimensionMember.getInternalObject();
						this.moFieldValue = loInternalDimensionMember.getFieldValue(this.moField);
						if (oFF.isNull(this.moFieldValue))
						{
							this.moFieldValue = loInternalDimensionMember.getKeyFieldValue();
						}
					}
				}
				return;
			}
			j = j + lVisibleFieldsCnt;
		}
	}
};
