sap.zen.VariableWrapper.createWrapper = function(oDataSource, oInternalVariable)
{
	var lVariableType = oInternalVariable.getVariableType();
	if (lVariableType.isEqualTo(oFF.VariableType.DIMENSION_MEMBER_VARIABLE) || lVariableType.isEqualTo(oFF.VariableType.HIERARCHY_NODE_VARIABLE))
	{
		return sap.zen.CharacteristicMemberVariableWrapper.createVariableWrapper(oDataSource, oInternalVariable);
	}
	else if (lVariableType.isEqualTo(oFF.VariableType.OPTION_LIST_VARIABLE) || lVariableType.isEqualTo(oFF.OlapComponentType.HIERARCHY))
	{
		return sap.zen.OptionListVariableWrapper.createVariableWrapper2(oInternalVariable);
	}
	else if (lVariableType.isEqualTo(oFF.VariableType.SIMPLE_TYPE_VARIABLE) || lVariableType.isEqualTo(oFF.VariableType.FORMULA_VARIABLE) || lVariableType.isEqualTo(oFF.VariableType.TEXT_VARIABLE))
	{
		return sap.zen.TextVariableWrapper.createVariableWrapper(oInternalVariable);
	}
	else if (lVariableType.isEqualTo(oFF.VariableType.HIERARCHY_NAME_VARIABLE))
	{
		return sap.zen.HierarchyVariableWrapper.createVariableWrapper2(oDataSource, oInternalVariable);
	}
	else
	{
		sap.zen.CLocalizationDataSourceMessages.UNSUPPORTED_VAR_TYPE.addMessageToMessageHandler(oDataSource.getMessageWriter(), oFF.Severity.ERROR, lVariableType.getName(), oInternalVariable.getName(), null);
	}
	return null;
};
