sap.zen.VariablesUtils = {

	getVariable_DataSource:function(oDataSource, variableName)
	{
			if (oFF.isNull(oDataSource))
		{
			return null;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return null;
		}
		return sap.zen.VariablesUtils.getVariable_VariableProcessor(loVariableProcessor, variableName);
	},
	getVariable_VariableProcessor:function(oVariableProcessor, variableName)
	{
			if (oFF.isNull(oVariableProcessor))
		{
			return null;
		}
		if (!oVariableProcessor.hasVariables())
		{
			return null;
		}
		var ltInternalVariables = oVariableProcessor.getVariables();
		if (ltInternalVariables.containsKey(variableName))
		{
			var loInternalVariable = ltInternalVariables.getByKey(variableName);
			return loInternalVariable;
		}
		return null;
	},
	getInputEnabledVariable_DataSource:function(oDataSource, variableName)
	{
			if (oFF.isNull(oDataSource))
		{
			return null;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return null;
		}
		return sap.zen.VariablesUtils.getInputEnabledVariable_VariableProcessor(loVariableProcessor, variableName);
	},
	getInputEnabledVariable_VariableProcessor:function(oVariableProcessor, variableName)
	{
			var loInternalVariable = sap.zen.VariablesUtils.getVariable_VariableProcessor(oVariableProcessor, variableName);
		if (loInternalVariable.isInputEnabled())
		{
			return loInternalVariable;
		}
		return null;
	},
	hasInputEnabledVariables_DataSources:function(tDataSources)
	{
			if (oFF.isNull(tDataSources))
		{
			return false;
		}
		var lHasInputEnabledVariables = false;
		var loDataSourceIterator = tDataSources.getIterator();
		while (loDataSourceIterator.hasNext())
		{
			var loDataSource = loDataSourceIterator.next();
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			lHasInputEnabledVariables = lHasInputEnabledVariables || sap.zen.VariablesUtils.hasInputEnabledVariables_DataSource(loDataSource);
			if (lHasInputEnabledVariables)
			{
				break;
			}
		}
		return lHasInputEnabledVariables;
	},
	hasInputEnabledVariables_DataSource:function(oDataSource)
	{
			if (oFF.isNull(oDataSource))
		{
			return false;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return false;
		}
		return sap.zen.VariablesUtils.hasInputEnabledVariables_VariableProcessor(loVariableProcessor);
	},
	hasInputEnabledVariables_VariableProcessor:function(oVariableProcessor)
	{
			if (oFF.isNull(oVariableProcessor))
		{
			return false;
		}
		if (!oVariableProcessor.hasVariables() || !oVariableProcessor.hasInputEnabledVariables())
		{
			return false;
		}
		var ltInternalInputEnabledVariables = oVariableProcessor.getInputEnabledVariables();
		if (oFF.notNull(ltInternalInputEnabledVariables) && !ltInternalInputEnabledVariables.isEmpty())
		{
			return true;
		}
		return false;
	},
	hasMandatoryVariables_DataSources:function(tDataSources)
	{
			if (oFF.isNull(tDataSources))
		{
			return false;
		}
		var lHasMandatoryVariables = false;
		var loDataSourceIterator = tDataSources.getIterator();
		while (loDataSourceIterator.hasNext())
		{
			var loDataSource = loDataSourceIterator.next();
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			lHasMandatoryVariables = lHasMandatoryVariables || sap.zen.VariablesUtils.hasMandatoryVariables_DataSource(loDataSource);
			if (lHasMandatoryVariables)
			{
				break;
			}
		}
		return lHasMandatoryVariables;
	},
	hasMandatoryVariables_DataSource:function(oDataSource)
	{
			if (oFF.isNull(oDataSource))
		{
			return false;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return false;
		}
		if (!loVariableProcessor.hasVariables())
		{
			return false;
		}
		var ltInternalVariables = loVariableProcessor.getVariables();
		for (var lVariableIndex = 0; lVariableIndex < ltInternalVariables.size(); lVariableIndex++)
		{
			var loInternalVariable = ltInternalVariables.get(lVariableIndex);
			if (oFF.isNull(loInternalVariable))
			{
				continue;
			}
			if (loInternalVariable.isMandatory())
			{
				var loVariableWrapper = sap.zen.VariableWrapper.createWrapper(oDataSource, loInternalVariable);
				if (oFF.notNull(loVariableWrapper))
				{
					if (!loVariableWrapper.hasValue())
					{
						return true;
					}
				}
			}
		}
		return false;
	},
	submitVariables_DataSources:function(oDataSourceIterator)
	{
			if (oFF.isNull(oDataSourceIterator))
		{
			return true;
		}
		var lSuccess = false;
		var lHasErrors = false;
		while (oDataSourceIterator.hasNext())
		{
			var loDataSource = oDataSourceIterator.next();
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			lSuccess = sap.zen.VariablesUtils.submitVariables_DataSource(loDataSource);
			lHasErrors = lHasErrors || !lSuccess;
		}
		lSuccess = !lHasErrors;
		return lSuccess;
	},
	submitVariables_DataSource:function(oDataSource)
	{
			if (oFF.isNull(oDataSource))
		{
			return true;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return true;
		}
		var loResult = sap.zen.VariablesUtils.submitVariables_VariableProcessor(loVariableProcessor);
		var lProcessed = oFF.notNull(loResult) && loResult.getData() !== null;
		var lHasErrors = oFF.isNull(loResult) || loResult.hasErrors();
		if (!loVariableProcessor.hasVariables() && !oDataSource.getQueryManager().getQueryModel().getModelCapabilities().supportsExtendedVariableDefinition())
		{
			lProcessed = true;
			lHasErrors = false;
		}
		if (lProcessed)
		{
			if (lHasErrors)
			{
				oDataSource.getPage().createMessagesFromCollectionForCategory(sap.zen.CMessageCategory.VARIABLES, loResult);
			}
			else
			{
				oDataSource.getPage().createMessagesFromCollectionForCategory(sap.zen.CMessageCategory.VARIABLES, loResult);
				oDataSource.raiseDataSourceChangedEvent(null, true, false);
			}
		}
		var lSuccess = !lHasErrors;
		return lSuccess;
	},
	submitVariables_VariableProcessor:function(oVariableProcessor)
	{
			if (oFF.notNull(oVariableProcessor))
		{
			if (oVariableProcessor.isSubmitNeeded() && !oVariableProcessor.isSubmitted())
			{
				if (oVariableProcessor.isDirectVariableTransferEnabled())
				{
					return oVariableProcessor.checkVariables(oFF.SyncType.BLOCKING, null, null);
				}
				return oVariableProcessor.submitVariables(oFF.SyncType.BLOCKING, null, null);
			}
		}
		return oFF.ExtResult.create(null, null);
	},
	transferVariables_DataSources:function(oDataSourceIterator)
	{
			if (oFF.isNull(oDataSourceIterator))
		{
			return false;
		}
		var lSuccess = false;
		var lHasErrors = false;
		while (oDataSourceIterator.hasNext())
		{
			var loDataSource = oDataSourceIterator.next();
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			lSuccess = sap.zen.VariablesUtils.transferVariables_DataSource(loDataSource);
			lHasErrors = lHasErrors || !lSuccess;
		}
		lSuccess = !lHasErrors;
		return lSuccess;
	},
	transferVariables_DataSource:function(oDataSource)
	{
			if (oFF.isNull(oDataSource))
		{
			return false;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return false;
		}
		var loResult = sap.zen.VariablesUtils.transferVariables_VariableProcessor(loVariableProcessor);
		var lProcessed = oFF.notNull(loResult) && loResult.getData() !== null;
		var lHasErrors = oFF.isNull(loResult) || loResult.hasErrors();
		if (lProcessed)
		{
			if (lHasErrors)
			{
				oDataSource.getPage().createMessagesFromCollectionForCategory(sap.zen.CMessageCategory.VARIABLES, loResult);
			}
			else
			{
				oDataSource.getPage().createMessagesFromCollectionForCategory(sap.zen.CMessageCategory.VARIABLES, loResult);
			}
		}
		var lSuccess = !lHasErrors;
		return lSuccess;
	},
	transferVariables_VariableProcessor:function(oVariableProcessor)
	{
			if (oFF.notNull(oVariableProcessor))
		{
			return oVariableProcessor.transferVariables(oFF.SyncType.BLOCKING, null, null);
		}
		return oFF.ExtResult.create(null, null);
	},
	synchronize_DataSources:function(oDataSourceIterator)
	{
			if (oFF.isNull(oDataSourceIterator))
		{
			return false;
		}
		var lSuccess = false;
		while (oDataSourceIterator.hasNext())
		{
			var loDataSource = oDataSourceIterator.next();
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			lSuccess = lSuccess || sap.zen.VariablesUtils.synchronize_DataSource(loDataSource);
		}
		return lSuccess;
	},
	synchronize_DataSource:function(oDataSource)
	{
			if (oFF.isNull(oDataSource))
		{
			return false;
		}
		var loVariableProcessor = oDataSource.getVariableProcessor();
		if (oFF.isNull(loVariableProcessor))
		{
			return false;
		}
		return sap.zen.VariablesUtils.synchronize_VariableProcessor(loVariableProcessor);
	},
	synchronize_VariableProcessor:function(oVariableProcessor)
	{
			if (oFF.isNull(oVariableProcessor))
		{
			return false;
		}
		if (oVariableProcessor.supportsReInitVariables() && oVariableProcessor.isSubmitted())
		{
			var loResult = oVariableProcessor.reInitVariablesAfterSubmit(oFF.SyncType.BLOCKING, null, null);
			if (loResult.hasErrors() || loResult.getData() !== null && !loResult.getData().isSuccessfullyProcessed())
			{
				throw oFF.XException.createRuntimeException("could not re-init variables");
			}
			return true;
		}
		return false;
	},
	requiresVariableDialog_DataSources:function(oPage, tDataSources)
	{
			var lShowVariableDialog = false;
		if (oFF.notNull(oPage))
		{
			var loApplicationProperties = oPage.getApplicationPropertiesComponent();
			if (oFF.notNull(loApplicationProperties))
			{
				lShowVariableDialog = loApplicationProperties.isShowPrompt();
			}
		}
		var ltDataSources = tDataSources;
		if (oFF.isNull(ltDataSources) && oFF.notNull(oPage))
		{
			ltDataSources = oPage.getDataSources();
		}
		var lVariableDialogRequired = false;
		lVariableDialogRequired = sap.zen.VariablesUtils.hasMandatoryVariables_DataSources(ltDataSources);
		lVariableDialogRequired = lVariableDialogRequired || lShowVariableDialog && sap.zen.VariablesUtils.hasInputEnabledVariables_DataSources(ltDataSources);
		return lVariableDialogRequired;
	},
	requiresVariableDialog_DataSource:function(oDataSource)
	{
			var ltDataSources = oFF.XList.create();
		ltDataSources.add(oDataSource);
		return sap.zen.VariablesUtils.requiresVariableDialog_DataSources(oDataSource.getPage(), ltDataSources);
	}
};

