sap.zen.JsonDataProjector.prototype.render = function(tProjectionInformation)
{
	var loResultSetPaging = this.moResultSet.getServerPaging();
	var lTooMuchData = false;
	var ltAxisPaging = loResultSetPaging.getAxesPaging();
	var loAxisPagingIterator = ltAxisPaging.getIterator();
	while (loAxisPagingIterator.hasNext())
	{
		var loAxisPaging = loAxisPagingIterator.next();
		if (oFF.isNull(loAxisPaging))
		{
			continue;
		}
		if (loAxisPaging.isSizeGreaterThanDefaultMaxSize(loAxisPaging.getSize()))
		{
			lTooMuchData = true;
		}
	}
	if (lTooMuchData)
	{
		sap.zen.CLocalizationDataSourceMessages.RESULTSET_TOO_LARGE.addMessageToMessageHandler(this.moMessageManager, oFF.Severity.ERROR, null, null, null);
	}
	var lIncludeMetadata = false;
	var loProjectionInformationIterator = tProjectionInformation.getIterator();
	while (loProjectionInformationIterator.hasNext())
	{
		var loProjectionInformation = loProjectionInformationIterator.next();
		if (oFF.isNull(loProjectionInformation))
		{
			continue;
		}
		var lPropertyName = loProjectionInformation.getPropertyName();
		if (oFF.isNull(lPropertyName) || oFF.XString.isEqual("", lPropertyName))
		{
			continue;
		}
		var selectionMap = sap.zen.ProjectionUtil.parseProjectionInstancesFromJson(loProjectionInformation.getSelection());
		var loCellRenderer = sap.zen.CellSetRenderer.create(this, loProjectionInformation, this.mtProjectionDimensions, selectionMap);
		if (!loCellRenderer.checkProjectionInstances(false))
		{
			this.moRenderSerializer.addAttribute(lPropertyName, null);
		}
		else
		{
			this.moRenderSerializer.openTag(lPropertyName);
			loCellRenderer.render();
			if (loProjectionInformation.isIncludeMetadata())
			{
				this.renderMetadata();
			}
			if (loProjectionInformation.isIncludeAxesTuples())
			{
				loCellRenderer.renderAxes();
			}
			loCellRenderer.renderRowAndColumsCount();
			this.moRenderSerializer.closeTag();
		}
		if (loProjectionInformation.isFillMetadataProperty())
		{
			lIncludeMetadata = true;
		}
	}
	if (lIncludeMetadata)
	{
		this.moRenderSerializer.openTag("metadata");
		this.renderMetadata();
		this.moRenderSerializer.closeTag();
	}
};
sap.zen.JsonDataProjector.prototype.renderMetadata = function()
{
	this.moRenderSerializer.openArray("dimensions");
	var loProjectionDimensionIterator = this.mtProjectionDimensions.getIterator();
	while (loProjectionDimensionIterator.hasNext())
	{
		var loProjectionDimension = loProjectionDimensionIterator.next();
		if (oFF.isNull(loProjectionDimension))
		{
			continue;
		}
		loProjectionDimension.render();
	}
	this.moRenderSerializer.closeArray();
	if (oFF.notNull(this.moMeasureProjectionDimension))
	{
		this.moRenderSerializer.openArray("externalDimensions");
		this.moMeasureProjectionDimension.render();
		this.moRenderSerializer.closeArray();
	}
	this.moRenderSerializer.addAttribute("locale", "en");
};

