sap.zen.ProjectionUtil = {

	parseProjectionInstancesFromJson:function(json)
	{
			var ltProjectionInstances = oFF.XHashMapByString.create();
		if (oFF.notNull(json) && oFF.XString.size(json) > 0)
		{
			var loJsonElement = null;
			try
			{
				var loJsonParser = oFF.JsonParserFactory.newInstance();
				loJsonElement = loJsonParser.parse(json);
			}
			catch (t)
			{
				loJsonElement = null;
			}
			if (oFF.notNull(loJsonElement))
			{
				sap.zen.ProjectionUtil.paseProjectionInstancesFromJsonElement(null, loJsonElement, ltProjectionInstances);
			}
		}
		return ltProjectionInstances;
	},
	paseProjectionInstancesFromJsonElement:function(elementName, oJsonElement, tProjectionInstances)
	{
			var loJsonElement = null;
		if (oJsonElement.getType().isEqualTo(oFF.PrElementType.STRING))
		{
			var lJsonString = oFF.XStringValue.create(oJsonElement.asString().getString());
			var loProjectionInstance = sap.zen.ProjectionInstance.createForString(lJsonString);
			tProjectionInstances.put(elementName, loProjectionInstance);
		}
		else if (oJsonElement.getType().isEqualTo(oFF.PrElementType.STRUCTURE))
		{
			var loJsonStructure = oJsonElement.asStructure();
			var ltElements = loJsonStructure.getKeysAsReadOnlyListOfString();
			for (var lStructureElementIndex = 0; lStructureElementIndex < ltElements.size(); lStructureElementIndex++)
			{
				var lElementName = ltElements.get(lStructureElementIndex);
				loJsonElement = loJsonStructure.getByKey(lElementName);
				sap.zen.ProjectionUtil.paseProjectionInstancesFromJsonElement(lElementName, loJsonElement, tProjectionInstances);
			}
		}
		else if (oJsonElement.getType().isEqualTo(oFF.PrElementType.LIST))
		{
			var loJsonList = oJsonElement.asList();
			for (var lListIndex = 0; lListIndex < loJsonList.size(); lListIndex++)
			{
				loJsonElement = loJsonList.get(lListIndex);
				if (oFF.isNull(loJsonElement))
				{
					continue;
				}
				sap.zen.ProjectionUtil.paseProjectionInstancesFromJsonElement(elementName, loJsonElement, tProjectionInstances);
			}
		}
	},
	stringifyCartesianSelection:function(tMap)
	{
			var lJson = "{";
		var loMapKeyIterator = tMap.getKeysAsIteratorOfString();
		while (loMapKeyIterator.hasNext())
		{
			var lKey = loMapKeyIterator.next();
			lJson = oFF.XStringUtils.concatenate4(lJson, "\"", lKey, "\": ");
			var lValue = tMap.getByKey(lKey);
			lJson = oFF.XStringUtils.concatenate4(lJson, "\"", lValue, "\"");
			if (loMapKeyIterator.hasNext())
			{
				lJson = oFF.XStringUtils.concatenate2(lJson, ", ");
			}
		}
		lJson = oFF.XStringUtils.concatenate2(lJson, "}");
		return lJson;
	},
	stringifyCartesianSelection2:function(selection)
	{
			return "";
	}
};

