sap.zen.BookmarkManager.prototype.saveSfinBookmarkInternal = function(bookmarkID, name, isGlobal, isInternal, includeVariables)
{
	var lGroupId = "";
	if (isInternal)
	{
		lGroupId = "SAP:INTERNAL";
	}
	var lBookmarkID = bookmarkID;
	var loBookmark = this.createBookmark(lBookmarkID, name, includeVariables);
	lBookmarkID = this.moBookmarkService.saveData(lBookmarkID, name, loBookmark.getBookmark(), this.mAppId, this.moPage, this.BOOKMARK_TYPE, lGroupId, isGlobal);
	return lBookmarkID;
};
