sap.zen.BookmarkManager.prototype.applyApplicationState = function(appState, includeVariables)
{
	if (oFF.notNull(appState))
	{
		var loBookmark = new sap.zen.Bookmark();
		loBookmark.initMe(null, null, appState, null);
		this.loadBookmarkInternal(loBookmark, includeVariables);
	}
	else
	{
		sap.zen.CLocalizationBookmarkMessages.ID_0008.addMessageToMessageHandler(this.moPage, oFF.Severity.ERROR, "", null, null);
	}
};
sap.zen.BookmarkManager.prototype.saveSfinBookmark = function(name, isGlobal, isInternal)
{
	return this.saveSfinBookmarkInternal(null, name, isGlobal, isInternal, true);
};
sap.zen.BookmarkManager.prototype.loadSfinBookmark = function(bookmarkID)
{
	this.loadSfinBookmarkInternal(bookmarkID, true);
};
sap.zen.BookmarkManager.prototype.loadSfinBookmarkInternal = function(bookmarkID, includeVariables)
{
	if (oFF.notNull(bookmarkID) && oFF.XString.size(bookmarkID) > 0)
	{
		var lData = this.moBookmarkService.getData(bookmarkID, this.moPage);
		if (oFF.notNull(lData))
		{
			var loBookmark = new sap.zen.Bookmark();
			loBookmark.initMe(null, null, lData, bookmarkID);
			this.loadBookmarkInternal(loBookmark, includeVariables);
		}
		else
		{
			sap.zen.CLocalizationBookmarkMessages.ID_0008.addMessageToMessageHandler(this.moPage, oFF.Severity.ERROR, bookmarkID, null, null);
		}
	}
};
sap.zen.BookmarkManager.prototype.createBookmark = function(bookmarkID, name, includeVariables)
{
	var loBookmark = new sap.zen.Bookmark();
	var lBookmarkContent = "<bookmark>";
	var ltDataSources = this.moPage.getDataSources();
	var loDataSourceIterator = ltDataSources.getIterator();
	while (loDataSourceIterator.hasNext())
	{
		var loDataSource = loDataSourceIterator.next();
		var lDataSourceBookmarkContent = loDataSource.getQueryBookmarkContent(includeVariables);
		lBookmarkContent = oFF.XStringUtils.concatenate2(lBookmarkContent, lDataSourceBookmarkContent);
	}
	this.moPage.updateVariables();
	var loAppPropsComponent = this.moPage.getApplicationPropertiesComponent();
	var lAppPropsBookmarkContent = loAppPropsComponent.getBookmarkContent();
	lBookmarkContent = oFF.XStringUtils.concatenate2(lBookmarkContent, lAppPropsBookmarkContent);
	lBookmarkContent = oFF.XStringUtils.concatenate2(lBookmarkContent, "</bookmark>");
	loBookmark.initMe(name, bookmarkID, lBookmarkContent, null);
	return loBookmark;
};
sap.zen.BookmarkManager.prototype.loadBookmarkInternal = function(oBookmark, includeVariables)
{
	var lContent = oBookmark.getBookmark();
	var loRootNode = sap.buddha.XXmlUtils.getRootNode(lContent);
	var ltDataSourceNodes = loRootNode.getChildren("data_source_alias").getIterator();
	while (ltDataSourceNodes.hasNext())
	{
		var loDataSourceNode = ltDataSourceNodes.next();
		var lDataSourceName = loDataSourceNode.getAttribute("name");
		var loDataSource = this.moPage.getDataSource(lDataSourceName);
		loDataSource.applyQueryBookmarkContent(loDataSourceNode, includeVariables);
	}
	var ltComponentNodes = loRootNode.getChildren("component").getIterator();
	while (ltComponentNodes.hasNext())
	{
		var loComponentNodeIterator = ltComponentNodes.next();
		var lComponentName = loComponentNodeIterator.getAttribute("name");
		var loComponent = this.moPage.getComponent(lComponentName);
		loComponent.applyGlobalVariableInitParameters(loComponentNodeIterator);
		if (oFF.XString.compare(loComponent.getType(), "APPLICATION_PROPERTIES") === 0)
		{
			var loAppPropsComponent = loComponent;
			loAppPropsComponent.applyGlobalVariableValues(this.moPage.getWindow());
		}
	}
};
