sap.zen.BookmarkService.prototype._ff_c = "BookmarkService";

sap.zen.BookmarkService.soParser = null;
sap.zen.BookmarkService.prototype.setup = function()
{
	sap.zen.BookmarkService.soParser = new sap.zen.ODataBookmarkParser();
};
sap.zen.BookmarkService.prototype.getData = function(bookmarkID, oPage)
{
	var lBookmarkXML = "";
	var loBookmarkRequestHandler = oPage.getBookmarkRequestHandler();
	var loSystemDescription = loBookmarkRequestHandler.getSelf();
	if (oFF.notNull(loSystemDescription) && loSystemDescription.getSystemType().isTypeOf(oFF.SystemType.ABAP))
	{
		lBookmarkXML = loBookmarkRequestHandler.callGetBookmarkXmlRequest(bookmarkID).get(2).toString();
	}
	return lBookmarkXML;
};
sap.zen.BookmarkService.prototype.saveData = function(bookmarkID, title, content, appId, oPage, bookmarkType, groupId, isGlobal)
{
	var lBookmarkID = bookmarkID;
	var loBookmarkRequestHandler = oPage.getBookmarkRequestHandler();
	var loSystemDescription = loBookmarkRequestHandler.getSelf();
	if (oFF.notNull(loSystemDescription) && loSystemDescription.getSystemType().isTypeOf(oFF.SystemType.ABAP))
	{
		lBookmarkID = loBookmarkRequestHandler.callSaveBookmarkRequest(sap.zen.BookmarkService.soParser.buildJsonPostRequest(lBookmarkID, title, content, bookmarkType, oPage.getAppName(), oPage.getDataSources(), groupId, isGlobal));
	}
	return lBookmarkID;
};
sap.zen.BookmarkService.prototype.deleteData = function(bookmarkID, appId, oPage, bookmarkType)
{
	var loBookmarkRequestHandler = oPage.getBookmarkRequestHandler();
	var loSystemDescription = loBookmarkRequestHandler.getSelf();
	if (oFF.notNull(loSystemDescription) && loSystemDescription.getSystemType().isTypeOf(oFF.SystemType.ABAP))
	{
		if (oFF.notNull(bookmarkID))
		{
			loBookmarkRequestHandler.callDeleteBookmarkRequest(bookmarkID);
		}
		else
		{
			loBookmarkRequestHandler.callDeleteAllBookmarksRequest(oPage.getAppName(), bookmarkType);
		}
	}
};
sap.zen.BookmarkService.prototype.getAllData = function(appid, oPage, bookmarkType, groupIdentifier, mode)
{
	var ltBookmarks = oFF.XList.create();
	var loBookmarkRequestHandler = oPage.getBookmarkRequestHandler();
	var loSystemDescription = loBookmarkRequestHandler.getSelf();
	if (oFF.notNull(loSystemDescription) && loSystemDescription.getSystemType().isTypeOf(oFF.SystemType.ABAP))
	{
		var ltDatasources = oPage.getDataSources().getValuesAsReadOnlyList();
		var ltQueries = oFF.XList.create();
		for (var lDataSourceIndex = 0; lDataSourceIndex < ltDatasources.size(); lDataSourceIndex++)
		{
			var loDataSource = ltDatasources.get(lDataSourceIndex);
			if (oFF.isNull(loDataSource))
			{
				continue;
			}
			ltQueries.add(oFF.XStringValue.create(loDataSource.getQueryTechnicalName()));
		}
		var ltAllBookmarks = loBookmarkRequestHandler.callGetAllBookmarksXmlRequest(oPage.getAppName(), bookmarkType, groupIdentifier, ltQueries, mode);
		if (oFF.notNull(ltAllBookmarks))
		{
			var loAllBookmarkKeysIterator = ltAllBookmarks.getKeysAsIteratorOfString();
			while (loAllBookmarkKeysIterator.hasNext())
			{
				var lBookmarkKey = loAllBookmarkKeysIterator.next();
				var loBookmark = ltAllBookmarks.getByKey(lBookmarkKey);
				ltBookmarks.add(loBookmark);
			}
		}
	}
	return ltBookmarks;
};

