sap.zen.Factory.prototype.createObjectInternal = function(type, uid, oPage, oInitParametersNode, oParent, callBeforeRendering)
{
	var loFactory = this.mtFactories.getByKey(type);
	if (oFF.isNull(loFactory))
	{
		loFactory = new sap.zen.SDKComponentFactory();
	}
	if (loFactory.isSDK())
	{
		if (loFactory.loadSdkExtension(type, oPage) === false)
		{
			return null;
		}
	}
	var loInitParametersNode = oInitParametersNode;
	var loPageObject = loFactory.createObject(loInitParametersNode);
	if (oFF.notNull(loPageObject))
	{
		if (oFF.isNull(loInitParametersNode))
		{
			loInitParametersNode = loPageObject.createEmptyInitParameter(uid, type);
		}
		this.translateComponentProperties(uid, oPage, loInitParametersNode);
		loPageObject.initBase(uid, type, oPage, oParent, loInitParametersNode);
		loPageObject.create();
		if (callBeforeRendering)
		{
			loPageObject.beforeInitialRendering();
		}
		loPageObject.setContentChanged(true);
	}
	return loPageObject;
};
sap.zen.Factory.prototype.translateComponentProperties = function(componentId, oPage, oInitParametersNode)
{
	var ltKeys = oPage.getTranslatedTextsFor(componentId);
	if (ltKeys.isEmpty())
	{
		return;
	}
	for (var lKeyIndex = 0; lKeyIndex < ltKeys.size(); lKeyIndex++)
	{
		var lKey = ltKeys.get(lKeyIndex);
		var lTextID = null;
		var lDotPosition = oFF.XString.indexOf(lKey, ".");
		if (lDotPosition >= 0)
		{
			lTextID = oFF.XString.substring(lKey, lDotPosition + 1, -1);
		}
		this.setValue(oInitParametersNode, lTextID, oPage.getTranslatedText(lKey));
	}
};
sap.zen.Factory.prototype.doInit = function()
{
	this.mtFactories = oFF.XHashMapByString.create();
};
sap.zen.Factory.prototype.setValue = function(oNode, textID, text)
{
	var lPropertyName;
	var rest = null;
	var lDotPosition = oFF.XString.indexOf(textID, ".");
	if (lDotPosition >= 0)
	{
		lPropertyName = oFF.XString.substring(textID, 0, lDotPosition);
		rest = oFF.XString.substring(textID, lDotPosition + 1, -1);
	}
	else
	{
		lPropertyName = textID;
	}
	var loProprtyNode = null;
	try
	{
		oFF.XInteger.convertFromString(lPropertyName);
		loProprtyNode = oNode.getFirstChildWithAttributeValue("bi:property", "index", lPropertyName, false);
	}
	catch (e)
	{
		loProprtyNode = oNode.getFirstChildWithAttributeValue("bi:property", "name", lPropertyName, false);
	}
	if (oFF.isNull(loProprtyNode))
	{
		var loOrderedListNode = oNode.getFirstChildWithAttributeValue("bi:property", "type", "ORDEREDLIST", false);
		if (oFF.notNull(loOrderedListNode))
		{
			var loOrderedListChildNodeIterator = loOrderedListNode.getAllChildren().getIterator();
			while (loOrderedListChildNodeIterator.hasNext())
			{
				var loOrderedListChildNode = loOrderedListChildNodeIterator.next();
				var loOrderedListChildValueNode = loOrderedListChildNode.getFirstChildWithAttributeValue("bi:property", "name", "VALUE", false);
				if (oFF.notNull(loOrderedListChildValueNode) && oFF.XString.isEqual(loOrderedListChildValueNode.getAttribute("value"), textID))
				{
					var loOrderedListChildTextNode = loOrderedListChildNode.getFirstChildWithAttributeValue("bi:property", "name", "TEXT", false);
					if (oFF.notNull(loOrderedListChildTextNode))
					{
						loOrderedListChildTextNode.setAttribute("value", text);
					}
					break;
				}
			}
		}
		return;
	}
	if (oFF.isNull(rest))
	{
		loProprtyNode.setAttribute("value", text);
	}
	else
	{
		this.setValue(loProprtyNode, rest, text);
	}
};

