sap.zen.ODataBookmarkParser.prototype.buildJsonPostRequest = function(bookmarkID, title, bookmarkXml, bookmarkType, appName, tDataSources, groupId, isGlobal)
{
	var loRoot = oFF.PrFactory.createStructure();
	var d = loRoot.putNewStructure("d");
	d.putString("Type", bookmarkType);
	d.putString("Title", title);
	if (isGlobal)
	{
		d.putBoolean("IsPublic", true);
	}
	else
	{
		d.putBoolean("IsPublic", false);
	}
	d.putString("Description", "");
	d.putString("MainObjectId", appName);
	d.putString("MainObjectType", "AZAP");
	d.putString("Owner", "");
	d.putString("Status", "");
	if (oFF.XStringUtils.isNotNullAndNotEmpty(groupId))
	{
		d.putString("GroupIdentifier", groupId);
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(bookmarkID))
	{
		d.putString("Id", bookmarkID);
	}
	this.buildReferencesJsonStructure(d, "AZAP", appName, tDataSources);
	var data = d.putNewStructure("Data");
	var base64 = oFF.XHttpUtils.encodeByteArrayToBase64(oFF.XByteArray.convertFromString(bookmarkXml));
	data.putString("Data", base64);
	data.putString("DataX", "");
	return loRoot;
};
sap.zen.ODataBookmarkParser.prototype.buildReferencesJsonStructure = function(d, objectType, objectId, tDataSources)
{
	var loReferenceList = d.putNewList("References");
	this.buildReferencesJsonNodeQueryAttributes(loReferenceList, objectType, objectId);
	if (tDataSources.size() > 0)
	{
		var ltDataSources = tDataSources.getValuesAsReadOnlyList();
		for (var i = 0; i < ltDataSources.size(); i++)
		{
			this.buildReferencesJsonNodeQueryAttributes(loReferenceList, "ELEM", ltDataSources.get(i).getDataSourceNameFromTemplate());
		}
	}
};
sap.zen.ODataBookmarkParser.prototype.buildReferencesJsonNodeQueryAttributes = function(oReferences, objectType, objectId)
{
	var loReferenceStructure = oReferences.addNewStructure();
	loReferenceStructure.putString("ObjectType", objectType);
	loReferenceStructure.putString("ObjectId", objectId);
	loReferenceStructure.putString("SystemAlias", "");
};

