sap.zen.TemplateLoader.prototype.initBase = function(oApplication, oLocalHost, url)
{
	this.moApplication = oApplication;
	this.moLocalHost = oLocalHost;
	this.mUrl = url;
};
sap.zen.TemplateLoader.prototype.getContentAsXml = function()
{
	var lContent = this.getContentAsString();
	return sap.buddha.XXmlUtils.getRootNode(lContent);
};
sap.zen.TemplateLoader.prototype.getContentAsString = function()
{
	if (oFF.isNull(this.mUrl))
	{
		return null;
	}
	var uri = oFF.XUri.create();
	uri.setProtocolType(this.moLocalHost.getProtocolType());
	var loHttpClient = oFF.HttpClientFactory.newInstanceByConnection(this.moApplication.getSession(), uri);
	var loRequest = loHttpClient.getRequest();
	loRequest.setCorsSecured(false);
	var loUri = oFF.XUri.createFromUrl(this.moLocalHost.getUrl());
	if (loUri.getPath() === null)
	{
		loUri.setPath("/");
	}
	loRequest.setFromUrlWithParent(this.mUrl, loUri, false);
	loRequest.setMethod(oFF.HttpRequestMethod.HTTP_GET);
	loRequest.setAcceptContentType(oFF.ContentType.APPLICATION_XML);
	loRequest.setTextContentEncoding("UTF-8");
	var loResponse = loHttpClient.processHttpRequest(oFF.SyncType.BLOCKING, null, null);
	if (loResponse.isValid() && loResponse.getData() !== null)
	{
		return loResponse.getData().getString();
	}
	return null;
};
sap.zen.TemplateLoader.prototype.initBaseBW = function(oApplication, oSystemDescription, biappName, biappPath)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(biappPath))
	{
		var basePath = oFF.XStringUtils.concatenate2(biappPath, biappName);
		this.mUrl = oFF.XStringUtils.concatenate2(basePath, "/content.xml");
		this.moLocalization = sap.buddha.XLocalization.createForUrl(oFF.XStringUtils.concatenate2(basePath, "/localization.properties"));
	}
	this.moLocalHost = oSystemDescription;
	this.moApplication = oApplication;
};
sap.zen.TemplateLoader.prototype.getTranslatedText = function(key)
{
	if (oFF.isNull(this.moLocalization) || !this.moLocalization.hasText(key))
	{
		return null;
	}
	var lNameSpace = null;
	var lTextID = null;
	var lDotPosition = oFF.XString.lastIndexOf(key, ".");
	if (lDotPosition >= 0)
	{
		lNameSpace = oFF.XString.substring(key, 0, lDotPosition);
		lTextID = oFF.XString.substring(key, lDotPosition + 1, -1);
	}
	var lAddTripleDotsToText = false;
	if (oFF.notNull(lNameSpace) && oFF.notNull(lTextID))
	{
		if (oFF.XString.containsString(this.mUrl, "0ANALYSIS"))
		{
			if (oFF.XString.isEqual(lNameSpace, "TEXT_POOL"))
			{
				if (oFF.XString.isEqual(lTextID, "ShowPrompts"))
				{
					lAddTripleDotsToText = true;
				}
			}
			if (oFF.XString.isEqual(lNameSpace, "ACTIONSHEET_SETTINGS_ACTIONS"))
			{
				if (oFF.XString.isEqual(lTextID, "CHART_SETTINGS") || oFF.XString.isEqual(lTextID, "INFO") || oFF.XString.isEqual(lTextID, "TOTALS"))
				{
					lAddTripleDotsToText = true;
				}
			}
			if (oFF.XString.isEqual(lNameSpace, "ACTIONSHEET_FOOTER_ACTIONS"))
			{
				if (oFF.XString.isEqual(lTextID, "EMAIL") || oFF.XString.isEqual(lTextID, "EXPORT") || oFF.XString.isEqual(lTextID, "TILE"))
				{
					lAddTripleDotsToText = true;
				}
			}
		}
	}
	var lText = this.moLocalization.getText(key);
	if (lAddTripleDotsToText)
	{
		lText = sap.zen.LocalizationText.sAddTrailingTripleDotsToText(lText);
	}
	return lText;
};
sap.zen.TemplateLoader.prototype.getTranslatedTextsFor = function(componentName)
{
	var ltTexts = oFF.XListOfString.create();
	var ltTextMap = null;
	if (oFF.notNull(this.moLocalization))
	{
		ltTextMap = this.moLocalization.getTranslationMap();
	}
	if (oFF.notNull(ltTextMap))
	{
		var loTextIDIterator = ltTextMap.getKeysAsIteratorOfString();
		while (loTextIDIterator.hasNext())
		{
			var lTextID = loTextIDIterator.next();
			if (oFF.XString.startsWith(lTextID, componentName))
			{
				ltTexts.add(lTextID);
			}
		}
	}
	return ltTexts;
};

