sap.zen.DataCell.prototype.mUnitOfMeasure = null;
sap.zen.DataCell.prototype.initMe = function(oDataCell)
{
	this.mValue = 0;
	this.mFormattedValue = "";
	if (oFF.notNull(oDataCell))
	{
		var lValueException = oDataCell.getValueException();
		if (lValueException === oFF.ValueException.UNDEFINED || lValueException === oFF.ValueException.NULL_VALUE)
		{
			this.mValue = 0;
			this.mFormattedValue = "";
		}
		else
		{
			if (!oDataCell.isNumber())
			{
				this.mValue = 0;
				if (oDataCell.isTime())
				{
					this.mValue = this.getTimeAsDouble(oDataCell);
				}
			}
			else
			{
				this.mValue = oDataCell.getDoubleValue();
			}
			this.mFormattedValue = oDataCell.getFormattedValue();
		}
	}
	this.mScalingFactor = 0;
	this.mUnitOfMeasure = "";
};
sap.zen.DataCell.prototype.isTime = function(oDataCell)
{
	if (oFF.notNull(oDataCell))
	{
		return oDataCell.isTime();
	}
	return false;
};
sap.zen.DataCell.prototype.getTime = function(oDataCell)
{
	if (this.isTime(oDataCell) === true)
	{
		var loTime = oFF.XTime.createTimeFromIsoFormat(oDataCell.getFormattedValue());
		return loTime;
	}
	return null;
};
sap.zen.DataCell.prototype.getTimeAsDouble = function(oDataCell)
{
	var lDouble = 0.0;
	if (this.isTime(oDataCell) === true)
	{
		var loTime = this.getTime(oDataCell);
		lDouble = loTime.getHourOfDay() * 3600 + loTime.getMinuteOfHour() * 60 + loTime.getSecondOfMinute();
	}
	return lDouble;
};

