sap.zen.XTabXpRowIterator.prototype._ff_c = "XTabXpRowIterator";

sap.zen.XTabXpRowIterator.create = function(oResultSet, oComponent)
{
	var loInstance = null;
	loInstance = new sap.zen.XTabXpRowIterator();
	loInstance.initMe(oResultSet, oComponent);
	return loInstance;
};
sap.zen.XTabXpRowIterator.prototype.moComponent = null;
sap.zen.XTabXpRowIterator.prototype.moResultSet = null;
sap.zen.XTabXpRowIterator.prototype.moResultDataCell = null;
sap.zen.XTabXpRowIterator.prototype.moResultSetInfo = null;
sap.zen.XTabXpRowIterator.prototype.mXpCntRowHeader = 0;
sap.zen.XTabXpRowIterator.prototype.mXpCntColHeader = 0;
sap.zen.XTabXpRowIterator.prototype.mXpNoColHeader = false;
sap.zen.XTabXpRowIterator.prototype.mXpNoRowHeader = false;
sap.zen.XTabXpRowIterator.prototype.mXpCntRows = 0;
sap.zen.XTabXpRowIterator.prototype.mXpCntCols = 0;
sap.zen.XTabXpRowIterator.prototype.mXpCurRow = 0;
sap.zen.XTabXpRowIterator.prototype.mXpCurCol = 0;
sap.zen.XTabXpRowIterator.prototype.mXpAmountOfDataRows = 0;
sap.zen.XTabXpRowIterator.prototype.mXpFormattedValue = null;
sap.zen.XTabXpRowIterator.prototype.initMe = function(oResultSet, oComponent)
{
	this.moComponent = oComponent;
	this.moResultSet = oResultSet;
	var loQueryManager = this.moResultSet.getDataSource().getQueryManager();
	var loQueryModel = loQueryManager.getQueryModel();
	sap.zen.DataSourceScriptApiUtils.logGetResultSet(oComponent.getPage(), loQueryManager, "Export");
	this.moResultSet.getServerPaging().deactivatePaging();
	this.mXpCurRow = -1;
	this.mXpCurCol = -1;
	this.mXpCntRowHeader = this.moResultSet.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.ROWS);
	this.mXpCntColHeader = this.moResultSet.getAmountOfVisibleFieldsOnAxis(oFF.AxisType.COLUMNS);
	this.mXpNoRowHeader = false;
	if (this.mXpCntRowHeader === 0)
	{
		var ltColumnDimensions = loQueryModel.getColumnsAxis().getDimensions();
		if (!ltColumnDimensions.isEmpty() && (ltColumnDimensions.size() > 1 || !ltColumnDimensions.get(0).isStructure()))
		{
			this.mXpCntRowHeader = 1;
		}
		this.mXpNoRowHeader = true;
	}
	this.mXpNoColHeader = false;
	if (this.mXpCntColHeader === 0)
	{
		var ltRowDimensions = loQueryModel.getRowsAxis().getDimensions();
		if (!ltRowDimensions.isEmpty() && (ltRowDimensions.size() > 1 || !ltRowDimensions.get(0).isStructure()))
		{
			this.mXpCntColHeader = 1;
		}
		this.mXpNoColHeader = true;
	}
	this.mXpAmountOfDataRows = this.moResultSet.getAmountOfDataRows();
	this.mXpCntRows = this.moResultSet.getAmountOfRows();
	this.mXpCntCols = this.moResultSet.getAmountOfColumns();
	var loMeasureStructure = loQueryManager.getQueryModel().getMeasureDimension();
	if (this.mXpCntRows === 0 && oFF.isNull(loMeasureStructure))
	{
		this.mXpCntRows = this.moResultSet.getAmountOfTuplesOnAxis(oFF.AxisType.ROWS);
	}
	if (this.mXpCntCols === 0 && oFF.isNull(loMeasureStructure))
	{
		this.mXpCntCols = this.moResultSet.getAmountOfTuplesOnAxis(oFF.AxisType.COLUMNS);
	}
};
sap.zen.XTabXpRowIterator.prototype.getTitle = function()
{
	return oFF.XStringUtils.concatenate4("XTab ", this.moResultSet.getDataSource().getId(), " ", this.moComponent.getId());
};
sap.zen.XTabXpRowIterator.prototype.hasNextRow = function()
{
	return this.mXpCurRow + 1 < this.mXpCntColHeader + this.mXpCntRows;
};
sap.zen.XTabXpRowIterator.prototype.nextRow = function()
{
	this.mXpCurRow = this.mXpCurRow + 1;
	this.mXpCurCol = -1;
	return this;
};
sap.zen.XTabXpRowIterator.prototype.hasNextCell = function()
{
	return this.mXpCurCol + 1 < this.mXpCntRowHeader + this.mXpCntCols;
};
sap.zen.XTabXpRowIterator.prototype.nextCell = function()
{
	this.mXpCurCol = this.mXpCurCol + 1;
	this.moResultSetInfo = null;
	this.mXpFormattedValue = "";
	this.moResultDataCell = null;
	var effectiveRowInRowSpans = this.mXpCurRow - this.mXpCntColHeader;
	var effectiveRowInResultsetForQ3AndData = effectiveRowInRowSpans;
	var effectiveColInColSpans = this.mXpCurCol - this.mXpCntRowHeader;
	var effectiveColInResultsetForQ2AndData = effectiveColInColSpans;
	if (this.mXpCurCol < this.mXpCntRowHeader)
	{
		if (this.mXpCurRow < this.mXpCntColHeader)
		{
			var loResultSetInfo = null;
			var ltHeaders = oFF.XList.create();
			if (this.mXpCurRow === this.mXpCntColHeader - 1)
			{
				if (!this.mXpNoRowHeader)
				{
					loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.ROWS, -1, this.mXpCurCol);
					ltHeaders.add(loResultSetInfo);
				}
				if (!this.mXpNoColHeader)
				{
					if (this.mXpCurCol === this.mXpCntRowHeader - 1)
					{
						loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.COLUMNS, -1, this.mXpCurRow);
						ltHeaders.add(loResultSetInfo);
					}
				}
			}
			else if (this.mXpCurCol === this.mXpCntRowHeader - 1)
			{
				loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.COLUMNS, this.mXpCurCol, this.mXpCurRow);
				ltHeaders.add(loResultSetInfo);
			}
			for (var lHeaderIndex = 0; lHeaderIndex < ltHeaders.size(); lHeaderIndex++)
			{
				loResultSetInfo = ltHeaders.get(lHeaderIndex);
				if (oFF.isNull(loResultSetInfo))
				{
					continue;
				}
				var loDimension = loResultSetInfo.getDimension();
				if (oFF.isNull(loDimension))
				{
					continue;
				}
				var loInternalField = loResultSetInfo.getField();
				var lDimensionHeader = null;
				if (!loDimension.isMeasureStructure())
				{
					var lFieldName = null;
					if (oFF.notNull(loInternalField))
					{
						lFieldName = loInternalField.getName();
					}
					lDimensionHeader = loDimension.getHeaderText(lFieldName);
				}
				if (oFF.XStringUtils.isNullOrEmpty(this.mXpFormattedValue))
				{
					if (oFF.XStringUtils.isNotNullAndNotEmpty(lDimensionHeader))
					{
						this.mXpFormattedValue = lDimensionHeader;
					}
				}
				else
				{
					if (oFF.XStringUtils.isNotNullAndNotEmpty(lDimensionHeader))
					{
						this.mXpFormattedValue = oFF.XStringUtils.concatenate3(this.mXpFormattedValue, " | ", lDimensionHeader);
					}
				}
			}
		}
		else
		{
			this.moResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.ROWS, effectiveRowInResultsetForQ3AndData, this.mXpCurCol);
		}
	}
	else
	{
		if (this.mXpCurRow < this.mXpCntColHeader)
		{
			this.moResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.COLUMNS, effectiveColInResultsetForQ2AndData, this.mXpCurRow);
		}
		else
		{
			var lNoData = false;
			if (this.mXpAmountOfDataRows <= 0 && this.mXpAmountOfDataRows <= 0)
			{
				lNoData = true;
			}
			if (!lNoData)
			{
				this.moResultDataCell = this.moResultSet.getResultDataCell(effectiveRowInResultsetForQ3AndData, effectiveColInResultsetForQ2AndData);
			}
		}
	}
	return this;
};
sap.zen.XTabXpRowIterator.prototype.getValue = function()
{
	var lDouble = 0.0;
	if (oFF.notNull(this.moResultDataCell))
	{
		var lValue = null;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(this.moResultDataCell.getFormatString()) && this.moResultDataCell.isPercent())
		{
			lValue = this.moResultDataCell.getInternalValue();
		}
		else
		{
			lValue = this.moResultDataCell.getValue();
		}
		if (!this.moResultDataCell.isNumber())
		{
			if (this.moResultDataCell.isTime())
			{
				lDouble = this.getTimeAsDouble();
			}
		}
		else if (oFF.notNull(lValue))
		{
			lDouble = lValue.getDouble();
		}
	}
	return lDouble;
};
sap.zen.XTabXpRowIterator.prototype.getFormattedValue = function()
{
	if (oFF.notNull(this.moResultDataCell))
	{
		return this.moResultDataCell.getFormattedValue();
	}
	if (oFF.notNull(this.moResultSetInfo))
	{
		var lIndent = "";
		var lDisplayLevel = this.moResultSetInfo.getTupleElement().getDisplayLevel();
		for (var i = 0; i < lDisplayLevel; i++)
		{
			lIndent = oFF.XStringUtils.concatenate2(lIndent, "  ");
		}
		if (!this.moResultSetInfo.getTupleElement().isLeaf())
		{
			return oFF.XStringUtils.concatenate2(lIndent, this.moResultSetInfo.getDimensionMember().getText());
		}
		var lDimensionMemberText = sap.zen.DimensionMember.sGetDimensionMemberText(this.moResultSetInfo.getDimensionMember(), this.moResultSetInfo.getFieldValue());
		if (oFF.notNull(lDimensionMemberText))
		{
			return oFF.XStringUtils.concatenate2(lIndent, lDimensionMemberText);
		}
		var lDimensionHeaderText = null;
		var loDimension = this.moResultSetInfo.getDimension();
		var lFieldName = null;
		var loInternalField = this.moResultSetInfo.getField();
		if (oFF.notNull(loInternalField))
		{
			lFieldName = loInternalField.getName();
		}
		if (oFF.notNull(loDimension))
		{
			lDimensionHeaderText = loDimension.getHeaderText(lFieldName);
		}
		return oFF.XStringUtils.concatenate2(lIndent, lDimensionHeaderText);
	}
	return this.mXpFormattedValue;
};
sap.zen.XTabXpRowIterator.prototype.getFormatString = function()
{
	if (oFF.notNull(this.moResultDataCell))
	{
		return this.moResultDataCell.getNumberFormatString(true, true);
	}
	return "";
};
sap.zen.XTabXpRowIterator.prototype.provideNumberFormatString = function(thousandSeparator, decimalSeparator)
{
	if (oFF.notNull(this.moResultDataCell))
	{
		return this.moResultDataCell.getSpecificNumberFormatString(thousandSeparator, decimalSeparator, true, true, true);
	}
	return "";
};
sap.zen.XTabXpRowIterator.prototype.getDateAsIsoString = function()
{
	if (this.getCellValueType() === sap.zen.CXpDataCellValueType.DATE)
	{
		var lDate = this.moResultSetInfo.getFieldValue().getDate();
		var lIsoFormat = lDate.toIsoFormat();
		return lIsoFormat;
	}
	return null;
};
sap.zen.XTabXpRowIterator.prototype.getTimeAsIsoString = function()
{
	if (this.getCellValueType() === sap.zen.CXpDataCellValueType.TIME)
	{
		var lTimeValue = this.getTime();
		var lIsoFormat = lTimeValue.toIsoFormat();
		return lIsoFormat;
	}
	return null;
};
sap.zen.XTabXpRowIterator.prototype.getTime = function()
{
	if (this.getCellValueType() === sap.zen.CXpDataCellValueType.TIME)
	{
		var lTimeValue = oFF.XTime.createTimeFromIsoFormat(this.moResultDataCell.getFormattedValue());
		return lTimeValue;
	}
	return null;
};
sap.zen.XTabXpRowIterator.prototype.getTimeAsDouble = function()
{
	var lDouble = 0.0;
	var lTimeValue = this.getTime();
	if (oFF.notNull(lTimeValue))
	{
		lDouble = lTimeValue.getHourOfDay() * 3600 + lTimeValue.getMinuteOfHour() * 60 + lTimeValue.getSecondOfMinute();
	}
	return lDouble;
};
sap.zen.XTabXpRowIterator.prototype.getCellValueType = function()
{
	if (oFF.notNull(this.moResultDataCell))
	{
		if (this.moResultDataCell.isNumber())
		{
			return sap.zen.CXpDataCellValueType.NUMBER;
		}
		else if (this.moResultDataCell.isDate())
		{
			return sap.zen.CXpDataCellValueType.DATE;
		}
		else if (this.moResultDataCell.isTime())
		{
			return sap.zen.CXpDataCellValueType.TIME;
		}
		else if (this.moResultDataCell.isTimestamp())
		{
			return sap.zen.CXpDataCellValueType.TIMESTAMP;
		}
	}
	return sap.zen.CXpDataCellValueType.STANDARD;
};
sap.zen.XTabXpRowIterator.prototype.getCellType = function()
{
	var lCellType = sap.zen.CXpStyle.STANDARD;
	if (oFF.isNull(this.moResultDataCell))
	{
		lCellType = sap.zen.CXpStyle.HEADER;
	}
	if (oFF.notNull(this.moResultSetInfo))
	{
		if (this.moResultSetInfo.isTotal())
		{
			lCellType = sap.zen.CXpStyle.TOTAL;
		}
	}
	return lCellType;
};
sap.zen.XTabXpRowIterator.prototype.isDate = function()
{
	var lValueType = null;
	if (oFF.notNull(this.moResultSetInfo) && this.moResultSetInfo.isTotal() === false)
	{
		lValueType = this.moResultSetInfo.getField().getValueType();
		if (oFF.XValueType.DATE.isEqualTo(lValueType) || oFF.XValueType.DATE_TIME.isEqualTo(lValueType))
		{
			return true;
		}
	}
	return false;
};
sap.zen.XTabXpRowIterator.prototype.isTime = function()
{
	if (oFF.notNull(this.moResultDataCell))
	{
		return this.moResultDataCell.isTime();
	}
	return false;
};
sap.zen.XTabXpRowIterator.prototype.isNumber = function()
{
	if (oFF.notNull(this.moResultDataCell))
	{
		return this.moResultDataCell.isNumber();
	}
	return false;
};

