sap.zen.CharacteristicWrapper.prototype.getValueForField = function(stringValue, oInternalField)
{
	var lValueType = oInternalField.getValueType();
	var loInternalValue = this.createValueForField(stringValue, oInternalField);
	if (oFF.isNull(loInternalValue))
	{
		if (lValueType === oFF.XValueType.DATE)
		{
			if (oFF.XStringUtils.isNotNullAndNotEmpty(stringValue))
			{
				var ltMemberKeysOfSingleSelections = oFF.XListOfString.create();
				ltMemberKeysOfSingleSelections.add(stringValue);
				var ltDimensionMembers = this.getMembersByKeys(ltMemberKeysOfSingleSelections, true);
				if (!ltDimensionMembers.isEmpty())
				{
					var loDate = ltDimensionMembers.get(0).getKeyFieldValue().getDate();
					loInternalValue = loDate;
				}
			}
		}
	}
	return loInternalValue;
};
sap.zen.CharacteristicWrapper.prototype.createValueForField = function(stringValue, oInternalField)
{
	var lValueType = oInternalField.getValueType();
	try
	{
		if (lValueType === oFF.XValueType.STRING)
		{
			return oFF.XStringValue.create(stringValue);
		}
		else if (lValueType === oFF.XValueType.LONG)
		{
			return oFF.XLongValue.create(oFF.XLong.convertFromString(stringValue));
		}
		else if (lValueType === oFF.XValueType.INTEGER)
		{
			return oFF.XIntegerValue.create(oFF.XInteger.convertFromString(stringValue));
		}
		else if (lValueType === oFF.XValueType.DOUBLE || lValueType === oFF.XValueType.DECIMAL_FLOAT)
		{
			return oFF.XDoubleValue.create(oFF.XDouble.convertFromString(stringValue));
		}
		else if (lValueType === oFF.XValueType.DATE)
		{
			var loDate = null;
			try
			{
				loDate = oFF.XDate.createDateFromString(stringValue, null);
			}
			catch (lABAPDateException)
			{
				loDate = null;
			}
			if (oFF.isNull(loDate))
			{
				try
				{
					loDate = oFF.XDate.createDateFromString(stringValue, oFF.DateTimeFormat.ISO);
				}
				catch (lISODateException)
				{
					loDate = null;
				}
			}
			return loDate;
		}
		else if (lValueType === oFF.XValueType.TIME)
		{
			return oFF.XTime.createTimeFromString(stringValue, null);
		}
		else if (lValueType === oFF.XValueType.DATE_TIME)
		{
			return oFF.XDateTime.createDateTimeFromString(stringValue, null);
		}
		else if (lValueType === oFF.XValueType.TIMESPAN)
		{
			return oFF.XTimeSpan.create(oFF.XLong.convertFromString(stringValue));
		}
	}
	catch (e)
	{
		return null;
	}
	throw oFF.XException.createIllegalStateException(oFF.XStringUtils.concatenate2("Value type not supported: ", lValueType.getName()));
};
