sap.zen.SDKComponentFactory.prototype.mtDefaultValues = null;
sap.zen.SDKComponentFactory.prototype.mHandlerType = null;
sap.zen.SDKComponentFactory.prototype.mLibraryId = null;
sap.zen.SDKComponentFactory.prototype.mComponentTypeId = null;
sap.zen.SDKComponentFactory.prototype.moLoadedIntoPage = null;
sap.zen.SDKComponentFactory.prototype.isSDK = function()
{
	return true;
};
sap.zen.SDKComponentFactory.prototype.isBuiltIn = function()
{
	return false;
};
sap.zen.SDKComponentFactory.prototype.createObject = function(oObjectProperties)
{
	var loPageObject = null;
	if (oFF.XString.isEqual(this.mHandlerType, "datasource"))
	{
		var loSdkDataSource = new sap.zen.SDKDataSource();
		loSdkDataSource.initSDKBase(this);
		loPageObject = loSdkDataSource;
	}
	else
	{
		var loSdkControl = new sap.zen.SDKControl();
		loSdkControl.initSDKBase(this);
		loPageObject = loSdkControl;
	}
	return loPageObject;
};
sap.zen.SDKComponentFactory.prototype.loadSdkExtension = function(type, oPage)
{
	if (this.moLoadedIntoPage !== oPage)
	{
		this.moLoadedIntoPage = oPage;
		var lastIndexOf = oFF.XString.lastIndexOf(type, "_");
		var componentType = oFF.XString.substring(type, lastIndexOf + 1, -1);
		this.mLibraryId = oFF.XString.substring(type, 0, lastIndexOf);
		this.mLibraryId = oFF.XString.replace(this.mLibraryId, "_", ".");
		var loSdkRoot = this.getSDKRoot(oPage);
		if (oFF.isNull(loSdkRoot))
		{
			var loLogging = oPage.getLogging();
			if (oFF.notNull(loLogging) && loLogging.isLoggable(sap.buddha.XLogging.XDEBUG))
			{
				loLogging.debug(oFF.XStringUtils.concatenate3("SDK extension ", type, " could not be loaded"), "", null);
			}
			return false;
		}
		var ltSdkExtensionNodes = loSdkRoot.getChildrenWoBiNameSpace("sdkExtension");
		var loSdkExtensionNode = null;
		if (ltSdkExtensionNodes.size() === 0)
		{
			loSdkExtensionNode = loSdkRoot;
		}
		else
		{
			loSdkExtensionNode = ltSdkExtensionNodes.get(0);
		}
		this.mComponentTypeId = loSdkExtensionNode.getAttribute("id");
		var ltComponentNodes = loSdkExtensionNode.getChildrenWoBiNameSpace("component");
		var ltComponentNodesIterator = ltComponentNodes.getIterator();
		while (ltComponentNodesIterator.hasNext())
		{
			var loComponentNode = ltComponentNodesIterator.next();
			var lAttribute = loComponentNode.getAttribute("id");
			if (oFF.XString.isEqual(lAttribute, componentType))
			{
				this.mHandlerType = loComponentNode.getAttribute("handlerType");
				if (oFF.isNull(this.mHandlerType))
				{
					this.mHandlerType = "div";
				}
				this.mComponentTypeId = lAttribute;
				this.mtJsIncludes = loComponentNode.getChildrenWoBiNameSpace("jsInclude");
				this.mtRequireJs = loComponentNode.getChildrenWoBiNameSpace("requireJs");
				this.mtCssIncludes = loComponentNode.getChildrenWoBiNameSpace("cssInclude");
				this.mtProperties = loComponentNode.getChildrenWoBiNameSpace("property");
				var initializationNodeList = loComponentNode.getChildrenWoBiNameSpace("initialization");
				if (oFF.notNull(initializationNodeList) && initializationNodeList.size() > 0)
				{
					var initMe = initializationNodeList.get(0);
					this.mtDefaultValues = initMe.getChildrenWoBiNameSpace("defaultValue");
				}
			}
		}
		this.loadZtlJs(oPage);
	}
	return true;
};
sap.zen.SDKComponentFactory.prototype.loadZtlJs = function(oPage)
{
	oPage.getSDKLoader().loadZtl(this.mLibraryId, oPage.getWindow());
};
sap.zen.SDKComponentFactory.prototype.getSDKRoot = function(oPage)
{
	var loSdkLoader = oPage.getSDKLoader();
	return loSdkLoader.parseContributionXml(oPage.getApplication(), oPage.getApplication().getSystemLandscape().getSystemDescription("self"), this.mLibraryId);
};

