sap.zen.ResultDataCellWrapper.sRetrieveInternalDataCellObject = function(oResultSet, rowIndex, columnIndex)
{
	if (oFF.isNull(oResultSet))
	{
		return null;
	}
	var lRowIndex = rowIndex;
	var lColumnIndex = columnIndex;
	var lAxis = null;
	var lAxisIndex = 0;
	var loServerPaging = oResultSet.getServerPaging();
	if (loServerPaging.isPagingActive())
	{
		var loAxisServerPaging = null;
		for (var i = 0; i < 2; i++)
		{
			if (i === 0)
			{
				lAxis = oFF.AxisType.ROWS;
				lAxisIndex = lRowIndex;
			}
			else if (i === 1)
			{
				lAxis = oFF.AxisType.COLUMNS;
				lAxisIndex = lColumnIndex;
			}
			else
			{
				break;
			}
			loAxisServerPaging = loServerPaging.getAxisPaging(lAxis);
			if (oFF.notNull(loAxisServerPaging))
			{
				lAxisIndex = loAxisServerPaging.retrieveOffset(lAxisIndex);
				if (i === 0)
				{
					lRowIndex = lAxisIndex;
				}
				else if (i === 1)
				{
					lColumnIndex = lAxisIndex;
				}
			}
		}
	}
	var loInternalResultSet = oResultSet.getInternalObject();
	if (oFF.isNull(loInternalResultSet))
	{
		return null;
	}
	var loInternalResultDataCell = loInternalResultSet.getDataCell(lColumnIndex, lRowIndex);
	return loInternalResultDataCell;
};
