sap.zen.ResultDataCellWrapper.sAddCurrencyUnitInformation = function(value, oCurrencyUnitInfo, wrapCurrencyUnit)
{
	var lFormattedValue = value;
	if (oFF.isNull(oCurrencyUnitInfo) || oFF.isNull(value))
	{
		return lFormattedValue;
	}
	var lCurrencyUnitPrefix = null;
	if (oCurrencyUnitInfo.hasPrefix())
	{
		lCurrencyUnitPrefix = oCurrencyUnitInfo.getPrefix();
		if (oFF.XStringUtils.isNullOrEmpty(lCurrencyUnitPrefix))
		{
			lCurrencyUnitPrefix = oCurrencyUnitInfo.getFormatted();
		}
	}
	var lCurrencyUnitSuffix = null;
	if (oCurrencyUnitInfo.hasSuffix())
	{
		lCurrencyUnitSuffix = oCurrencyUnitInfo.getSuffix();
		if (oFF.XStringUtils.isNullOrEmpty(lCurrencyUnitSuffix))
		{
			lCurrencyUnitSuffix = oCurrencyUnitInfo.getFormatted();
		}
	}
	if (!oFF.XString.isEqual(lCurrencyUnitPrefix, lCurrencyUnitSuffix))
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lCurrencyUnitPrefix))
		{
			if (wrapCurrencyUnit)
			{
				lCurrencyUnitPrefix = oFF.XStringUtils.concatenate3("\"", lCurrencyUnitPrefix, "\"");
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormattedValue))
			{
				lFormattedValue = oFF.XStringUtils.concatenate2(" ", lFormattedValue);
			}
			lFormattedValue = oFF.XStringUtils.concatenate2(lCurrencyUnitPrefix, lFormattedValue);
		}
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(lCurrencyUnitSuffix))
	{
		if (wrapCurrencyUnit)
		{
			lCurrencyUnitSuffix = oFF.XStringUtils.concatenate3("\"", lCurrencyUnitSuffix, "\"");
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormattedValue))
		{
			lFormattedValue = oFF.XStringUtils.concatenate2(lFormattedValue, " ");
		}
		lFormattedValue = oFF.XStringUtils.concatenate2(lFormattedValue, lCurrencyUnitSuffix);
	}
	return lFormattedValue;
};
