sap.zen.ResultDataCellWrapper.sProvideNumberFormatString = function(oInternalResultDataCell, addNegativeNumberFormat, addCurrencyUnitInfo, oResultDataCell)
{
	if (oFF.notNull(oResultDataCell))
	{
		if (oResultDataCell.mNumberFormatStringProvided)
		{
			if (addNegativeNumberFormat)
			{
				if (addCurrencyUnitInfo)
				{
					return oResultDataCell.mFullNumberFormatStringWithCurrencyUnit;
				}
				return oResultDataCell.mFullNumberFormatString;
			}
			if (addCurrencyUnitInfo)
			{
				return oResultDataCell.mNumberFormatStringWithCurrencyUnit;
			}
			return oResultDataCell.mNumberFormatString;
		}
	}
	var lFormatString = sap.zen.ResultDataCellWrapper.sProvideFormatString(oInternalResultDataCell, oResultDataCell);
	var lNumberFormatString = sap.zen.ResultDataCellWrapper.sCalcNumberFormatString(oInternalResultDataCell, lFormatString, false, false, false, oResultDataCell);
	var lNumberFormatStringWithCurrencyUnit = sap.zen.ResultDataCellWrapper.sCalcNumberFormatString(oInternalResultDataCell, lFormatString, false, true, false, oResultDataCell);
	var lFullNumberFormatString = sap.zen.ResultDataCellWrapper.sCalcNumberFormatString(oInternalResultDataCell, lFormatString, true, false, false, oResultDataCell);
	var lFullNumberFormatStringWithCurrencyUnit = sap.zen.ResultDataCellWrapper.sCalcNumberFormatString(oInternalResultDataCell, lFormatString, true, true, false, oResultDataCell);
	if (oFF.notNull(oResultDataCell))
	{
		oResultDataCell.setNumberFormatStringProvided(lNumberFormatString, lNumberFormatStringWithCurrencyUnit, lFullNumberFormatString, lFullNumberFormatStringWithCurrencyUnit);
	}
	lFormatString = null;
	if (addNegativeNumberFormat)
	{
		if (addCurrencyUnitInfo)
		{
			lFormatString = lFullNumberFormatStringWithCurrencyUnit;
		}
		else
		{
			lFormatString = lFullNumberFormatString;
		}
	}
	else
	{
		if (addCurrencyUnitInfo)
		{
			lFormatString = lNumberFormatStringWithCurrencyUnit;
		}
		else
		{
			lFormatString = lNumberFormatString;
		}
	}
	return lFormatString;
};
sap.zen.ResultDataCellWrapper.sCalcFormatString = function(thousandSeparator, decimalSeparator, decimals)
{
	var lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
	lFormatString = "#";
	if (oFF.XStringUtils.isNotNullAndNotEmpty(thousandSeparator))
	{
		lFormatString = oFF.XStringUtils.concatenate3("#", thousandSeparator, "##");
	}
	lFormatString = oFF.XStringUtils.concatenate2(lFormatString, "0");
	if (oFF.XStringUtils.isNotNullAndNotEmpty(decimalSeparator) && decimals > 0)
	{
		lFormatString = oFF.XStringUtils.concatenate2(lFormatString, decimalSeparator);
		for (var lDecimalCount = 0; lDecimalCount < decimals; lDecimalCount++)
		{
			lFormatString = oFF.XStringUtils.concatenate2(lFormatString, "0");
		}
	}
	return lFormatString;
};
sap.zen.ResultDataCellWrapper.sCalcNumberFormatString = function(oInternalResultDataCell, formatString, addNegativeNumberFormat, addCurrencyUnitInfo, wrapCurrencyUnit, oResultDataCell)
{
	var lFormatString = formatString;
	if (oFF.isNull(lFormatString))
	{
		lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
	}
	var lValueType = null;
	var lValueException = null;
	if (oFF.notNull(oInternalResultDataCell))
	{
		lValueType = oInternalResultDataCell.getValueType();
		lValueException = oInternalResultDataCell.getValueException();
	}
	if (oFF.isNull(oInternalResultDataCell))
	{
		return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
	}
	if (oFF.isNull(lValueType) || !lValueType.isNumber())
	{
		return sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
	}
	if (lValueException !== oFF.ValueException.NORMAL)
	{
		if (lValueException === oFF.ValueException.UNDEFINED || lValueException === oFF.ValueException.NULL_VALUE)
		{
			lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
		}
		if (lValueException === oFF.ValueException.NO_PRESENTATION || lValueException === oFF.ValueException.NO_AUTHORITY)
		{
			lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
		}
		if (lValueException === oFF.ValueException.MIXED_CURRENCIES_OR_UNITS)
		{
			lFormatString = sap.zen.ResultDataCellWrapper.NO_FORMAT_STRING;
		}
	}
	if (!sap.zen.ResultDataCellWrapper.sIsValueValid(oInternalResultDataCell))
	{
		lFormatString = sap.zen.ResultDataCellWrapper.NO_DISPLAY_FORMAT_STRING;
	}
	var lNumberFormatString = lFormatString;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString))
	{
		lNumberFormatString = sap.zen.ResultDataCellWrapper.sAddValueTypeInformation(lNumberFormatString, lValueType, lValueException);
	}
	if (addCurrencyUnitInfo)
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString) || lValueException === oFF.ValueException.MIXED_CURRENCIES_OR_UNITS)
		{
			var loCurrencyUnitInfo = sap.zen.ResultDataCellWrapper.sProvideCurrencyUnit(oInternalResultDataCell, oResultDataCell);
			lNumberFormatString = sap.zen.ResultDataCellWrapper.sAddCurrencyUnitInformation(lNumberFormatString, loCurrencyUnitInfo, wrapCurrencyUnit);
		}
	}
	if (addNegativeNumberFormat)
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lFormatString))
		{
			lNumberFormatString = oFF.XStringUtils.concatenate4(lNumberFormatString, ";", "-", lNumberFormatString);
		}
	}
	return lNumberFormatString;
};
