sap.zen.ResultDataCellWrapper.prototype.initMe = function(oResultSet, oInternalResultDataCell)
{
	this.moResultSet = oResultSet;
	this.mRowIndex = oInternalResultDataCell.getRow();
	this.mColumnIndex = oInternalResultDataCell.getColumn();
	this.moInternalObject = oInternalResultDataCell;
	var loServerPaging = this.moResultSet.getServerPaging();
	if (loServerPaging.isPagingActive())
	{
		this.mRowIndex = this.mRowIndex + loServerPaging.getAxisPaging(oFF.AxisType.ROWS).getOffset();
		this.mColumnIndex = this.mColumnIndex + loServerPaging.getAxisPaging(oFF.AxisType.COLUMNS).getOffset();
	}
	if (sap.zen.ResultDataCellWrapper.ACTIVATE_CODE_ANALYSIS_MODE)
	{
		this.getDecimals();
		this.getScalingFactor();
		this.getScalingFactorValue();
		this.getCurrencyUnit();
		this.getInternalValue();
		this.getValue();
		this.getValueInExternalFormat();
		this.getFormattedValue();
		this.getFormatString();
		this.getNumberFormatString(true, true);
	}
};
