sap.zen.TupleElementWrapper.prototype.toggleDrillState = function(triggerChangedEvent)
{
	var loInternalTupleElement = this.getInternalObject();
	if (oFF.isNull(loInternalTupleElement))
	{
		return false;
	}
	var loProperties = this.getDimension().getProperties();
	var lDrillState = this.getDrillState();
	if (this.isExpanded())
	{
		lDrillState = oFF.DrillState.COLLAPSED;
	}
	else if (lDrillState === oFF.DrillState.COLLAPSED)
	{
		if (loProperties.isUDHActive())
		{
			lDrillState = oFF.DrillState.DRILLED;
		}
		else
		{
			lDrillState = oFF.DrillState.EXPANDED;
		}
	}
	else if (lDrillState === oFF.DrillState.LEAF_DRILLDOWN_ALLOWED)
	{
		lDrillState = oFF.DrillState.DRILLED;
	}
	else if (lDrillState === oFF.DrillState.LEAF_UDH_EXPAND_ALLOWED)
	{
		lDrillState = oFF.DrillState.EXPANDED;
	}
	else if (lDrillState === oFF.DrillState.COLLAPSED_EXPAND_AND_DRILLDOWN_ALLOWED)
	{
		lDrillState = oFF.DrillState.EXPANDED;
	}
	loInternalTupleElement.setNextDrillState(lDrillState);
	if (triggerChangedEvent)
	{
		var loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
		loDataSourceChangeCause.setAction(sap.zen.CDataSourceChangeAction.ExpandCollapseHierarchyNode);
		loDataSourceChangeCause.addProperties(this.getActionObjectProperties());
		if (oFF.notNull(lDrillState))
		{
			loDataSourceChangeCause.addProperty("NewDrillState", lDrillState.getName());
		}
		if (oFF.notNull(lDrillState))
		{
			loDataSourceChangeCause.addProperty("rootcause_hierarchy", lDrillState.getName());
		}
		loDataSourceChangeCause.addProperty("rootcause_hierarchy_directiondown", oFF.XBoolean.convertToString(true));
		this.getDataSource().raiseDataSourceChangedEvent(loDataSourceChangeCause, false, true);
	}
	return true;
};
