sap.zen.BookmarkRequestHandler.prototype.onFunctionExecuted = function(extResult, response, customIdentifier)
{
	if (extResult.hasErrors() === false && response.getRootElement() !== null)
	{
		var responseStr = response.toString();
		var jsonParser = oFF.JsonParserFactory.newInstance();
		var jsonElement = jsonParser.parse(responseStr);
		if (jsonParser.hasErrors())
		{
			throw oFF.XException.createRuntimeException(jsonParser.getSummary());
		}
		if (oFF.notNull(jsonElement))
		{
			if (jsonElement.getType() !== oFF.PrElementType.STRUCTURE)
			{
				throw oFF.XException.createRuntimeException("JSON string is not a structure");
			}
			var bookmarkResponse = jsonElement.getPermaCopy().asStructure();
			if (oFF.notNull(bookmarkResponse))
			{
				var d = bookmarkResponse.getStructureByKey("d");
				if (oFF.notNull(d))
				{
					if (d.hasStringByKey("results"))
					{
						if (oFF.isNull(this.mtAllBookmarks))
						{
							this.mtAllBookmarks = oFF.XHashMapByString.create();
						}
						if (!this.mtAllBookmarks.isEmpty())
						{
							this.mtAllBookmarks.clear();
						}
						var results = d.getListByKey("results");
						if (oFF.notNull(results))
						{
							var resultsSize = results.size();
							for (var i = 0; i < resultsSize; i++)
							{
								var currentBookmark = results.getStructureAt(i);
								var bookmarkId = currentBookmark.getStringByKey("Id");
								var bookmarkUserid = currentBookmark.getStringByKeyExt("Owner", "");
								var bookmarkName = currentBookmark.getStringByKeyExt("Title", "");
								var bookmarkReadOnly = currentBookmark.getBooleanByKeyExt("IsReadOnly", false);
								var bookmarkGlobal = currentBookmark.getBooleanByKeyExt("IsPublic", false);
								var bookmarkGroupId = currentBookmark.getStringByKeyExt("GroupIdentifier", "");
								var currentBM = new sap.zen.Bookmark();
								currentBM.initMe2(bookmarkName, bookmarkUserid, "", bookmarkId, bookmarkGroupId, bookmarkGlobal, bookmarkReadOnly);
								this.mtAllBookmarks.put(bookmarkId, currentBM);
							}
						}
					}
					else
					{
						if (d.hasStringByKey("Data"))
						{
							var data;
							try
							{
								data = d.getStructureByKey("Data");
							}
							catch (e)
							{
								return;
							}
							var bookmarkData = null;
							if (data.isStructure())
							{
								bookmarkData = data.getStringByKeyExt("Data", "");
							}
							if (oFF.XStringUtils.isNullOrEmpty(bookmarkData))
							{
								this.mBookmarkID = d.getStringByKeyExt("Id", "");
							}
							else
							{
								if (oFF.isNull(this.mBookmark))
								{
									this.mBookmark = oFF.XArray.create(3);
								}
								else
								{
									this.mBookmark.clear();
								}
								var decoded = oFF.XByteArray.convertToString(oFF.XHttpUtils.decodeBase64ToByteArray(bookmarkData));
								if (oFF.notNull(decoded))
								{
									this.mBookmark.set(2, oFF.XStringValue.create(decoded));
								}
								var title = d.getStringByKey("Title");
								if (oFF.notNull(title))
								{
									this.mBookmark.set(0, oFF.XStringValue.create(title));
								}
								else
								{
									this.mBookmark.set(0, oFF.XStringValue.create(""));
								}
								var owner = d.getStringByKey("Owner");
								if (oFF.notNull(owner))
								{
									this.mBookmark.set(1, oFF.XStringValue.create(owner));
								}
							}
						}
					}
				}
			}
		}
	}
};
