sap.zen.ZBackendServices.prototype.getApplications = function(oMessageWriter)
{
	var list = oFF.XList.create();
	var uri = oFF.XUri.create();
	uri.setProtocolType(this.moSystemDescription.getProtocolType());
	var httpClient = oFF.HttpClientFactory.newInstanceByConnection(this.moApplication.getSession(), uri);
	var request = httpClient.getRequest();
	request.setFromConnectionInfo(this.moSystemDescription);
	request.setMethod(oFF.HttpRequestMethod.HTTP_GET);
	if (this.ishanaSystem())
	{
		request.setAcceptContentType(oFF.ContentType.TEXT_PLAIN);
		request.setTextContentEncoding("UTF-8");
		request.setPath("/sap/bi/aas/rt/repo.xsjs?api=listAppNames");
		var processHttpRequest = httpClient.processHttpRequest(oFF.SyncType.BLOCKING, null, null);
		oMessageWriter.createMessagesFromCollection(processHttpRequest);
		var response = processHttpRequest.getData();
		if (processHttpRequest.hasErrors() === false)
		{
			var content = response.getString();
			var splitString = oFF.XStringTokenizer.splitString(content, "\n");
			for (var i = 0; i < splitString.size(); i++)
			{
				var appName = splitString.get(i);
				var techName = appName;
				var description = appName;
				var member = sap.zen.Member.create(techName, description);
				list.add(member);
			}
		}
	}
	else
	{
		request.setAcceptContentType(oFF.ContentType.APPLICATION_XML);
		request.setTextContentEncoding("UTF-8");
		request.setPath("/sap/opu/odata/sap/RSAO_ODATA_SRV/BiApplicationSet");
		var processHttpRequest2 = httpClient.processHttpRequest(oFF.SyncType.BLOCKING, null, null);
		oMessageWriter.createMessagesFromCollection(processHttpRequest2);
		var response2 = processHttpRequest2.getData();
		if (processHttpRequest2.hasErrors() === false)
		{
			var content2 = response2.getString();
			var node = sap.buddha.XXmlUtils.getRootNode(content2);
			var entriesNodes = node.getChildrenWoBiNameSpace("entry");
			for (var i2 = 0; i2 < entriesNodes.size(); i2++)
			{
				var entryNode = entriesNodes.get(i2);
				var contentNode = entryNode.getFirstChildWoBiNameSpace("content");
				var propertiesNode = contentNode.getFirstChildWoBiNameSpace("m:properties");
				var techNameNode = propertiesNode.getFirstChildWoBiNameSpace("d:Techname");
				var descrNode = propertiesNode.getFirstChildWoBiNameSpace("d:Descr");
				var techName2 = techNameNode.getText();
				var description2 = descrNode.getText();
				var member2 = sap.zen.Member.create(techName2, description2);
				list.add(member2);
			}
		}
	}
	return list;
};
