sap.zen.KeyValueObject.prototype.compareTo = function(objectToCompare)
{
	if (oFF.isNull(objectToCompare))
	{
		return -1;
	}
	if (objectToCompare === this)
	{
		return 0;
	}
	var loKeyValueObjectToCompare = objectToCompare;
	var lCompareResult = oFF.XString.compare(this.getValue(), loKeyValueObjectToCompare.getValue());
	if (lCompareResult === 0)
	{
		lCompareResult = oFF.XString.compare(this.getKey(), loKeyValueObjectToCompare.getKey());
	}
	return lCompareResult;
};

