sap.zen.MemberList.prototype.mCurrentNumber = 0;
sap.zen.MemberList.prototype.mMemberDisplay = null;
sap.zen.MemberList.prototype.mKeyPres = null;
sap.zen.MemberList.prototype.initMe = function(tDimensionMembers, tVisibleFields, maxNumber, allMemberText, keyPres, memberDisplay)
{
	this.mtDimensionMembers = tDimensionMembers;
	this.moDimensionMemberIterator = this.mtDimensionMembers.getIterator();
	this.mMaxNumber = maxNumber;
	this.mAllMemberText = allMemberText;
	this.mKeyPres = keyPres;
	this.mMemberDisplay = memberDisplay;
};
sap.zen.MemberList.prototype.next = function()
{
	var loMember = null;
	if (this.mCurrentNumber === 0 && oFF.notNull(this.mAllMemberText))
	{
		loMember = sap.zen.Member.create("", this.mAllMemberText);
	}
	else
	{
		var loDimensionMember = this.moDimensionMemberIterator.next();
		var lText = loDimensionMember.getText();
		var lKeyValue = loDimensionMember.getKeyFieldValue(false);
		var lKey = null;
		if (oFF.XString.isEqual("TEXT", this.mKeyPres))
		{
			lKey = lText;
		}
		else if (oFF.XString.isEqual("EXTERNAL_KEY", this.mKeyPres))
		{
			lKey = lKeyValue;
		}
		else if (oFF.XString.isEqual("INTERNAL_KEY", this.mKeyPres))
		{
			lKey = lKeyValue;
		}
		else if (oFF.XString.isEqual("EXTERNAL_NONCOMPOUNDED_KEY", this.mKeyPres))
		{
			lKey = lKeyValue;
		}
		else if (oFF.XString.isEqual("INTERNAL_NONCOMPOUNDED_KEY", this.mKeyPres))
		{
			lKey = lKeyValue;
		}
		else
		{
			lKey = lKeyValue;
		}
		if (oFF.isNull(lKey))
		{
			lKey = loDimensionMember.getName();
		}
		if (oFF.isNull(lKey))
		{
			lKey = "";
		}
		var lValue = "";
		if (oFF.XString.isEqual("TEXT", this.mMemberDisplay))
		{
			lValue = lText;
		}
		else if (oFF.XString.isEqual("KEY", this.mMemberDisplay))
		{
			lValue = lKeyValue;
		}
		else if (oFF.XString.isEqual("KEY_TEXT", this.mMemberDisplay))
		{
			lValue = oFF.XStringUtils.concatenate3(lKeyValue, " - ", lText);
		}
		else if (oFF.XString.isEqual("TEXT_KEY", this.mMemberDisplay))
		{
			lValue = oFF.XStringUtils.concatenate3(lText, " - ", lKeyValue);
		}
		if (oFF.isNull(lValue))
		{
			lValue = loDimensionMember.getName();
		}
		loMember = sap.zen.Member.create(lKey, lValue);
	}
	this.mCurrentNumber++;
	return loMember;
};
sap.zen.MemberList.prototype.hasNext = function()
{
	return this.moDimensionMemberIterator.hasNext() && this.mMaxNumber > this.mCurrentNumber;
};
