sap.zen.Dimension.createProperties = function(oParent, oDataSource, oResultSet, dimensionName)
{
	var loInstance = null;
	if (oFF.notNull(oParent) && !oFF.XString.isEqual(oParent.getName(), dimensionName))
	{
		loInstance = sap.zen.Dimension.sCreate(null, oDataSource, oResultSet, dimensionName, null, null);
	}
	return loInstance;
};
sap.zen.Dimension.sCreate = function(oParent, oDataSource, oResultSet, dimensionName, oInternalDimension, oInternalQMDimension)
{
	if (oFF.isNull(oDataSource))
	{
		return null;
	}
	var loInternalDimension = oInternalDimension;
	var loInternalQMDimension = oInternalQMDimension;
	var lDimensionName = dimensionName;
	var lCreatedForInternalObject = false;
	if (oFF.notNull(loInternalDimension))
	{
		lCreatedForInternalObject = true;
	}
	if (oFF.isNull(loInternalDimension))
	{
		loInternalQMDimension = sap.zen.Dimension.sGetDimensionObject(oDataSource, lDimensionName);
		loInternalDimension = loInternalQMDimension;
	}
	if (oFF.isNull(loInternalDimension))
	{
		return null;
	}
	lDimensionName = loInternalDimension.getName();
	if (oFF.isNull(sap.zen.Dimension.stDimensions))
	{
		sap.zen.Dimension.stDimensions = oFF.XSimpleMap.create();
	}
	if (oFF.isNull(sap.zen.Dimension.stMapInternalDimensions))
	{
		sap.zen.Dimension.stMapInternalDimensions = oFF.XSimpleMap.create();
	}
	var loDimension = null;
	var ltMapInternalDimensions = sap.zen.Dimension.stMapInternalDimensions.getByKey(oDataSource);
	if (oFF.isNull(ltMapInternalDimensions))
	{
		ltMapInternalDimensions = oFF.XSimpleMap.create();
		sap.zen.Dimension.stMapInternalDimensions.put(oDataSource, ltMapInternalDimensions);
	}
	loDimension = ltMapInternalDimensions.getByKey(loInternalDimension);
	if (oFF.isNull(loDimension))
	{
		loDimension = new sap.zen.Dimension();
		loDimension.initMe(oParent, oDataSource, oResultSet, loInternalDimension, loInternalQMDimension);
		ltMapInternalDimensions.put(loInternalDimension, loDimension);
	}
	if (loDimension.isQueryModelDimension())
	{
		var ltDimensions = sap.zen.Dimension.stDimensions.getByKey(oDataSource);
		if (oFF.isNull(ltDimensions))
		{
			ltDimensions = oFF.XHashMapByString.create();
			sap.zen.Dimension.stDimensions.put(oDataSource, ltDimensions);
		}
		if (!ltDimensions.containsKey(lDimensionName))
		{
			ltDimensions.put(lDimensionName, loDimension);
		}
	}
	loDimension.mCreatedForInternalObject = lCreatedForInternalObject;
	return loDimension;
};
sap.zen.Dimension.sReleaseDimensions = function(oDataSource)
{
	var loDimensionIterator = null;
	var loDimension = null;
	if (oFF.notNull(sap.zen.Dimension.stDimensions))
	{
		var ltDimensions = sap.zen.Dimension.stDimensions.getByKey(oDataSource);
		if (oFF.notNull(ltDimensions))
		{
			loDimensionIterator = ltDimensions.getIterator();
			while (loDimensionIterator.hasNext())
			{
				loDimension = loDimensionIterator.next();
				if (oFF.isNull(loDimension) || loDimension.mCreatedForInternalObject)
				{
					continue;
				}
				oFF.XObjectExt.release(loDimension);
			}
			oFF.XObjectExt.release(ltDimensions);
			ltDimensions = null;
		}
		sap.zen.Dimension.stDimensions.remove(oDataSource);
	}
	if (oFF.notNull(sap.zen.Dimension.stMapInternalDimensions))
	{
		var ltSpecialDimensions = sap.zen.Dimension.stMapInternalDimensions.getByKey(oDataSource);
		if (oFF.notNull(ltSpecialDimensions))
		{
			loDimensionIterator = ltSpecialDimensions.getIterator();
			while (loDimensionIterator.hasNext())
			{
				loDimension = loDimensionIterator.next();
				if (oFF.isNull(loDimension) || loDimension.mCreatedForInternalObject)
				{
					continue;
				}
				oFF.XObjectExt.release(loDimension);
			}
			oFF.XObjectExt.release(ltSpecialDimensions);
			ltSpecialDimensions = null;
		}
		sap.zen.Dimension.stMapInternalDimensions.remove(oDataSource);
	}
};
sap.zen.Dimension.sGetDimensionObject = function(oDataSource, dimensionName)
{
	if (oFF.isNull(oDataSource))
	{
		return null;
	}
	var loQueryManager = oDataSource.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return null;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return null;
	}
	var loInternalDimension = loQueryModel.getDimensionByName(dimensionName);
	if (oFF.isNull(loInternalDimension) && oFF.XString.isEqual("[Measures]", dimensionName))
	{
		loInternalDimension = loQueryModel.getMeasureDimension();
	}
	return loInternalDimension;
};
sap.zen.Dimension.sGetDimensions = function(oDataSource, sort)
{
	var ltDimensions = oFF.XListOfNameObject.create();
	if (oFF.isNull(oDataSource))
	{
		return ltDimensions;
	}
	var loQueryManager = oDataSource.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return ltDimensions;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return ltDimensions;
	}
	var ltInternalDimensions = loQueryModel.getDimensions();
	if (oFF.notNull(ltInternalDimensions) && !ltInternalDimensions.isEmpty())
	{
		var loInternalDimensionIterator = ltInternalDimensions.getIterator();
		while (loInternalDimensionIterator.hasNext())
		{
			var loInternalDimension = loInternalDimensionIterator.next();
			if (oFF.isNull(loInternalDimension))
			{
				continue;
			}
			var loDimension = sap.zen.Dimension.sCreate(null, oDataSource, null, null, loInternalDimension, loInternalDimension);
			ltDimensions.add(loDimension);
		}
	}
	if (sort)
	{
		var loComparator = new sap.zen.DimensionSortByTextAscComparator();
		ltDimensions.sortByComparator(loComparator);
	}
	return ltDimensions;
};
