sap.zen.Dimension.sGetValueFromMember = function(oValue, valueType)
{
	var lValue = "";
	var lInternal = null;
	var lExternal = null;
	var lText = null;
	if (oFF.notNull(oValue))
	{
		if (oFF.XMath.binaryAnd(valueType, sap.zen.Dimension.VALUE_TYPE_EXT) > 0)
		{
			lExternal = oValue.getDisplayKey();
		}
		if (oFF.XMath.binaryAnd(valueType, sap.zen.Dimension.VALUE_TYPE_TEXT) > 0)
		{
			lText = oValue.getText();
		}
		if (oFF.XMath.binaryAnd(valueType, sap.zen.Dimension.VALUE_TYPE_INT) > 0)
		{
			lInternal = oValue.getKey();
		}
	}
	if (oFF.notNull(lExternal))
	{
		lValue = lExternal;
	}
	if (oFF.notNull(lText))
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lValue) && !oFF.XString.isEqual(lExternal, lText))
		{
			lValue = oFF.XStringUtils.concatenate4(lValue, " (", lText, ")");
		}
		else
		{
			lValue = lText;
		}
	}
	if (oFF.notNull(lInternal))
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lValue) && !oFF.XString.isEqual(lExternal, lInternal))
		{
			lValue = oFF.XStringUtils.concatenate4(lValue, " [", lInternal, "]");
		}
		else
		{
			lValue = lInternal;
		}
	}
	if (oFF.XStringUtils.isNullOrEmpty(lValue))
	{
		if (oFF.notNull(oValue))
		{
			lValue = oValue.getKey();
		}
	}
	return lValue;
};
sap.zen.Dimension.sGetValuesFromRangeList = function(tRanges, valueType)
{
	if (oFF.isNull(tRanges) || tRanges.isEmpty())
	{
		return "";
	}
	var lValuesText = "";
	var loRangeIterator = tRanges.getIterator();
	while (loRangeIterator.hasNext())
	{
		var loRange = loRangeIterator.next();
		if (oFF.isNull(loRange))
		{
			continue;
		}
		var lRangeLowText = sap.zen.Dimension.sGetValueFromMember(loRange.getFrom(), valueType);
		var lRangeHighText = null;
		if (loRange.getOperation() === sap.zen.Operation.BT)
		{
			lRangeHighText = sap.zen.Dimension.sGetValueFromMember(loRange.getTo(), valueType);
		}
		var lRangeText = lRangeLowText;
		if (sap.zen.Operation.LT.isEqualTo(loRange.getOperation()))
		{
			lRangeText = oFF.XStringUtils.concatenate2("<", lRangeLowText);
		}
		else if (sap.zen.Operation.LE.isEqualTo(loRange.getOperation()))
		{
			lRangeText = oFF.XStringUtils.concatenate2("<=", lRangeLowText);
		}
		else if (sap.zen.Operation.GT.isEqualTo(loRange.getOperation()))
		{
			lRangeText = oFF.XStringUtils.concatenate2(">", lRangeLowText);
		}
		else if (sap.zen.Operation.GE.isEqualTo(loRange.getOperation()))
		{
			lRangeText = oFF.XStringUtils.concatenate2(">=", lRangeLowText);
		}
		else if (sap.zen.Operation.BT.isEqualTo(loRange.getOperation()))
		{
			if (oFF.XString.isEqual(lRangeLowText, lRangeHighText))
			{
				lRangeText = lRangeLowText;
			}
			else
			{
				lRangeText = oFF.XStringUtils.concatenate3(lRangeLowText, " - ", lRangeHighText);
			}
		}
		if (loRange.isExclude())
		{
			lRangeText = oFF.XStringUtils.concatenate2("!", lRangeText);
		}
		if (oFF.XString.size(lValuesText) <= 0)
		{
			lValuesText = lRangeText;
		}
		else
		{
			lValuesText = oFF.XStringUtils.concatenate3(lValuesText, "; ", lRangeText);
		}
	}
	return lValuesText;
};
