sap.zen.Dimension.prototype.getDimensionMembersForFieldValues = function(fieldName, tValues)
{
	return this.fetchDimensionMembers(fieldName, tValues, -1);
};
sap.zen.Dimension.prototype.fetchDimensionMembers = function(fieldName, tValues, maxMembers)
{
	var ltDimensionMembers = oFF.XListOfNameObject.create();
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return ltDimensionMembers;
	}
	var loSearchField = loInternalDimension.getFieldByName(fieldName);
	var loKeyField = loInternalDimension.getFieldByName(this.getKeyField(null, false));
	var loDisplayKeyField = loInternalDimension.getFieldByName(this.getKeyField(null, true));
	var loTextField = loInternalDimension.getFieldByName(this.getTextField(null, null));
	loInternalDimension.clearSelectorFilter();
	if (oFF.notNull(tValues) && !tValues.isEmpty())
	{
		loInternalDimension.setSelectorPagingEnd(-1);
	}
	else
	{
		loInternalDimension.setSelectorPagingEnd(maxMembers);
	}
	var ltInternalSelectorFields = loInternalDimension.getSelectorFields();
	ltInternalSelectorFields.add(loKeyField);
	ltInternalSelectorFields.add(loDisplayKeyField);
	if (this.getMemberDisplayMode(null) !== sap.zen.CMemberDisplayMode.KEY && !loInternalDimension.getKeyField().getValueType().isTypeOf(oFF.XValueType.DATE))
	{
		ltInternalSelectorFields.add(loTextField);
		ltInternalSelectorFields.add(loInternalDimension.getTextField());
	}
	var ltVisibleFields = this.getResultSetFields();
	if (oFF.notNull(ltVisibleFields) && !ltVisibleFields.isEmpty())
	{
		var loVisibleFieldIterator = ltVisibleFields.getIterator();
		while (loVisibleFieldIterator.hasNext())
		{
			var lVisibleField = loVisibleFieldIterator.next();
			if (oFF.isNull(lVisibleField))
			{
				continue;
			}
			var loInternalField = loInternalDimension.getFieldByName(lVisibleField);
			if (oFF.notNull(loInternalField))
			{
				ltInternalSelectorFields.add(loInternalField);
			}
		}
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(fieldName) && oFF.notNull(tValues))
	{
		if (!tValues.isEmpty())
		{
			var loValueIterator = tValues.getIterator();
			while (loValueIterator.hasNext())
			{
				var lSearchString = loValueIterator.next();
				if (oFF.isNull(lSearchString))
				{
					continue;
				}
				if (!this.isMeasureStructure())
				{
					if (!loInternalDimension.supportsLowerCase() || loSearchField.getValueType() === oFF.XValueType.UPPER_CASE_STRING)
					{
						lSearchString = oFF.XString.toUpperCase(lSearchString);
					}
					else if (loSearchField.getValueType() === oFF.XValueType.LOWER_CASE_STRING)
					{
						lSearchString = oFF.XString.toLowerCase(lSearchString);
					}
				}
				loInternalDimension.addSelectorFilter(this.createValueObjectForField(loSearchField, lSearchString), loSearchField, oFF.ComparisonOperator.EQUAL);
			}
		}
	}
	var loResult = loInternalDimension.processValueHelp(oFF.SyncType.BLOCKING, null, null);
	if (loResult.isValid())
	{
		var ltData = loResult.getData();
		if (oFF.notNull(ltData) && !ltData.isEmpty())
		{
			var loDataIterator = ltData.getIterator();
			while (loDataIterator.hasNext())
			{
				var loDataNode = loDataIterator.next();
				if (oFF.isNull(loDataNode))
				{
					continue;
				}
				var loInternalDimensionMember = loDataNode.getDimensionMember();
				var loDimensionMember = sap.zen.DimensionMember.sGetDimensionMember(this, loInternalDimensionMember.getName());
				if (!ltDimensionMembers.contains(loDimensionMember))
				{
					ltDimensionMembers.add(loDimensionMember);
				}
				if (!(this.isCompound() && loSearchField !== loKeyField))
				{
					var loMemberWrapper = sap.zen.MemberWrapper.create(this.getDataSource(), loInternalDimension, loInternalDimensionMember, false, null);
					var loMemberCache = sap.zen.MemberCache.create(this.moDataSource, this.getName());
					loMemberCache.putMemberWrapper(loMemberWrapper);
				}
			}
		}
	}
	return ltDimensionMembers;
};
sap.zen.Dimension.prototype.createValueObjectForField = function(oField, value)
{
	var lValueType = oField.getValueType();
	try
	{
		if (lValueType === oFF.XValueType.STRING)
		{
			return oFF.XStringValue.create(value);
		}
		else if (lValueType === oFF.XValueType.LONG)
		{
			return oFF.XLongValue.create(oFF.XLong.convertFromString(value));
		}
		else if (lValueType === oFF.XValueType.INTEGER)
		{
			return oFF.XIntegerValue.create(oFF.XInteger.convertFromString(value));
		}
		else if (lValueType === oFF.XValueType.DOUBLE || lValueType === oFF.XValueType.DECIMAL_FLOAT)
		{
			return oFF.XDoubleValue.create(oFF.XDouble.convertFromString(value));
		}
		else if (lValueType === oFF.XValueType.DATE)
		{
			var loDate = null;
			try
			{
				loDate = oFF.XDate.createDateFromString(value, null);
			}
			catch (lABAPDateException)
			{
				loDate = null;
			}
			if (oFF.isNull(loDate))
			{
				try
				{
					loDate = oFF.XDate.createDateFromString(value, oFF.DateTimeFormat.ISO);
				}
				catch (lISODateException)
				{
					loDate = null;
				}
			}
			if (oFF.isNull(loDate) && oFF.XStringUtils.isNotNullAndNotEmpty(value))
			{
				var ltValuess = oFF.XListOfString.create();
				ltValuess.add(value);
				var ltDimensionMembers = this.getDimensionMembersForFieldValues(this.getKeyField(null, false), ltValuess);
				if (!ltDimensionMembers.isEmpty())
				{
					loDate = ltDimensionMembers.get(0).getInternalObject().getKeyFieldValue().getDate();
				}
			}
			return loDate;
		}
		else if (lValueType === oFF.XValueType.TIME)
		{
			return oFF.XTime.createTimeFromString(value, null);
		}
		else if (lValueType === oFF.XValueType.DATE_TIME)
		{
			return oFF.XDateTime.createDateTimeFromString(value, null);
		}
		else if (lValueType === oFF.XValueType.TIMESPAN)
		{
			return oFF.XTimeSpan.create(oFF.XLong.convertFromString(value));
		}
	}
	catch (e)
	{
		return null;
	}
	throw oFF.XException.createIllegalStateException(oFF.XStringUtils.concatenate2("Value type not supported: ", lValueType.getName()));
};
sap.zen.Dimension.prototype.getDimensionMembersInResultSet = function(maxMembers)
{
	var ltDimensionMembers = oFF.XListOfNameObject.create();
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return ltDimensionMembers;
	}
	var loResultSet = this.getResultSet();
	if (oFF.isNull(loResultSet))
	{
		return ltDimensionMembers;
	}
	var loInternalResultSet = loResultSet.getInternalObject();
	if (oFF.isNull(loInternalResultSet))
	{
		return ltDimensionMembers;
	}
	var loDimensionMemberIterator = null;
	var loDimensionMember = null;
	var loInternalDimensionMemberIterator = null;
	var loInternalDimensionMember = null;
	if (loResultSet.hasData() || !this.isMeasureStructure())
	{
		var ltInternalDimensionMembers = loInternalResultSet.getAxis(this.getAxis()).getAllMembers(loInternalDimension);
		if (oFF.notNull(ltInternalDimensionMembers) && !ltInternalDimensionMembers.isEmpty())
		{
			loInternalDimensionMemberIterator = ltInternalDimensionMembers.getIterator();
			while (loInternalDimensionMemberIterator.hasNext())
			{
				loInternalDimensionMember = loInternalDimensionMemberIterator.next();
				if (oFF.isNull(loInternalDimensionMember))
				{
					continue;
				}
				loDimensionMember = sap.zen.DimensionMember.sGetDimensionMember(this, loInternalDimensionMember.getName());
				if (!ltDimensionMembers.contains(loDimensionMember))
				{
					ltDimensionMembers.add(loDimensionMember);
				}
			}
		}
	}
	else
	{
		var ltDimensionMemberMap = oFF.XHashMapByString.create();
		var ltAllDimensionMembers = this.getDimensionMembers(maxMembers);
		if (oFF.notNull(ltAllDimensionMembers) && !ltAllDimensionMembers.isEmpty())
		{
			loDimensionMemberIterator = ltAllDimensionMembers.getIterator();
			while (loDimensionMemberIterator.hasNext())
			{
				loDimensionMember = loDimensionMemberIterator.next();
				if (oFF.isNull(loDimensionMember))
				{
					continue;
				}
				ltDimensionMemberMap.put(loDimensionMember.getName(), loDimensionMember);
			}
		}
		var loDataSource = this.getResultSet().getDataSource();
		var loCharacteristicWrapper = sap.zen.CharacteristicWrapper.create(loDataSource, loInternalDimension, null, null, sap.zen.CMemberDisplayMode.KEY_TEXT, false);
		var ltRanges = loCharacteristicWrapper.getAllSelections();
		var ltRemoveDimensionMember = oFF.XList.create();
		if (oFF.notNull(ltRanges) && !ltRanges.isEmpty())
		{
			var loRangeIterator = ltRanges.getIterator();
			while (loRangeIterator.hasNext())
			{
				var loRange = loRangeIterator.next();
				if (oFF.isNull(loRange))
				{
					continue;
				}
				if (!loRange.isExclude())
				{
					if (loRange.getOperation() === sap.zen.Operation.EQ)
					{
						loDimensionMember = ltDimensionMemberMap.getByKey(loRange.getFrom().getKey());
						if (!ltDimensionMembers.contains(loDimensionMember))
						{
							ltDimensionMembers.add(loDimensionMember);
						}
					}
				}
				else
				{
					if (loRange.getOperation() === sap.zen.Operation.EQ)
					{
						ltRemoveDimensionMember.add(ltDimensionMemberMap.getByKey(loRange.getFrom().getKey()));
					}
				}
			}
		}
		if (ltDimensionMembers.isEmpty() || !ltRemoveDimensionMember.isEmpty())
		{
			if (oFF.notNull(ltAllDimensionMembers) && !ltAllDimensionMembers.isEmpty())
			{
				loDimensionMemberIterator = ltAllDimensionMembers.getIterator();
				while (loDimensionMemberIterator.hasNext())
				{
					loDimensionMember = loDimensionMemberIterator.next();
					if (oFF.isNull(loDimensionMember))
					{
						continue;
					}
					if (!ltDimensionMembers.contains(loDimensionMember))
					{
						ltDimensionMembers.add(loDimensionMember);
					}
				}
			}
		}
		if (oFF.notNull(ltRemoveDimensionMember) && !ltRemoveDimensionMember.isEmpty())
		{
			var loRemoveDimensionMemberIterator = ltRemoveDimensionMember.getIterator();
			while (loRemoveDimensionMemberIterator.hasNext())
			{
				loDimensionMember = loRemoveDimensionMemberIterator.next();
				if (oFF.isNull(loDimensionMember))
				{
					continue;
				}
				ltDimensionMembers.removeElement(loDimensionMember);
			}
		}
	}
	return ltDimensionMembers;
};
sap.zen.Dimension.prototype.isDimensionMemberInResultSet = function(memberName)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return false;
	}
	var ltVisibleDimensionMembers = this.getDimensionMembersInResultSet(-1);
	var lAmountOfVisibleDimensionMembers = ltVisibleDimensionMembers.size();
	var lAmountOfDimensionMembers = loInternalDimension.getAllStructureMembers().size();
	var lDimensionMemberIsVisible = lAmountOfDimensionMembers === lAmountOfVisibleDimensionMembers;
	if (lDimensionMemberIsVisible !== true)
	{
		if (!ltVisibleDimensionMembers.isEmpty())
		{
			var loVisibleDimensionMemberIterator = ltVisibleDimensionMembers.getIterator();
			while (loVisibleDimensionMemberIterator.hasNext())
			{
				var loVisibleDimensionMember = loVisibleDimensionMemberIterator.next();
				if (oFF.isNull(loVisibleDimensionMember))
				{
					continue;
				}
				if (oFF.XString.isEqual(loVisibleDimensionMember.getName(), memberName))
				{
					lDimensionMemberIsVisible = true;
					break;
				}
			}
		}
	}
	return lDimensionMemberIsVisible;
};
sap.zen.Dimension.prototype.addDimensionMemberToResultSet = function(memberName, triggerChangedEvent)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return;
	}
	var loDimensionMember = sap.zen.DimensionMember.sGetDimensionMember(this, memberName);
	if (oFF.notNull(loDimensionMember) && loDimensionMember.getInternalObject().getResultVisibility() !== oFF.ResultVisibility.VISIBLE)
	{
		try
		{
			loDimensionMember.getInternalObject().setResultVisibility(oFF.ResultVisibility.VISIBLE);
		}
		catch (loException)
		{
			oFF.XLogger.println("Ignored Exception");
		}
	}
	var ltVisibleDimensionMembers = this.getDimensionMembersInResultSet(-1);
	var ltRanges = oFF.XList.create();
	var loRange = null;
	var loMemberWrapper = null;
	if (oFF.notNull(ltVisibleDimensionMembers) && !ltVisibleDimensionMembers.isEmpty())
	{
		var loVisibleDimensionMemberIterator = ltVisibleDimensionMembers.getIterator();
		while (loVisibleDimensionMemberIterator.hasNext())
		{
			var loVisibleDimensionMember = loVisibleDimensionMemberIterator.next();
			if (oFF.isNull(loVisibleDimensionMember))
			{
				continue;
			}
			loMemberWrapper = new sap.zen.MemberKeyWrapper();
			loMemberWrapper.initMe(loVisibleDimensionMember.getName());
			loRange = new sap.zen.Range();
			loRange.initMe2(loMemberWrapper);
			loRange.setOperation(sap.zen.Operation.EQ);
			loRange.setExclude(false);
			ltRanges.add(loRange);
		}
	}
	loMemberWrapper = new sap.zen.MemberKeyWrapper();
	loMemberWrapper.initMe(memberName);
	loRange = new sap.zen.Range();
	loRange.initMe2(loMemberWrapper);
	loRange.setOperation(sap.zen.Operation.EQ);
	loRange.setExclude(false);
	ltRanges.add(loRange);
	if (loInternalDimension.getAllStructureMembers().size() === ltRanges.size())
	{
		this.clearFilter(false);
	}
	else
	{
		this.setFilterFromRange(ltRanges, false, false);
	}
	if (triggerChangedEvent)
	{
		var loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
		loDataSourceChangeCause.setAction(sap.zen.CDataSourceChangeAction.AddMemberToResultSet);
		loDataSourceChangeCause.addProperties(this.getActionObjectProperties());
		loDataSourceChangeCause.addProperty(sap.zen.CDataSourceProperty.DIMENSION_MEMBER.getValue(), memberName);
		this.getDataSource().raiseDataSourceChangedEvent(loDataSourceChangeCause, false, true);
	}
};
