sap.zen.Dimension.prototype.setTotalsDisplay = function(totalsDisplay, triggerChangedEvent)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return false;
	}
	if (!loInternalDimension.supportsResultVisibility())
	{
		return false;
	}
	var lResultVisibility = null;
	if (oFF.XString.isEqual(sap.zen.TotalsDisplay.HIDE, totalsDisplay) || oFF.XString.isEqual(oFF.ResultVisibility.HIDDEN.getName(), totalsDisplay) || oFF.XString.isEqual(oFF.XString.toUpperCase(oFF.ResultVisibility.HIDDEN.getName()), totalsDisplay))
	{
		lResultVisibility = oFF.ResultVisibility.HIDDEN;
	}
	else if (oFF.XString.isEqual(sap.zen.TotalsDisplay.SHOW, totalsDisplay) || oFF.XString.isEqual(oFF.ResultVisibility.VISIBLE.getName(), totalsDisplay) || oFF.XString.isEqual(oFF.XString.toUpperCase(oFF.ResultVisibility.VISIBLE.getName()), totalsDisplay))
	{
		lResultVisibility = oFF.ResultVisibility.VISIBLE;
	}
	else if (oFF.XString.isEqual(sap.zen.TotalsDisplay.HIDE_IF_ONLY_ONE_MEMBER, totalsDisplay) || oFF.XString.isEqual(oFF.ResultVisibility.CONDITIONAL.getName(), totalsDisplay) || oFF.XString.isEqual(oFF.XString.toUpperCase(oFF.ResultVisibility.CONDITIONAL.getName()), totalsDisplay))
	{
		if (loInternalDimension.getModelCapabilities().supportsConditionalResultVisibility())
		{
			lResultVisibility = oFF.ResultVisibility.CONDITIONAL;
		}
	}
	if (oFF.isNull(lResultVisibility))
	{
		return false;
	}
	if (loInternalDimension.getResultVisibility() === lResultVisibility)
	{
		return false;
	}
	loInternalDimension.setResultVisibility(lResultVisibility);
	if (triggerChangedEvent)
	{
		var loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
		loDataSourceChangeCause.setAction(sap.zen.CDataSourceChangeAction.SetTotalsDisplay);
		loDataSourceChangeCause.addProperties(this.getActionObjectProperties());
		loDataSourceChangeCause.addProperty("TotalsDisplay", lResultVisibility.getName());
		this.getDataSource().raiseDataSourceChangedEvent(loDataSourceChangeCause, false, true);
	}
	return true;
};
