sap.zen.Dimension.prototype.getSupportedSortTypeOptions = function(attributeName)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return null;
	}
	var ltSupportedSortTypes = oFF.XList.create();
	var loSortingManager = loInternalDimension.getQueryModel().getSortingManager();
	var lSupported = false;
	if (this.isMeasureStructure())
	{
		var loInternalStructureMember = loInternalDimension.getStructureMember(attributeName);
		lSupported = oFF.notNull(loInternalStructureMember) && loSortingManager.supportsMeasureSorting();
		if (lSupported)
		{
			ltSupportedSortTypes.add(oFF.SortType.MEASURE);
		}
	}
	else
	{
		lSupported = loSortingManager.supportsDimensionSorting(loInternalDimension, null);
		if (lSupported)
		{
			var loInternalAttribute = null;
			if (oFF.XStringUtils.isNotNullAndNotEmpty(attributeName))
			{
				loInternalAttribute = sap.zen.Dimension.sGetAttributeObject(this.getDataSource(), this.getName(), attributeName);
			}
			if (oFF.notNull(loInternalAttribute))
			{
				lSupported = loSortingManager.supportsFieldSorting(loInternalAttribute.getKeyField());
				if (lSupported)
				{
					ltSupportedSortTypes.add(oFF.SortType.MEMBER_KEY);
				}
				lSupported = loSortingManager.supportsFieldSorting(loInternalAttribute.getTextField());
				if (lSupported)
				{
					ltSupportedSortTypes.add(oFF.SortType.MEMBER_TEXT);
				}
			}
			else
			{
				lSupported = loSortingManager.supportsDimensionSorting(loInternalDimension, oFF.SortType.MEMBER_KEY);
				if (lSupported)
				{
					ltSupportedSortTypes.add(oFF.SortType.MEMBER_KEY);
				}
				lSupported = loSortingManager.supportsDimensionSorting(loInternalDimension, oFF.SortType.MEMBER_TEXT);
				if (lSupported)
				{
					ltSupportedSortTypes.add(oFF.SortType.MEMBER_TEXT);
				}
				lSupported = loSortingManager.supportsDimensionSorting(loInternalDimension, oFF.SortType.HIERARCHY);
				if (lSupported)
				{
					ltSupportedSortTypes.add(oFF.SortType.HIERARCHY);
				}
			}
		}
	}
	return ltSupportedSortTypes;
};
sap.zen.Dimension.prototype.setSortOperation = function(attributeName, sortType, sortDirection, triggerChangedEvent)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return;
	}
	var loQueryModel = loInternalDimension.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return;
	}
	var loSortingManager = loQueryModel.getSortingManager();
	var loGenericResultSetSorting = null;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(attributeName))
	{
		if (this.isMeasureStructure())
		{
			var loInternalStructureMember = loInternalDimension.getStructureMember(attributeName);
			if (oFF.notNull(loInternalStructureMember) && loSortingManager.supportsMeasureSorting())
			{
				var loMeasureResultSetSorting = loSortingManager.getMeasureSorting(loInternalStructureMember, true);
				loGenericResultSetSorting = loMeasureResultSetSorting;
			}
		}
		else
		{
			var loInternalAttribute = sap.zen.Dimension.sGetAttributeObject(this.getDataSource(), this.getName(), attributeName);
			var loInternalField = null;
			if (sortType === oFF.SortType.MEMBER_KEY || oFF.isNull(sortType))
			{
				loInternalField = loInternalAttribute.getKeyField();
			}
			else if (sortType === oFF.SortType.MEMBER_TEXT)
			{
				loInternalField = loInternalAttribute.getTextField();
				if (oFF.isNull(loInternalField))
				{
					var ltInternalFields = loInternalAttribute.getFields();
					if (oFF.notNull(ltInternalFields) && !ltInternalFields.isEmpty())
					{
						loInternalField = ltInternalFields.get(0);
					}
				}
			}
			if (oFF.notNull(loInternalField) && loInternalField.supportsSorting())
			{
				var loFieldResultSetSorting = loInternalField.getResultSetSorting();
				loGenericResultSetSorting = loFieldResultSetSorting;
			}
		}
	}
	else
	{
		if (loSortingManager.supportsDimensionSorting(loInternalDimension, null))
		{
			var loDimensionResultSetSorting = loInternalDimension.getResultSetSorting();
			if (sortType === oFF.SortType.MEMBER_KEY)
			{
				loDimensionResultSetSorting.setSortByKey();
			}
			else if (sortType === oFF.SortType.MEMBER_TEXT)
			{
				loDimensionResultSetSorting.setSortByText();
			}
			if (oFF.XString.isEqual(sortDirection, oFF.SortType.HIERARCHY.getName()) || oFF.XString.isEqual(sortDirection, oFF.XString.toUpperCase(oFF.SortType.HIERARCHY.getName())))
			{
				loDimensionResultSetSorting.setSortByHierarchy();
				loDimensionResultSetSorting.setDirection(oFF.XSortDirection.DESCENDING);
			}
			loGenericResultSetSorting = loDimensionResultSetSorting;
		}
	}
	if (oFF.isNull(loGenericResultSetSorting))
	{
		return;
	}
	var lIndex = loSortingManager.getSortingOperations().getIndex(loGenericResultSetSorting);
	loSortingManager.getSortingOperations().removeAt(lIndex);
	loSortingManager.getSortingOperations().add(loGenericResultSetSorting);
	if (loGenericResultSetSorting.getSortingType() !== oFF.SortType.HIERARCHY)
	{
		if (oFF.XString.isEqual(sortDirection, oFF.XSortDirection.ASCENDING.getName()) || oFF.XString.isEqual(sortDirection, oFF.XString.toUpperCase(oFF.XSortDirection.ASCENDING.getName())))
		{
			loGenericResultSetSorting.setDirection(oFF.XSortDirection.ASCENDING);
		}
		else if (oFF.XString.isEqual(sortDirection, oFF.XSortDirection.DESCENDING.getName()) || oFF.XString.isEqual(sortDirection, oFF.XString.toUpperCase(oFF.XSortDirection.DESCENDING.getName())))
		{
			loGenericResultSetSorting.setDirection(oFF.XSortDirection.DESCENDING);
		}
		else if (oFF.XString.isEqual(sortDirection, oFF.XSortDirection.NONE.getName()) || oFF.XString.isEqual(sortDirection, oFF.XString.toUpperCase(oFF.XSortDirection.NONE.getName())) || oFF.XString.isEqual(sortDirection, oFF.XSortDirection.DEFAULT_VALUE.getName()) || oFF.XString.isEqual(sortDirection, oFF.XString.toUpperCase(oFF.XSortDirection.DEFAULT_VALUE.getName())))
		{
			loGenericResultSetSorting.setDirection(oFF.XSortDirection.NONE);
		}
	}
	if (triggerChangedEvent)
	{
		var loDataSourceChangeCause = new sap.zen.DataSourceChangeCause();
		loDataSourceChangeCause.setAction(sap.zen.CDataSourceChangeAction.SortDimension);
		loDataSourceChangeCause.addProperties(this.getActionObjectProperties());
		if (this.isMeasureStructure())
		{
			loDataSourceChangeCause.addProperty("ByMeasure", attributeName);
		}
		else
		{
			loDataSourceChangeCause.addProperty("ByAttribute", attributeName);
		}
		if (loGenericResultSetSorting.getSortingType() !== null)
		{
			loDataSourceChangeCause.addProperty("SortType", loGenericResultSetSorting.getSortingType().getName());
		}
		if (loGenericResultSetSorting.getDirection() !== null)
		{
			loDataSourceChangeCause.addProperty("SortDirection", loGenericResultSetSorting.getDirection().getName());
		}
		this.getDataSource().raiseDataSourceChangedEvent(loDataSourceChangeCause, false, true);
	}
};
sap.zen.Dimension.prototype.getSortOperation = function(attributeName)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return null;
	}
	var loQueryModel = loInternalDimension.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return null;
	}
	var loSortingManager = loQueryModel.getSortingManager();
	var ltSettings = oFF.XHashMapByString.create();
	var lIsAttribute = false;
	var lSortType = null;
	var lSortDirection = oFF.XSortDirection.DEFAULT_VALUE;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(attributeName))
	{
		if (this.isMeasureStructure())
		{
			lIsAttribute = true;
			var loInternalStructureMember = loInternalDimension.getStructureMember(attributeName);
			if (oFF.notNull(loInternalStructureMember) && loSortingManager.supportsMeasureSorting())
			{
				var loMeasureResultSetSorting = loSortingManager.getMeasureSorting(loInternalStructureMember, true);
				lSortType = oFF.SortType.MEASURE;
				lSortDirection = oFF.XSortDirection.DEFAULT_VALUE;
				if (oFF.notNull(loMeasureResultSetSorting))
				{
					lSortDirection = loMeasureResultSetSorting.getDirection();
				}
				ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTTYPE, lSortType);
				ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTDIRECTION, lSortDirection);
			}
		}
		else
		{
			var loInternalField = loInternalDimension.getFieldByName(attributeName);
			if (oFF.notNull(loInternalField))
			{
				var loInternalAttribute = loInternalField.getAttribute();
				if (oFF.notNull(loInternalAttribute))
				{
					lIsAttribute = sap.zen.DataSourceScriptApiUtils.isAttribute(this.getDataSource(), loInternalAttribute);
					if (loInternalField.isKeyField() || loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.ABSTRACT_KEY) || loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.HIERARCHY_KEY) || loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.HIERARCHY_DISPLAY_KEY))
					{
						loInternalField = loInternalAttribute.getKeyField();
						lSortType = oFF.SortType.MEMBER_KEY;
					}
					else if (loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.TEXT) || loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.HIERARCHY_TEXT))
					{
						loInternalField = loInternalAttribute.getTextField();
						lSortType = oFF.SortType.MEMBER_TEXT;
					}
					lSortDirection = oFF.XSortDirection.DEFAULT_VALUE;
					if (lIsAttribute)
					{
						if (loInternalField.supportsSorting())
						{
							var loFieldResultSetSorting = loInternalField.getResultSetSorting();
							if (oFF.notNull(loFieldResultSetSorting))
							{
								lSortDirection = loFieldResultSetSorting.getDirection();
							}
							ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTTYPE, lSortType);
							ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTDIRECTION, lSortDirection);
						}
					}
				}
			}
		}
	}
	if (!lIsAttribute)
	{
		var loDimensionSorting = loSortingManager.getDimensionSorting(loInternalDimension, false);
		if (oFF.notNull(loDimensionSorting))
		{
			if (oFF.isNull(lSortType))
			{
				lSortType = loDimensionSorting.getSortingType();
			}
			if (loDimensionSorting.getSortingType() === lSortType)
			{
				lSortDirection = loDimensionSorting.getDirection();
			}
		}
		if (lSortType === oFF.SortType.MEMBER_KEY || lSortType === oFF.SortType.MEMBER_TEXT || lSortType === oFF.SortType.HIERARCHY)
		{
			if (loSortingManager.supportsDimensionSorting(loInternalDimension, lSortType))
			{
				ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTTYPE, lSortType);
				ltSettings.put(sap.zen.Dimension.SORT_PARAM_SORTDIRECTION, lSortDirection);
			}
		}
	}
	return ltSettings;
};
