sap.zen.Dimension.prototype.setUDHDrilledToDimension = function(dimensionName, triggerChangedEvent)
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return false;
	}
	if (!this.isUDHSupported())
	{
		return false;
	}
	var lDrillLevel = 0;
	var loUDH = sap.zen.Dimension.sGetUDHObject(loInternalDimension);
	var ltUDHDimensions = loUDH.getDimensionNames();
	if (oFF.notNull(ltUDHDimensions) && !ltUDHDimensions.isEmpty())
	{
		var lDimensionIndex = 0;
		var loUDHDimensionIterator = ltUDHDimensions.getIterator();
		while (loUDHDimensionIterator.hasNext())
		{
			var lDimensionName = loUDHDimensionIterator.next();
			if (oFF.XString.isEqual(dimensionName, lDimensionName))
			{
				lDrillLevel = lDimensionIndex + 1;
			}
			lDimensionIndex++;
		}
	}
	return this.setUDHDrillLevel(lDrillLevel, triggerChangedEvent);
};
