sap.zen.Dimension.prototype.getHierarchies = function()
{
	var loInternalDimension = this.getInternalObject();
	if (oFF.isNull(loInternalDimension))
	{
		return null;
	}
	var loDataSource = this.getDataSource();
	if (oFF.isNull(loDataSource))
	{
		return null;
	}
	var loQueryManager = loDataSource.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return null;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return null;
	}
	var ltHierarchies = oFF.XList.create();
	if (this.isStructure())
	{
		return ltHierarchies;
	}
	var loSystemDescription = loQueryManager.getSystemDescription();
	if (oFF.HierarchyCatalogUtil.supportsHierarchyCatalog2(loQueryManager.getApplication(), loSystemDescription) === false)
	{
		return ltHierarchies;
	}
	var loServiceConfiguration = oFF.OlapApiModule.SERVICE_TYPE_HIERARCHY_CATALOG.createServiceConfig(loQueryManager.getApplication());
	loServiceConfiguration.setSystemName(loSystemDescription.getName());
	loServiceConfiguration.setDimension(loInternalDimension);
	if (sap.zen.DataSourceScriptApiUtils.isHanaSystem(loDataSource))
	{
		loServiceConfiguration.setDataSourceName(loQueryModel.getDataSource().getFullQualifiedName());
	}
	var loResultCatalogManagerCreation = loServiceConfiguration.processHierarchyCatalogManagerCreation(oFF.SyncType.BLOCKING, null, null);
	if (loResultCatalogManagerCreation.hasErrors())
	{
		return ltHierarchies;
	}
	var loHierarchyCatalogManager = loResultCatalogManagerCreation.getData();
	loHierarchyCatalogManager.setFilterHierarchyDate(loQueryModel.getCubeInfo().getDueDate(), true);
	var loResult = loHierarchyCatalogManager.processGetResult(oFF.SyncType.BLOCKING, null, null);
	if (loResult.hasErrors())
	{
		return ltHierarchies;
	}
	var loHierarchyCatalog = loResult.getData();
	ltHierarchies = oFF.HierarchyCatalogUtil.getHierarchyItems(loHierarchyCatalog);
	return ltHierarchies;
};
sap.zen.Dimension.prototype.getHierarchyObjectName = function(oHierarchy)
{
	if (oFF.isNull(oHierarchy))
	{
		return null;
	}
	var loDueDate = oHierarchy.getDateTo();
	if (oFF.isNull(loDueDate))
	{
		loDueDate = oFF.XDate.createDateWithValues(9999, 12, 31);
	}
	var lVersion = oHierarchy.getVersionName();
	if (oFF.isNull(lVersion))
	{
		lVersion = "";
	}
	var lName = oHierarchy.getHierarchyName();
	if (oFF.XString.containsString(lName, "/"))
	{
		lName = oFF.XString.replace(lName, "/", "\\\\\\\\/");
	}
	var lHierarchyName = lName;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(lVersion) || oFF.notNull(loDueDate))
	{
		lHierarchyName = oFF.XStringUtils.concatenate3(lHierarchyName, "/", lVersion);
	}
	if (oFF.notNull(loDueDate))
	{
		lHierarchyName = oFF.XStringUtils.concatenate3(lHierarchyName, "/", loDueDate.toIsoFormat());
	}
	return lHierarchyName;
};
