sap.zen.PageObject.prototype.getPropertyBag = function()
{
	var ltPropertyBag = oFF.XHashMapOfStringByString.create();
	if (oFF.notNull(this.moInitParameterNode))
	{
		var ltChildNodes = this.moInitParameterNode.getChildren("property");
		for (var lChildNodeIndex = 0; lChildNodeIndex < ltChildNodes.size(); lChildNodeIndex++)
		{
			var loChildNode = ltChildNodes.get(lChildNodeIndex);
			if (oFF.isNull(loChildNode))
			{
				continue;
			}
			var lName = loChildNode.getAttribute("name");
			var lValue = "";
			if (oFF.XString.startsWith(lName, "ON_") === true || oFF.XString.isEqual(lName, "ADDITIONAL_PROPERTIES"))
			{
				var loValueNode = loChildNode.getFirstChild("value");
				if (oFF.notNull(loValueNode))
				{
					lValue = loValueNode.getText();
				}
				else
				{
					lValue = "";
				}
			}
			else if (oFF.XString.isEqual(lName, "VISIBLE"))
			{
				lValue = loChildNode.getAttribute("value");
				lValue = this.convertAbapBool(lValue);
			}
			else if (oFF.XString.isEqual(lName, "ENABLED"))
			{
				lValue = loChildNode.getAttribute("value");
				lValue = this.convertAbapBool(lValue);
			}
			else if (oFF.XString.isEqual(lName, "AXES_SWAPPED"))
			{
				lValue = loChildNode.getAttribute("value");
				lValue = this.convertAbapBool(lValue);
			}
			else if (oFF.XString.isEqual(lName, "RESULTS_VISIBLE"))
			{
				lValue = loChildNode.getAttribute("value");
				lValue = this.convertAbapBool(lValue);
			}
			else
			{
				lValue = loChildNode.getAttribute("value");
			}
			ltPropertyBag.put(lName, lValue);
		}
	}
	return ltPropertyBag;
};
