sap.zen.PageObject.prototype.applyPrElementToXXmlNode = function(oElement, oPropertyNode)
{
	if (oFF.isNull(oElement) || oFF.isNull(oPropertyNode))
	{
		return;
	}
	var loJsonElementType = oElement.getType();
	if (loJsonElementType === oFF.PrElementType.STRUCTURE)
	{
		var loJsonStructure = oElement;
		var ltStructureElements = loJsonStructure.getKeysAsReadOnlyListOfString();
		var lValue = loJsonStructure.getStringByKey("__value__");
		if (oFF.notNull(lValue))
		{
			oPropertyNode.setAttribute("value", lValue);
		}
		for (var lStructureIndex = 0; lStructureIndex < ltStructureElements.size(); lStructureIndex++)
		{
			var lStructureElement = ltStructureElements.get(lStructureIndex);
			if (oFF.isNull(lStructureElement))
			{
				continue;
			}
			var loJsonElement = loJsonStructure.getByKey(lStructureElement);
			var loChildNode = oPropertyNode.getFirstChildWithNameTag(lStructureElement);
			if (oFF.isNull(loChildNode))
			{
				loChildNode = oPropertyNode.createChildWithNameTag(lStructureElement);
			}
			this.applyPrElementToXXmlNode(loJsonElement, loChildNode);
		}
	}
	else if (loJsonElementType === oFF.PrElementType.STRING)
	{
		var lPrString = oElement;
		oPropertyNode.setAttribute("value", lPrString.getString());
	}
	else
	{
		oPropertyNode.setAttribute("value", oElement.toString());
	}
};
