sap.zen.XpDSItemCell.createDSItemCell = function(oParent, columnIndex, oContentProvider)
{
	var loInstance = null;
	var lValid = false;
	if (oFF.notNull(oParent))
	{
		if (oParent.getDataSourceItem() === sap.zen.CXpDSItem.TECHNICAL_INFORMATION)
		{
			if (oFF.notNull(oContentProvider))
			{
				lValid = true;
			}
		}
		if (oParent.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
		{
			if (oFF.notNull(oContentProvider))
			{
				lValid = true;
			}
		}
		if (oParent.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
		{
			if (oFF.notNull(oContentProvider))
			{
				lValid = true;
			}
		}
		if (oParent.getDataSourceItem() === sap.zen.CXpDSItem.GRID)
		{
			if (oFF.notNull(oContentProvider))
			{
				lValid = true;
			}
		}
		if (lValid)
		{
			loInstance = new sap.zen.XpDSItemCell();
			loInstance.initDSItemCell(oParent, columnIndex, oContentProvider);
		}
	}
	return loInstance;
};
sap.zen.XpDSItemCell.prototype.moContentProvider = null;
sap.zen.XpDSItemCell.prototype.moInternalVariable = null;
sap.zen.XpDSItemCell.prototype.moDimension = null;
sap.zen.XpDSItemCell.prototype.initDSItemCell = function(oParent, columnIndex, oContentProvider)
{
	this.initDataCell(oParent, columnIndex);
	this.moContentProvider = oContentProvider;
	var loDataSource = this.getDataSource();
	var loResultSet = this.getResultSet();
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
	{
		this.moInternalVariable = this.moContentProvider;
		this.moContentProvider = sap.zen.VariableWrapper.createWrapper(loDataSource, this.moInternalVariable);
		if (this.moInternalVariable.getVariableType().isTypeOf(oFF.VariableType.DIMENSION_MEMBER_VARIABLE))
		{
			var loInternalDimensionVariable = this.moInternalVariable;
			this.moDimension = sap.zen.Dimension.createDimensionForInternalObject(loDataSource, loResultSet, loInternalDimensionVariable.getDimension());
		}
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.GRID)
	{
		this.moContentProvider = this.moContentProvider.getCell(this.getRowIndex(), this.getColumnIndex());
	}
};
