sap.zen.XpDSItemCell.prototype.getValueForFilter = function(formatted)
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES && this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS)
	{
		return null;
	}
	var loDimension = null;
	var loInternalVariable = null;
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
	{
		loInternalVariable = this.moInternalVariable;
		loDimension = this.moDimension;
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
	{
		loDimension = this.moContentProvider;
	}
	if (this.getColumnIndex() > 0)
	{
		var lUseKey = false;
		var lValueType = sap.zen.Dimension.VALUE_TYPE_EXT;
		var ltSelopts = this.getFilterValues();
		if (!this.isSeloptSingular(ltSelopts))
		{
			lValueType = sap.zen.Dimension.VALUE_TYPE_EXT + sap.zen.Dimension.VALUE_TYPE_TEXT;
		}
		else if (!formatted)
		{
			var lValueTypeFilter = this.getValueType();
			if (lValueTypeFilter.isTypeOf(oFF.XValueType.DATE) || lValueTypeFilter.isTypeOf(oFF.XValueType.TIME) || lValueTypeFilter.isTypeOf(oFF.XValueType.DATE_TIME))
			{
				lUseKey = true;
			}
		}
		var lValue = "";
		if (lUseKey)
		{
			if (oFF.notNull(ltSelopts) && ltSelopts.size() > 0)
			{
				lValue = ltSelopts.get(0).getFrom().getKey();
			}
		}
		else
		{
			lValue = sap.zen.Dimension.sGetValuesFromRangeList(ltSelopts, lValueType);
		}
		return lValue;
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
	{
		if (oFF.notNull(loInternalVariable))
		{
			if (loInternalVariable.getText() !== null)
			{
				return loInternalVariable.getText();
			}
			return loInternalVariable.getName();
		}
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
	{
		if (oFF.notNull(loDimension))
		{
			return loDimension.getFilterHeaderText();
		}
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.getValueTypeForTechInfo = function()
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.TECHNICAL_INFORMATION)
	{
		return null;
	}
	if (this.getColumnIndex() > 0)
	{
		var lTechInfo = this.moContentProvider;
		if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.CREATED_ON) || lTechInfo.containsAny(sap.zen.CXpDSTechInfo.CHANGED_ON) || lTechInfo.containsAny(sap.zen.CXpDSTechInfo.REFRESHED_ON) || lTechInfo.containsAny(sap.zen.CXpDSTechInfo.LAST_DATA_UPDATE))
		{
			return oFF.XValueType.DATE_TIME;
		}
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.getValueTypeForFilter = function()
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES && this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS)
	{
		return null;
	}
	var loDimension = null;
	var loInternalVariable = null;
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
	{
		loInternalVariable = this.moInternalVariable;
		loDimension = this.moDimension;
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
	{
		loDimension = this.moContentProvider;
	}
	if (this.getColumnIndex() > 0)
	{
		if (this.isSeloptSingular(this.getFilterValues()))
		{
			if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
			{
				if (oFF.notNull(loInternalVariable))
				{
					if (loInternalVariable.getVariableType() === oFF.VariableType.DIMENSION_MEMBER_VARIABLE)
					{
						var loDimensionMemberVariable = loInternalVariable;
						var loInternalDimension = loDimensionMemberVariable.getDimension();
						if (oFF.XStringUtils.isNullOrEmpty(loDimensionMemberVariable.getHierarchyName()) && oFF.XStringUtils.isNullOrEmpty(loInternalDimension.getHierarchyName()))
						{
							return loDimensionMemberVariable.getDimension().getFlatKeyField().getValueType();
						}
						return loDimensionMemberVariable.getDimension().getHierarchyKeyField().getValueType();
					}
					return loInternalVariable.getValueType();
				}
			}
			if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
			{
				if (oFF.notNull(loDimension))
				{
					return loDimension.getValueType();
				}
			}
		}
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.getFormatStringForTechInfo = function()
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.TECHNICAL_INFORMATION)
	{
		return null;
	}
	if (this.getColumnIndex() > 0)
	{
		var loDataSourceInfo = this.getDataSource().getInfo();
		var lInfo = null;
		var lTechInfo = this.moContentProvider;
		if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.QUERY_NAME))
		{
			lInfo = loDataSourceInfo.mQueryTechnicalName;
		}
		else if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.INFOPROVIDER_NAME))
		{
			lInfo = loDataSourceInfo.mInfoProviderTechnicalName;
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lInfo))
		{
			return oFF.XStringUtils.concatenate3("@ \"(", lInfo, ")\"");
		}
		if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.QUERY_DESCRIPTION))
		{
			lInfo = loDataSourceInfo.mQueryTechnicalName;
		}
		else if (lTechInfo.containsAny(sap.zen.CXpDSTechInfo.INFOPROVIDER_DESCRIPTION))
		{
			lInfo = loDataSourceInfo.mInfoProviderTechnicalName;
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lInfo))
		{
			return oFF.XStringUtils.concatenate3("@ \"[", lInfo, "]\"");
		}
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.getFormatStringForFilter = function()
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES && this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS)
	{
		return null;
	}
	if (this.getColumnIndex() > 0)
	{
		var ltSelopts = this.getFilterValues();
		if (this.isSeloptSingular(ltSelopts))
		{
			var lExternal = sap.zen.Dimension.sGetValuesFromRangeList(ltSelopts, sap.zen.Dimension.VALUE_TYPE_EXT);
			var lText = sap.zen.Dimension.sGetValuesFromRangeList(ltSelopts, sap.zen.Dimension.VALUE_TYPE_TEXT);
			if (this.getValueType().isString() && !oFF.XString.isEqual(lExternal, lText))
			{
				return oFF.XStringUtils.concatenate3("@ \"(", lText, ")\"");
			}
		}
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.getFilterValues = function()
{
	if (this.getDataSourceItem() !== sap.zen.CXpDSItem.VARIABLES && this.getDataSourceItem() !== sap.zen.CXpDSItem.FILTERS)
	{
		return null;
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.VARIABLES)
	{
		return this.moContentProvider.getAllSelections();
	}
	if (this.getDataSourceItem() === sap.zen.CXpDSItem.FILTERS)
	{
		return this.moContentProvider.getFilterValues();
	}
	return null;
};
sap.zen.XpDSItemCell.prototype.isSeloptSingular = function(tSelopts)
{
	if (tSelopts.size() === 1)
	{
		var loSelopt = tSelopts.get(0);
		if (loSelopt.getOperation() === sap.zen.Operation.EQ && !loSelopt.isExclude())
		{
			return true;
		}
	}
	return false;
};
sap.zen.XpDSItemCell.prototype.releaseObject = function()
{
	sap.zen.XpDataCell.prototype.releaseObject.call( this );
	this.moContentProvider = null;
	this.moInternalVariable = null;
	this.moDimension = null;
};

