sap.zen.HierarchyVariableWrapper.createCharacteristicWrapper2 = function(oDataSource, oInternalVariable, memberDisplay)
{
	var loInstance = null;
	if (oFF.notNull(oDataSource))
	{
		loInstance = new sap.zen.HierarchyVariableWrapper();
		loInstance.initMe3(oDataSource, oInternalVariable, memberDisplay);
	}
	return loInstance;
};
sap.zen.HierarchyVariableWrapper.createVariableWrapper2 = function(oDataSource, oInternalVariable)
{
	var loInstance = null;
	if (oFF.notNull(oDataSource))
	{
		loInstance = new sap.zen.HierarchyVariableWrapper();
		loInstance.initMe3(oDataSource, oInternalVariable, null);
		loInstance.moMemberCache = sap.zen.MemberCache.create(null, null);
	}
	return sap.zen.VariableWrapper.createVariableWrapper(loInstance);
};
sap.zen.HierarchyVariableWrapper.prototype.moInternalHierarchyNameVariable = null;
sap.zen.HierarchyVariableWrapper.prototype.initMe3 = function(oDataSource, oInternalVariable, memberDisplay)
{
	this.moInternalHierarchyNameVariable = oInternalVariable;
	sap.zen.CharacteristicMemberVariableWrapper.prototype.initMe2.call( this , oDataSource, oInternalVariable, memberDisplay);
	oFF.XHashMapOfStringByString.create();
};
sap.zen.HierarchyVariableWrapper.prototype.getMemberType = function()
{
	return sap.zen.Type.HIERARCHY;
};
sap.zen.HierarchyVariableWrapper.prototype.hasSelectionState = function()
{
	var loDimensionMember = this.moInternalHierarchyNameVariable.getDimensionMember();
	return oFF.notNull(loDimensionMember) && oFF.XStringUtils.isNotNullAndNotEmpty(loDimensionMember.getString());
};
sap.zen.HierarchyVariableWrapper.prototype.getSelectionStateMembers = function()
{
	var ltMemberWrapper = oFF.XList.create();
	var loDimensionMember = this.moInternalHierarchyNameVariable.getDimensionMember();
	if (oFF.notNull(loDimensionMember))
	{
		var lDimensionMemberStringValue = loDimensionMember.getString();
		if (oFF.XStringUtils.isNotNullAndNotEmpty(lDimensionMemberStringValue))
		{
			var loMemberWrapper = new sap.zen.HierarchyObjectWrapper();
			loMemberWrapper.initMe(lDimensionMemberStringValue, loDimensionMember.getText());
			ltMemberWrapper.add(loMemberWrapper);
		}
	}
	return ltMemberWrapper;
};
sap.zen.HierarchyVariableWrapper.prototype.resetQuery = function()
{
	this.moInternalHierarchyNameVariable.getMemberFilter().clear();
};
sap.zen.HierarchyVariableWrapper.prototype.setInternalKey = function(key)
{
	this.moInternalHierarchyNameVariable.setValueByString(key);
	return true;
};
sap.zen.HierarchyVariableWrapper.prototype.getInternalKey = function()
{
	var loDimensionMember = this.moInternalHierarchyNameVariable.getDimensionMember();
	if (oFF.isNull(loDimensionMember))
	{
		return "";
	}
	return loDimensionMember.getString();
};
sap.zen.HierarchyVariableWrapper.prototype.getAllSelections = function()
{
	var ltRanges = sap.zen.CharacteristicMemberVariableWrapper.prototype.getAllSelections.call( this );
	if (oFF.notNull(ltRanges) && ltRanges.size() === 1 && (oFF.XStringUtils.isNullOrEmpty(ltRanges.get(0).getKey()) || oFF.XString.isEqual("-", ltRanges.get(0).getKey())))
	{
		return oFF.XList.create();
	}
	return ltRanges;
};

