sap.zen.DataSource.prototype.createOlapQuery = function(dataSourceName, assignInitialView)
{
	var loDataSourceDefinitionNode = this.getTemplateDataSourceDefinitionNode(null);
	var loDataSourceInitialStateNode = this.getTemplateDataSourceInitialStateNode(loDataSourceDefinitionNode);
	var loDataSourceTypeNode = this.getTemplateDataSourceTypeNode(loDataSourceDefinitionNode);
	var lDataSourceType = this.getTemplateDataSourceType(loDataSourceTypeNode);
	var loDataSourceConnectionNode = this.getTemplateDataSourceConnectionNode(loDataSourceDefinitionNode);
	var lSystemName = this.getTemplateDataSourceConnectionSystemName(loDataSourceConnectionNode);
	if (oFF.XStringUtils.isNullOrEmpty(lSystemName))
	{
		sap.zen.CLocalizationDataSourceMessages.DATASRC_ERR_SYSTEM.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, this.getId(), null, null);
		return false;
	}
	if (oFF.XStringUtils.isNullOrEmpty(dataSourceName))
	{
		if (assignInitialView)
		{
			sap.zen.CLocalizationDataSourceMessages.DATASRC_ERR_LONG3.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, this.getName(), null, null);
		}
		return false;
	}
	var loServiceConfig = oFF.OlapApiModule.SERVICE_TYPE_QUERY_CONSUMER.createServiceConfig(this.getPage().getApplication());
	loServiceConfig.setSystemName(lSystemName);
	var loInternalDataSource = oFF.QDataSource.create();
	loServiceConfig.setDataSource(loInternalDataSource);
	loServiceConfig.setProviderType(oFF.ProviderType.ANALYTICS);
	if (sap.zen.DataSource.ACTIVATE_UNIFIED_DATA_CELLS === true)
	{
		loServiceConfig.getSession().activateFeatureToggle(oFF.FeatureToggleOlap.UNIFIED_DATACELLS);
	}
	loServiceConfig.getSession().activateFeatureToggle(oFF.FeatureToggleOlap.QDATA_CELL_MODEL_DEFAULTS);
	loServiceConfig.getSession().activateFeatureToggle(oFF.FeatureToggleOlap.UDH_ALIGNMENT);
	if (oFF.XStringUtils.isNullOrEmpty(this.getNavigationInitialState()) && oFF.isNull(loDataSourceInitialStateNode))
	{
		this.mMetaDataProvidedInResultSetRequest = true;
		loServiceConfig.setMakeEmptyVariableDefinitionInsteadOfMetadata(true);
	}
	var lFullqualifiedName = this.getFullqualifiedName(dataSourceName, true, lDataSourceType);
	loInternalDataSource.setFullQualifiedName(lFullqualifiedName);
	var lDataArea = this.getPage().getDataArea();
	if (oFF.notNull(lDataArea))
	{
		loInternalDataSource.setDataArea(lDataArea);
	}
	try
	{
		var lSyncType = oFF.SyncType.BLOCKING;
		if (this.getPage().isDataSourceInitializeMode())
		{
			lSyncType = oFF.SyncType.NON_BLOCKING;
		}
		if (this.getPage().isDataSourceInitializeMode())
		{
			this.getPage().increaseInitializedNumberDataSource();
		}
		var lAssignInitialView = oFF.XBooleanValue.create(assignInitialView);
		loServiceConfig.processQueryManagerCreation(lSyncType, this, lAssignInitialView);
	}
	catch (loException)
	{
		sap.zen.CLocalizationDataSourceMessages.DATASRC_ERR_PARAM.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, dataSourceName, null, null);
		return false;
	}
	return true;
};
