sap.zen.DataSource.prototype.onQueryManagerCreated = function(extResult, queryManager, customIdentifier)
{
	var lDoPageCallback = this.getPage().isDataSourceInitializeMode() && this.getPage().decreaseInitializedNumberDataSourceAndCheckForZero();
	if (extResult.hasErrors())
	{
		sap.zen.CLocalizationDataSourceMessages.DATASRC_ERR_LONG2.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, this.getName(), this.getDataSourceNameFromTemplate(), null);
	}
	this.getPage().createMessagesFromCollection(extResult);
	this.moQueryManager = extResult.getData();
	if (oFF.isNull(this.moQueryManager))
	{
		if (lDoPageCallback)
		{
			this.getPage().dataSourcesInitialized();
		}
		return;
	}
	var lAssignInitialView = customIdentifier.getBoolean();
	if (this.moQueryManager.supportsDirectVariableTransfer())
	{
		this.moQueryManager.setDirectVariableTransferEnabled(true);
	}
	if (this.moQueryManager.isDataEntryEnabled() && this.moQueryManager.supportsDataEntryReadOnly())
	{
		this.moQueryManager.setDataEntryReadOnly(true);
	}
	this.moQueryManager.getQueryModel().setExportFixedFilter(false);
	this.moQueryManager.getQueryModel().setOptimizedExportMode(true);
	if (this.moQueryManager.getServiceConfig().getMakeEmptyVariableDefinitionInsteadOfMetadata() && !this.hasNavigationParameters() && !sap.zen.VariablesUtils.requiresVariableDialog_DataSource(this))
	{
		this.submitVariables();
	}
	else
	{
		this.initDimensions(true, false);
	}
	lAssignInitialView = this.applyInAModelOrInitialState(lAssignInitialView, true);
	this.mIsLoaded = true;
	this.raiseDataSourceChangedEvent(null, true, true);
	if (lAssignInitialView)
	{
		if (this.moQueryManager.hasVariables())
		{
			if (this.getPage().isInVarSubmitOrBackgroundProcessingScript())
			{
				this.getPage().addVariableProcessorInQueue(this);
			}
			else
			{
				this.submitVariables();
			}
		}
	}
	if (lDoPageCallback)
	{
		this.getPage().dataSourcesInitialized();
	}
};
