sap.zen.DataSource.prototype.setNavigationAllowedSemanticSources = function(tAllowedSemanticSources)
{
	this.mtNavigationAllowedSemanticSources.clear();
	if (oFF.notNull(tAllowedSemanticSources))
	{
		var loIteratorAllowedSemenaticSource = tAllowedSemanticSources.getIterator();
		while (loIteratorAllowedSemenaticSource.hasNext())
		{
			var lAllowedSemanticSource = loIteratorAllowedSemenaticSource.next();
			if (oFF.isNull(lAllowedSemanticSource))
			{
				continue;
			}
			if (!this.mtNavigationAllowedSemanticSources.contains(lAllowedSemanticSource))
			{
				this.mtNavigationAllowedSemanticSources.add(lAllowedSemanticSource);
			}
		}
	}
};
sap.zen.DataSource.prototype.getNavigationAllowedSemanticSources = function()
{
	var ltNavigationAllowedSemanticSources = oFF.XListOfString.create();
	if (oFF.isNull(this.mtNavigationAllowedSemanticSources) || !this.mtNavigationAllowedSemanticSources.contains(sap.zen.CUrlParam.ALL_SEMANTIC_OBJECTS))
	{
		ltNavigationAllowedSemanticSources.addAll(this.mtNavigationAllowedSemanticSources);
	}
	else
	{
		var ltNavigationSemanticSources = this.getNavigationSemanticSources();
		ltNavigationAllowedSemanticSources.addAll(ltNavigationSemanticSources);
		ltNavigationAllowedSemanticSources.addAll(this.mtNavigationAllowedSemanticSources);
		ltNavigationAllowedSemanticSources.removeElement(sap.zen.CUrlParam.ALL_SEMANTIC_OBJECTS);
	}
	return ltNavigationAllowedSemanticSources;
};
sap.zen.DataSource.prototype.setNavigationSemanticMappings = function(tNavigationSemanticMappings)
{
	this.mtNavigationSemanticMappingsIntToExt.clear();
	this.mtNavigationSemanticMappingsExtToInt.clear();
	if (oFF.notNull(tNavigationSemanticMappings))
	{
		var loNavigationSemanticMappingsIterator = tNavigationSemanticMappings.getKeysAsIteratorOfString();
		while (loNavigationSemanticMappingsIterator.hasNext())
		{
			var lInternalName = loNavigationSemanticMappingsIterator.next();
			if (oFF.isNull(lInternalName))
			{
				continue;
			}
			var lExternalName = tNavigationSemanticMappings.getByKey(lInternalName);
			if (oFF.XStringUtils.isNullOrEmpty(lExternalName))
			{
				continue;
			}
			this.mtNavigationSemanticMappingsIntToExt.put(lInternalName, lExternalName);
			this.mtNavigationSemanticMappingsExtToInt.put(lExternalName, lInternalName);
		}
	}
};
sap.zen.DataSource.prototype.useNavigationSemanticMappings = function()
{
	var lUseNavigationSemanticMappings = oFF.notNull(this.mtNavigationSemanticMappingsIntToExt) && !this.mtNavigationSemanticMappingsIntToExt.isEmpty();
	return lUseNavigationSemanticMappings;
};
