sap.zen.DataSource.prototype.getNavigationFilterContext = function()
{
	var loDimension = null;
	var lDimensionName = null;
	var ltFilters = null;
	var ltFixedFiltersPerDimension = oFF.XHashMapByString.create();
	var ltFiltersPerDimension = oFF.XHashMapByString.create();
	var loContext = oFF.XPair.create(ltFixedFiltersPerDimension, ltFiltersPerDimension);
	var ltDimensions = this.getAllDimensions(false);
	if (oFF.notNull(ltDimensions) && !ltDimensions.isEmpty())
	{
		var loDimensionsIterator = ltDimensions.getIterator();
		while (loDimensionsIterator.hasNext())
		{
			loDimension = loDimensionsIterator.next();
			if (oFF.isNull(loDimension))
			{
				continue;
			}
			if (!loDimension.isMeasureStructure())
			{
				var loCharacteristicWrapper = sap.zen.CharacteristicWrapper.create(this, loDimension.getInternalObject(), null, null, sap.zen.CMemberDisplayMode.KEY_TEXT, false);
				lDimensionName = loDimension.getNavigationName();
				if (!ltFixedFiltersPerDimension.containsKey(lDimensionName))
				{
					ltFilters = loCharacteristicWrapper.getAllFixedSelections();
					if (oFF.notNull(ltFilters) && ltFilters.size() > 0)
					{
						ltFixedFiltersPerDimension.put(lDimensionName, ltFilters);
					}
				}
				if (!ltFiltersPerDimension.containsKey(lDimensionName))
				{
					ltFilters = loCharacteristicWrapper.getAllSelections();
					if (oFF.notNull(ltFilters) && ltFilters.size() > 0)
					{
						ltFiltersPerDimension.put(lDimensionName, ltFilters);
					}
				}
			}
		}
	}
	var loVariableProcessor = this.getVariableProcessor();
	if (oFF.notNull(loVariableProcessor) && loVariableProcessor.hasVariables())
	{
		var ltVariables = loVariableProcessor.getVariables();
		var loVariableIterator = ltVariables.getIterator();
		while (loVariableIterator.hasNext())
		{
			var loVariable = loVariableIterator.next();
			if (oFF.isNull(loVariable))
			{
				continue;
			}
			var lVariableType = loVariable.getVariableType();
			if (lVariableType === oFF.VariableType.DIMENSION_MEMBER_VARIABLE || lVariableType === oFF.VariableType.HIERARCHY_NODE_VARIABLE)
			{
				var loDimensionMemberVariable = loVariable;
				loDimension = sap.zen.Dimension.sGetDimension(this, loDimensionMemberVariable.getDimension().getName());
				if (oFF.isNull(loDimension))
				{
					continue;
				}
				if (!loDimension.isMeasureStructure())
				{
					var loVariableWrapper = sap.zen.CharacteristicMemberVariableWrapper.createVariableWrapper(this, loDimensionMemberVariable);
					lDimensionName = loDimension.getNavigationName();
					ltFilters = loVariableWrapper.getAllSelections();
					if (oFF.notNull(ltFilters) && ltFilters.size() > 0)
					{
						ltFixedFiltersPerDimension.put(lDimensionName, ltFilters);
					}
				}
			}
		}
	}
	return loContext;
};
sap.zen.DataSource.prototype.renderJumpToVariableFilterContext = function(oRenderSerializer)
{
	var loFilterContext = this.getNavigationFilterContext();
	var ltFixedFiltersPerDimension = loFilterContext.getFirstObject();
	var ltFiltersPerDimension = loFilterContext.getSecondObject();
	if (!ltFixedFiltersPerDimension.isEmpty())
	{
		oRenderSerializer.openArray("variables");
		this.renderJumpToSelectorContext(oRenderSerializer, ltFixedFiltersPerDimension);
		oRenderSerializer.closeArray();
	}
	if (!ltFiltersPerDimension.isEmpty())
	{
		oRenderSerializer.openArray("filter");
		this.renderJumpToSelectorContext(oRenderSerializer, ltFiltersPerDimension);
		oRenderSerializer.closeArray();
	}
};
sap.zen.DataSource.prototype.renderJumpToSelectorContext = function(oRenderSerializer, tDimensionSelections)
{
	var loDimensionNameIterator = tDimensionSelections.getKeysAsIteratorOfString();
	while (loDimensionNameIterator.hasNext())
	{
		var lDimensionName = loDimensionNameIterator.next();
		oRenderSerializer.openTag("dimension");
		oRenderSerializer.addAttribute("name", lDimensionName);
		oRenderSerializer.openArray("selections");
		var loSelectionIterator = tDimensionSelections.getByKey(lDimensionName).getIterator();
		while (loSelectionIterator.hasNext())
		{
			var loSelection = loSelectionIterator.next();
			var lHighString = null;
			oRenderSerializer.openJsonTag();
			if (!loSelection.isExclude())
			{
				oRenderSerializer.addAttribute("Sign", "I");
			}
			else
			{
				oRenderSerializer.addAttribute("Sign", "E");
			}
			var lComparisonOperator = loSelection.getOperation();
			var loMemberLow = loSelection.getFrom();
			oRenderSerializer.addAttribute("Low", loMemberLow.getExternalKey(this.moResultSet.getDataSource()));
			oRenderSerializer.addAttribute("LowType", loMemberLow.getType().toString());
			oRenderSerializer.addAttribute("Option", lComparisonOperator.convertToSAPType());
			if (lComparisonOperator === sap.zen.Operation.BT)
			{
				var loMemberHigh = loSelection.getTo();
				if (oFF.notNull(loMemberHigh))
				{
					lHighString = loMemberHigh.getExternalKey(this.moResultSet.getDataSource());
				}
				if (oFF.notNull(lHighString))
				{
					oRenderSerializer.addAttribute("High", lHighString);
					if (oFF.notNull(loMemberHigh))
					{
						oRenderSerializer.addAttribute("HighType", loMemberHigh.getType().toString());
					}
				}
				else
				{
					oRenderSerializer.addNullAttribute("High");
				}
			}
			oRenderSerializer.closeJsonTag();
		}
		oRenderSerializer.closeArray();
		oRenderSerializer.closeTag();
	}
};
