sap.zen.DataSource.prototype.getFullqualifiedName = function(name, setViewAndPackage, dataSourceType)
{
	var lName = name;
	if (oFF.isNull(lName))
	{
		if (setViewAndPackage)
		{
			this.mPackageName = null;
		}
		return null;
	}
	var lSystemName = this.getTemplateDataSourceConnectionSystemName(null);
	if (!this.getPage().isBWSystem(lSystemName))
	{
		lName = this.getHanaViewSpec(lName, setViewAndPackage);
	}
	else
	{
		if (oFF.XString.isEqual(dataSourceType, "INFOPROVIDER"))
		{
			lName = oFF.XStringUtils.concatenate3("infoprovider:[", lName, "]");
		}
		else if (oFF.XString.isEqual(dataSourceType, "QUERY"))
		{
			lName = oFF.XStringUtils.concatenate3("query:[", lName, "]");
		}
		else if (oFF.XString.isEqual(dataSourceType, "VIEW"))
		{
			lName = oFF.XStringUtils.concatenate3("view:[", lName, "]");
		}
		if (setViewAndPackage)
		{
			this.mPackageName = "";
		}
	}
	return lName;
};
sap.zen.DataSource.prototype.getHanaViewSpec = function(name, setViewAndPackage)
{
	var lName = name;
	var ltNameSplit = oFF.XStringTokenizer.splitString(lName, "/");
	var lNameCount = ltNameSplit.size();
	var lHanaViewName = "";
	var lSchemaName = null;
	var lType = null;
	var lPackagePos = 0;
	var lPos = 0;
	if (lNameCount > 2)
	{
		lType = ltNameSplit.get(0);
		lSchemaName = ltNameSplit.get(1);
		lPackagePos = 2;
		lHanaViewName = oFF.XStringUtils.concatenate2(lType, ":");
		lHanaViewName = oFF.XStringUtils.concatenate4(lHanaViewName, "[", lSchemaName, "]");
		lPos = oFF.XString.indexOf(lName, "/");
		lName = oFF.XString.substring(lName, lPos + 1, -1);
		lPos = oFF.XString.indexOf(lName, "/");
		lName = oFF.XString.substring(lName, lPos + 1, -1);
	}
	else
	{
		lHanaViewName = "view:";
	}
	var lPackageName = ltNameSplit.get(lPackagePos);
	lHanaViewName = oFF.XStringUtils.concatenate3(lHanaViewName, "[", lPackageName);
	if (setViewAndPackage)
	{
		this.mPackageName = lPackageName;
	}
	lHanaViewName = oFF.XStringUtils.concatenate2(lHanaViewName, "][");
	lPos = oFF.XString.indexOf(lName, "/");
	var lViewName = oFF.XString.substring(lName, lPos + 1, -1);
	lHanaViewName = oFF.XStringUtils.concatenate2(lHanaViewName, lViewName);
	lHanaViewName = oFF.XStringUtils.concatenate2(lHanaViewName, "]");
	return lHanaViewName;
};
sap.zen.DataSource.prototype.getHanaViewSpec2 = function(name, setViewAndPackage)
{
	var lName = name;
	var ltNameSplit = oFF.XStringTokenizer.splitString(lName, "/");
	var packageName = ltNameSplit.get(0);
	lName = oFF.XStringUtils.concatenate2("view:[][", packageName);
	if (setViewAndPackage)
	{
		this.mPackageName = packageName;
	}
	lName = oFF.XStringUtils.concatenate2(lName, "][");
	var lViewName = "";
	lViewName = ltNameSplit.get(1);
	lName = oFF.XStringUtils.concatenate2(lName, lViewName);
	lName = oFF.XStringUtils.concatenate2(lName, "]");
	return lName;
};
sap.zen.DataSource.prototype.getDataCell = function(measureName, oJsonObject)
{
	var ltJson = oJsonObject.getJSON();
	var loQueryManager = this.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return null;
	}
	sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(), loQueryManager, "DataSource getDataCell");
	var loResultSet = this.getResultSet();
	if (oFF.isNull(loResultSet) || !loResultSet.isValid())
	{
		var loMessages = loQueryManager.getResultSetMessages();
		this.getPage().createMessagesFromCollection(loMessages);
		return null;
	}
	var lDataRows = loResultSet.getAmountOfDataRows();
	var lDataCols = loResultSet.getAmountOfDataColumns();
	var lUseCol = this.getCorrectPositionOnAxis(measureName, ltJson, oFF.AxisType.COLUMNS, lDataCols);
	var lUseRow = this.getCorrectPositionOnAxis(measureName, ltJson, oFF.AxisType.ROWS, lDataRows);
	if (lUseCol === -1 || lUseRow === -1)
	{
		sap.zen.CLocalizationDataSourceMessages.CELL_NOT_FOUND.addMessageToMessageHandler(this.getPage(), oFF.Severity.INFO, null, null, null);
		return null;
	}
	var loResultDataCell = loResultSet.getResultDataCell(lUseRow, lUseCol);
	return loResultDataCell;
};
sap.zen.DataSource.prototype.getCorrectPositionOnAxis = function(measureName, tJson, axis, rowCount)
{
	var loResultSet = this.getResultSet();
	var loResultSetInfo = null;
	var j = 0;
	var lUseRow = -1;
	for (j = 0; j < rowCount; j++)
	{
		if (loResultSet.getAmountOfTuplesOnAxis(axis) > 0)
		{
			loResultSetInfo = sap.zen.ResultSetHelper.create(loResultSet, axis, j, 0);
			var loTuple = loResultSetInfo.getTuple();
			var q = 0;
			var itAllFits = true;
			var numberOfFits = 0;
			var lUnderspecified = false;
			var lResultWasFound = false;
			var lMeasureWasFound = false;
			while (q < loTuple.getAmountOfTupleElements())
			{
				var loTupleElement = loTuple.getTupleElement(q, null);
				var loDimensionMember = loTupleElement.getDimensionMember();
				var loDimension = loTupleElement.getDimension();
				if (loDimension.isMeasureStructure())
				{
					if (!oFF.XString.isEqual(loDimensionMember.getName(), measureName))
					{
						itAllFits = false;
					}
					else
					{
						lMeasureWasFound = true;
						lMeasureWasFound = true && lMeasureWasFound;
						if (loTuple.getAmountOfTupleElements() === 1)
						{
							return j;
						}
					}
				}
				else
				{
					var memberName = tJson.getByKey(loDimension.getName());
					var cnt = loResultSet.getAmountOfTuplesOnAxis(loResultSetInfo.getAxis());
					if (tJson.size() < cnt)
					{
						lUnderspecified = true;
						if (tJson.containsKey(loDimension.getName()) && oFF.XString.isEqual(memberName, loDimensionMember.getName()))
						{
							numberOfFits = numberOfFits + 1;
						}
						else
						{
							if (loResultSetInfo.isTotal() || loDimensionMember.isTotal())
							{
								lResultWasFound = true;
								lResultWasFound = true && lResultWasFound;
							}
							else
							{
								itAllFits = false;
								lResultWasFound = false;
								lResultWasFound = true && lResultWasFound;
							}
						}
					}
					else
					{
						if (tJson.containsKey(loDimension.getName()) && oFF.XString.isEqual(memberName, loDimensionMember.getName()))
						{
							numberOfFits = numberOfFits + 1;
						}
						else
						{
							itAllFits = false;
						}
					}
				}
				q = q + 1;
			}
			var timesItShouldHaveBeenFound = tJson.size();
			if (!lUnderspecified && itAllFits)
			{
				lUseRow = j;
				break;
			}
			else if (lUnderspecified && itAllFits && numberOfFits === timesItShouldHaveBeenFound)
			{
				lUseRow = j;
				break;
			}
		}
		else
		{
			return 0;
		}
	}
	return lUseRow;
};
sap.zen.DataSource.prototype.getDataAsString = function(measureName, json)
{
	var lFormattedValue = "";
	var loResultDataCell = this.getDataInternal(measureName, json);
	if (oFF.notNull(loResultDataCell))
	{
		lFormattedValue = loResultDataCell.getFormattedValue();
		var lValueException = loResultDataCell.getValueException();
		if (oFF.isNull(lValueException) || lValueException === oFF.ValueException.NORMAL)
		{
			lFormattedValue = loResultDataCell.getFormattedValue();
			var lDouble = 0.0;
			if (oFF.XString.startsWith(lFormattedValue, ".") || oFF.XString.startsWith(lFormattedValue, ","))
			{
				lDouble = loResultDataCell.getDoubleValue();
				lFormattedValue = sap.buddha.XMathZen.roundDouble(lDouble);
			}
			else if (oFF.XString.isEqual("0", lFormattedValue))
			{
				lDouble = loResultDataCell.getDoubleValue();
				lFormattedValue = oFF.XDoubleValue.create(lDouble).toString();
			}
		}
	}
	return lFormattedValue;
};
