sap.zen.DataSource.prototype.getMembers = function(dimensionName, maxNumber)
{
	sap.zen.VariablesUtils.submitVariables_DataSource(this);
	var lMaxNumber = maxNumber;
	if (lMaxNumber < 1)
	{
		lMaxNumber = 50;
	}
	var loDimension = sap.zen.Dimension.sGetDimension(this, dimensionName);
	var ltMembers = loDimension.getDimensionMembers(lMaxNumber);
	var ltResult = oFF.XList.create();
	if (oFF.notNull(ltMembers) && !ltMembers.isEmpty())
	{
		var loMemberIterator = ltMembers.getIterator();
		while (loMemberIterator.hasNext())
		{
			var loDimensionMember = loMemberIterator.next();
			if (oFF.isNull(loDimensionMember))
			{
				continue;
			}
			var loScriptableMember = sap.zen.ScriptableMember.createForDimensionMember(loDimensionMember);
			ltResult.add(loScriptableMember);
		}
	}
	return this.getPage().getWindow().createJSArray(ltResult);
};
