sap.zen.DataSource.prototype.setMeasureFilter = function(oMeasureDimension, oObject)
{
	var lValue = null;
	var loJsonObject = sap.buddha.XJsonObject.create(oObject);
	if (loJsonObject.isString() || loJsonObject.isScriptableMember())
	{
		lValue = loJsonObject.getString();
		var ltStructureMembers = oMeasureDimension.getAllStructureMembers();
		var ltWriteableStructureMembers = ltStructureMembers;
		var loStructureMember = ltWriteableStructureMembers.getByKey(lValue);
		if (oFF.notNull(loStructureMember))
		{
			ltWriteableStructureMembers.clear();
			ltWriteableStructureMembers.add(loStructureMember);
		}
	}
	else if (loJsonObject.isArray())
	{
		var loJsonArray = loJsonObject.getArray();
		var lJsonArraySize = loJsonArray.size();
		for (var lIndex = 0; lIndex < lJsonArraySize; lIndex++)
		{
			var loJsonArrayObject = loJsonArray.get(lIndex);
			if (oFF.isNull(loJsonArrayObject))
			{
				continue;
			}
			lValue = loJsonArrayObject.getString();
		}
	}
};
