sap.zen.DataSource.prototype.clearAllFilterRelevantVariables = function()
{
	var loVariableProcessor = this.getVariableProcessor();
	if (oFF.notNull(loVariableProcessor))
	{
		var ltInputEnabledVariables = loVariableProcessor.getInputEnabledVariables();
		if (oFF.notNull(ltInputEnabledVariables) && !ltInputEnabledVariables.isEmpty())
		{
			var loVariableIterator = ltInputEnabledVariables.getIterator();
			while (loVariableIterator.hasNext())
			{
				var loVariable = loVariableIterator.next();
				if (oFF.isNull(loVariable))
				{
					continue;
				}
				if (!loVariable.isMandatory() && loVariable.getVariableType().isTypeOf(oFF.VariableType.DIMENSION_MEMBER_VARIABLE))
				{
					loVariable.getMemberFilter().clear();
				}
			}
		}
		this.raiseDataSourceChangedEvent(null, true, false);
		if (this.getPage().isInVarSubmitOrBackgroundProcessingScript())
		{
			this.getPage().addVariableProcessorInQueue(this);
		}
	}
	this.getPage().invalidateDataSourcesReasonVariablesChange();
};
