sap.zen.DataSource.prototype.expandNode = function(dimensionName, memberKeyOrMemberOrJSON)
{
	var loJsonObject = sap.buddha.XJsonObject.create(memberKeyOrMemberOrJSON);
	var loDimension = sap.zen.Dimension.sGetDimension(this, dimensionName);
	var lMemberName = null;
	if (loJsonObject.isString())
	{
		lMemberName = loJsonObject.getString();
		sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(), this.getQueryManager(), "DataSource expandNode");
		loDimension.expandCollapseHierarchyNode(lMemberName, oFF.DrillState.EXPANDED, true);
	}
	else if (loJsonObject.isArray())
	{
		var loJsonArray = loJsonObject.getArray();
		var lJsonArraySize = loJsonArray.size();
		for (var lArrayIndex = 0; lArrayIndex < lJsonArraySize; lArrayIndex++)
		{
			var loJsonArrayObject = loJsonArray.get(lArrayIndex);
			if (oFF.isNull(loJsonArrayObject))
			{
				continue;
			}
			lMemberName = loJsonArrayObject.getString();
		}
	}
};
