sap.zen.DataSource.prototype.isResultSetEmpty = function()
{
	var loQueryManager = this.getQueryManager();
	if (!this.mIsLoaded || oFF.isNull(loQueryManager))
	{
		return true;
	}
	sap.zen.VariablesUtils.submitVariables_DataSource(this);
	var lReturnValue = false;
	sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(), loQueryManager, "DataSource isResultSetEmpty");
	var loResultSet = this.getResultSet();
	if (oFF.notNull(loResultSet))
	{
		return !loResultSet.hasDataCells();
	}
	return lReturnValue;
};
