sap.zen.DataSource.prototype.getTotalsDisplay = function(dimensionName)
{
	var loDimension = sap.zen.Dimension.sGetDimension(this, dimensionName);
	var lResultVisibility = loDimension.getProperties().getTotalsDisplay();
	if (oFF.ResultVisibility.HIDDEN.isEqualTo(lResultVisibility))
	{
		return sap.zen.TotalsDisplay.HIDE;
	}
	else if (oFF.ResultVisibility.VISIBLE.isEqualTo(lResultVisibility))
	{
		return sap.zen.TotalsDisplay.SHOW;
	}
	else if (oFF.ResultVisibility.CONDITIONAL.isEqualTo(lResultVisibility))
	{
		return sap.zen.TotalsDisplay.HIDE_IF_ONLY_ONE_MEMBER;
	}
	return "";
};
sap.zen.DataSource.prototype.setTotalsPosition = function(axis, totalsPosition)
{
	var loQueryManager = this.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return;
	}
	var loAxis = sap.zen.DataSourceScriptApiUtils.getAxis(loQueryModel, axis);
	if (oFF.isNull(loAxis))
	{
		return;
	}
	sap.zen.Dimension.sSetTotalsPositionForAxis(this, loAxis.getType(), totalsPosition, true);
};
sap.zen.DataSource.prototype.getTotalsPosition = function(axis)
{
	var loQueryManager = this.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return null;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return null;
	}
	var loAxis = sap.zen.DataSourceScriptApiUtils.getAxis(loQueryModel, axis);
	if (oFF.isNull(loAxis))
	{
		return null;
	}
	var lResultAlignment = sap.zen.Dimension.sGetTotalsPositionForAxis(this, loAxis.getType());
	if (oFF.ResultAlignment.TOP.isEqualTo(lResultAlignment))
	{
		return sap.zen.TotalsPosition.getBEFOREInternal();
	}
	else if (oFF.ResultAlignment.BOTTOM.isEqualTo(lResultAlignment))
	{
		return sap.zen.TotalsPosition.getAFTERInternal();
	}
	else if (oFF.ResultAlignment.NONE.isEqualTo(lResultAlignment))
	{
		return sap.zen.TotalsPosition.getDEFAULTInternal();
	}
	return sap.zen.TotalsPosition.getDEFAULTInternal();
};
sap.zen.DataSource.prototype.setFilterByRectangle = function(dimension, x0, y0, x1, y1)
{
	this.getQueryManager().invalidateState();
	var agg = oFF.PrStructure.create();
	var loJsonFixedFilter = agg.putNewStructure("FixedFilter");
	var loJsonSelection = loJsonFixedFilter.putNewStructure("Selection");
	var loJsonOperand = loJsonSelection.putNewStructure("GeometryOperand");
	var s = oFF.XStringUtils.concatenate3(oFF.XDouble.convertToString(y0), " ", oFF.XDouble.convertToString(x0));
	s = oFF.XStringUtils.concatenate2(s, ", ");
	s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y0), " ", oFF.XDouble.convertToString(x1));
	s = oFF.XStringUtils.concatenate2(s, ", ");
	s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y1), " ", oFF.XDouble.convertToString(x1));
	s = oFF.XStringUtils.concatenate2(s, ", ");
	s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y1), " ", oFF.XDouble.convertToString(x0));
	s = oFF.XStringUtils.concatenate2(s, ", ");
	s = oFF.XStringUtils.concatenate4(s, oFF.XDouble.convertToString(y0), " ", oFF.XDouble.convertToString(x0));
	loJsonOperand.putString("Comparison", "WITHIN");
	loJsonOperand.putString("AttributeName", dimension);
	loJsonOperand.putString("Value", oFF.XStringUtils.concatenate3("POLYGON(( ", s, "))"));
	this.raiseDataSourceChangedEvent(null, false, true);
};
