sap.zen.DataSource.prototype.releaseObject = function()
{
	if (oFF.notNull(this.mtNavigationAllowedSemanticSources))
	{
		oFF.XObjectExt.release(this.mtNavigationAllowedSemanticSources);
		this.mtNavigationAllowedSemanticSources = null;
	}
	if (oFF.notNull(this.mtNavigationSemanticSources))
	{
		oFF.XObjectExt.release(this.mtNavigationSemanticSources);
		this.mtNavigationSemanticSources = null;
	}
	if (oFF.notNull(this.mtNavigationSemanticMappingsIntToExt))
	{
		oFF.XObjectExt.release(this.mtNavigationSemanticMappingsIntToExt);
		this.mtNavigationSemanticMappingsIntToExt = null;
	}
	if (oFF.notNull(this.mtNavigationSemanticMappingsExtToInt))
	{
		oFF.XObjectExt.release(this.mtNavigationSemanticMappingsExtToInt);
		this.mtNavigationSemanticMappingsExtToInt = null;
	}
	if (oFF.notNull(this.mtNavigationMapIntToExt))
	{
		oFF.XObjectExt.release(this.mtNavigationMapIntToExt);
		this.mtNavigationMapIntToExt = null;
	}
	if (oFF.notNull(this.mtNavigationMapExtToInt))
	{
		oFF.XObjectExt.release(this.mtNavigationMapExtToInt);
		this.mtNavigationMapExtToInt = null;
	}
	if (oFF.notNull(this.mtNavigationParameters))
	{
		oFF.XObjectExt.release(this.mtNavigationParameters);
		this.mtNavigationParameters = null;
	}
	if (oFF.notNull(this.mtNavigationParameterRules))
	{
		oFF.XObjectExt.release(this.mtNavigationParameterRules);
		this.mtNavigationParameterRules = null;
	}
	if (oFF.notNull(this.mtDataLimits))
	{
		oFF.XObjectExt.release(this.mtDataLimits);
		this.mtDataLimits = null;
	}
	if (oFF.notNull(this.mtResultSetConfigProviders))
	{
		oFF.XObjectExt.release(this.mtResultSetConfigProviders);
		this.mtResultSetConfigProviders = null;
	}
	if (oFF.notNull(this.mtErrors))
	{
		oFF.XObjectExt.release(this.mtErrors);
		this.mtErrors = null;
	}
	this.mMetaDataProvidedInResultSetRequest = false;
	this.mPackageName = null;
	this.mIsLoaded = false;
	this.mDataSourceChanged = false;
	this.mProcessResultSetChangedScript = false;
	this.mSyncState = null;
	if (oFF.notNull(this.mtListeners))
	{
		oFF.XObjectExt.release(this.mtListeners);
		this.mtListeners = null;
	}
	if (oFF.notNull(this.moResultSet))
	{
		oFF.XObjectExt.release(this.moResultSet);
		this.moResultSet = null;
	}
	if (oFF.notNull(this.moConditionsDialog))
	{
		oFF.XObjectExt.release(this.moConditionsDialog);
		this.moConditionsDialog = null;
	}
	sap.zen.Dimension.sReleaseDimensions(this);
	if (oFF.notNull(this.moQueryManager))
	{
		oFF.XObjectExt.release(this.moQueryManager);
		this.moQueryManager = null;
	}
	sap.zen.PageObject.prototype.releaseObject.call( this );
};

