sap.zen.Component.prototype.renderComponentInternal = function(oRenderManager)
{
	if (!this.isVisible() && !this.renderEvenIfNotVisible())
	{
		this.resetStateFlags();
		return;
	}
	if (!this.shouldRender())
	{
		this.resetStateFlags();
		return;
	}
	if (this.isContentChanged())
	{
		this.renderComponentPropertiesAndContent(oRenderManager, oRenderManager.getRenderSerializer());
	}
	else if (this.hasChildrenContentChanged())
	{
		this.renderChildren(oRenderManager);
	}
	else if (this.isOnlyPositionParameterChanged())
	{
		this.renderComponentAndCommonAttributes(oRenderManager.getRenderSerializer(), true);
	}
	else if (this.isRenderOnlyPlaceholder())
	{
		this.renderOnlyPlaceholder(oRenderManager);
	}
	this.resetStateFlags();
};
