sap.zen.Component.prototype.applyInitParameters = function(initParameter)
{
	var oldInitParameters = this.getInitParameters();
	var allChildren = oldInitParameters.getAllChildren();
	for (var i = 0; i < allChildren.size(); i++)
	{
		var xmlNode = allChildren.get(i);
		var nodeName = xmlNode.getNodeName();
		if (!oFF.XString.isEqual(nodeName, "bi:component"))
		{
			oldInitParameters.removeChild(xmlNode);
		}
	}
	var newChildren = initParameter.getAllChildren();
	for (var j = 0; j < newChildren.size(); j++)
	{
		var newChild = newChildren.get(j);
		oldInitParameters.appendChild(newChild);
	}
	this.setContentChanged(true);
	this.clearPropertyCache();
};
sap.zen.Component.prototype.applyGlobalVariableInitParameters = function(initParameter)
{
	var oldInitParameters = this.getInitParameters();
	var oldInitParametersChildren = this.getInitParameters().getAllChildren();
	for (var i = 0; i < oldInitParametersChildren.size(); i++)
	{
		var xmlNode = oldInitParametersChildren.get(i);
		if (oFF.XString.isEqual(xmlNode.getNodeName(), "bi:property"))
		{
			if (oFF.XString.isEqual(xmlNode.getAttribute("name"), "GLOBALVARIABLES"))
			{
				oldInitParameters.removeChild(xmlNode);
			}
		}
	}
	var newInitParametersChildren = initParameter.getAllChildren();
	for (var j = 0; j < newInitParametersChildren.size(); j++)
	{
		var newChild = newInitParametersChildren.get(j);
		if (oFF.XString.isEqual(newChild.getNodeName(), "bi:property"))
		{
			if (oFF.XString.isEqual(newChild.getAttribute("name"), "GLOBALVARIABLES"))
			{
				oldInitParameters.appendChild(newChild);
			}
		}
	}
	this.setContentChanged(true);
	this.clearPropertyCache();
};
