sap.zen.Page.sGetDshUrlParameters = function(oParameters)
{
	var ltUrlParams = oFF.XListOfString.create();
	ltUrlParams.add("appName");
	ltUrlParams.add("sap-ushell-defaultedParameterNames");
	if (oFF.notNull(oParameters))
	{
		var loParameterValueAsString = oParameters.getByKey("sap-ushell-defaultedParameterNames");
		if (oFF.notNull(loParameterValueAsString))
		{
			var loParameterValue = sap.zen.Page.sConvertJsonStringToJsonObject(loParameterValueAsString.asString().getString());
			if (oFF.notNull(loParameterValue) && loParameterValue.isList())
			{
				var loList = loParameterValue.asList();
				for (var lListIndex = 0; lListIndex < loList.size(); lListIndex++)
				{
					var loElement = loList.get(lListIndex);
					if (oFF.isNull(loElement))
					{
						continue;
					}
					if (loElement.isString())
					{
						if (!ltUrlParams.contains(loElement.asString().getString()))
						{
							ltUrlParams.add(loElement.asString().getString());
						}
					}
				}
			}
		}
	}
	var ltKnownUrlParams = sap.zen.CUrlParam.sGetUrlParams();
	ltUrlParams.addAll(ltKnownUrlParams);
	return ltUrlParams;
};
