sap.zen.Page.prototype.destroyComponent = function(targetItem)
{
	if (oFF.isNull(this.mtComponents))
	{
		return;
	}
	var loComponentToDestroy = this.mtComponents.getByKey(targetItem);
	if (oFF.isNull(loComponentToDestroy))
	{
		return;
	}
	var loParentComponent = loComponentToDestroy.getParent();
	if (oFF.notNull(loParentComponent))
	{
		loParentComponent.removeChild(loComponentToDestroy);
		loParentComponent.setContentChanged(true);
	}
	loComponentToDestroy.releaseObject();
	this.mtComponents.remove(targetItem);
};
