sap.zen.Page.prototype.addDialog = function(oDialog)
{
	if (oFF.isNull(oDialog))
	{
		return;
	}
	if (this.mtDialogs.contains(oDialog))
	{
		return;
	}
	this.mtDialogs.insert(0, oDialog);
	var loMessageManager = oDialog.getMessageManager();
	var loMessageComponent = oDialog.getMessageComponent();
	if (loMessageManager === this.moMessageManager || oFF.isNull(loMessageManager))
	{
		oDialog.setMessageComponent(this.moMessageComponent);
	}
	else
	{
		if (oFF.isNull(loMessageComponent) || loMessageComponent === this.moMessageComponent)
		{
			loMessageComponent = this.createMessageComponent(oFF.XStringUtils.concatenate3(oDialog.getComponentName(), "_", sap.zen.MessageviewControl.MESSAGEVIEW_UID));
			oDialog.setMessageComponent(loMessageComponent);
		}
	}
};
