sap.zen.Page.prototype.exec = function(script)
{
	if (oFF.notNull(this.moLogging) && this.moLogging.isLoggable(sap.buddha.XLogging.XDEBUG))
	{
		this.moLogging.debug("Page: enter exec", script, "SCRIPT");
		this.moRsttStringBuffer.append("<step>");
		this.moRsttStringBuffer.appendNewLine();
		this.moRsttStringBuffer.append("<script name=\"script\" value=\"");
		var val = sap.buddha.XSSEncoder.encodeXml(script);
		this.moRsttStringBuffer.append(val);
		this.moRsttStringBuffer.append("\"/>");
		this.moRsttStringBuffer.appendNewLine();
		this.moRsttStringBuffer.append("</step>");
		this.moRsttStringBuffer.appendNewLine();
	}
	this.mInitial = false;
	this.mForcePrompt = false;
	this.executeScriptInWindow(script);
	if (!this.mBackToStartMode)
	{
		if (this.isAsynchronousEnabled() && !this.moRootComponent.isInFillManadatoryVariablesMode())
		{
			this.triggerAsynchronousRefreshResultSets(false);
		}
		else
		{
			this.rerender();
		}
	}
	this.mBackToStartMode = false;
	if (oFF.notNull(this.moLogging) && this.moLogging.isLoggable(sap.buddha.XLogging.XDEBUG))
	{
		this.moLogging.debug("Page: leave exec", "", "SCRIPT");
	}
	if (this.isReleased())
	{
		this.moWindow.resetLock();
	}
};
