sap.zen.Page.prototype.triggerAsynchronousRefreshResultSets = function(initial)
{
	if (!this.isAsynchronousEnabled())
	{
		return;
	}
	var ltDataSources = null;
	if (this.mOptimizeDSRequests === true)
	{
		ltDataSources = this.getUsedDataSourcesByDummyRendering();
	}
	else
	{
		ltDataSources = this.getDataSources();
	}
	var lRender = true;
	this.mNumberOfStartedRefreshes = 0;
	if (oFF.notNull(ltDataSources))
	{
		this.mNumberOfStartedRefreshes = ltDataSources.size();
		for (var lDataSourceIndex = 0; lDataSourceIndex < ltDataSources.size(); lDataSourceIndex++)
		{
			var loDataSource = ltDataSources.get(lDataSourceIndex);
			if (oFF.isNull(loDataSource) || loDataSource.getQueryManager() === null)
			{
				this.mNumberOfStartedRefreshes--;
				continue;
			}
			var loResponse = loDataSource.triggerRefresh(this, oFF.XBooleanValue.create(loDataSource.getResultSet().isValid()));
			if (oFF.notNull(loResponse) && loResponse.actionWasPerformed())
			{
				if (!loResponse.hasErrors())
				{
					if (ltDataSources.size() === 1 && !this.mAsyncResultSetAlreadyFetched)
					{
						this.moWindow.increaseLock();
					}
					else
					{
						lRender = false;
					}
				}
				else
				{
					this.mNumberOfStartedRefreshes--;
				}
				this.mAsyncResultSetAlreadyFetched = true;
			}
			else
			{
				this.mNumberOfStartedRefreshes--;
			}
		}
	}
	if (lRender)
	{
		this.rerender();
	}
};
sap.zen.Page.prototype.handleDataSourceAfterRefresh = function(oContext, oResponse, oBaggage)
{
	this.mNumberOfStartedRefreshes--;
	var lWasValidResultSet = oBaggage;
	if (lWasValidResultSet.getBoolean() === false)
	{
		sap.zen.DataSourceChangeCause.NO_REFRESH_REQUIRED.setAction(sap.zen.CDataSourceChangeAction.AsyncResultSet);
		oContext.raiseDataSourceChangedEvent(sap.zen.DataSourceChangeCause.NO_REFRESH_REQUIRED, false, true);
	}
	if (this.mNumberOfStartedRefreshes <= 0)
	{
		this.mNumberOfStartedRefreshes = 0;
		this.rerender();
	}
};
