sap.zen.Page.prototype.rerender = function()
{
	this.mRenderQueue++;
	if (this.mRenderQueue === 1)
	{
		this.renderAndDispatch();
		this.mRenderQueue--;
		if (this.mRenderQueue > 0)
		{
			this.rerender();
		}
		this.moWindow.decreaseLock();
	}
};
