sap.zen.Page.prototype.render = function()
{
	if (!this.moRootComponent.isInFillManadatoryVariablesMode())
	{
		this.callOnresultsetChangedScripts();
	}
	var loStringBuffer = null;
	var loRenderManager = new sap.zen.RenderManager();
	var lClientServerMode = this.isClientServerMode();
	if (lClientServerMode)
	{
		loStringBuffer = oFF.XStringBuffer.create();
		loRenderManager.setStringBuffer(loStringBuffer);
	}
	loRenderManager.createRenderSerializer();
	var loRenderSerializer = loRenderManager.getRenderSerializer();
	loRenderSerializer.openTag("content");
	if (oFF.notNull(this.mPageId))
	{
		loRenderSerializer.addAttribute("pageId", this.mPageId);
	}
	var lIsInterComponentDragDropDAllowed = this.getApplicationPropertiesComponent().isInterComponentDragDropEnabled();
	if (lIsInterComponentDragDropDAllowed)
	{
		loRenderSerializer.addBooleanAttribute("bInterComponentDragDropEnabled", lIsInterComponentDragDropDAllowed);
	}
	loRenderSerializer.openTag("pageContent");
	var lInitial = this.mInitial || this.mBackToStartMode;
	if (!lInitial)
	{
		loRenderSerializer.openArray("delta");
	}
	this.moRootComponent.renderComponentInternal(loRenderManager);
	if (!lInitial)
	{
		loRenderSerializer.closeArray();
	}
	loRenderSerializer.closeTag();
	if (oFF.notNull(this.mtAddtionalRequiredJavaScripts) && this.mtAddtionalRequiredJavaScripts.size() > 0)
	{
		loRenderSerializer.openArray("addtionalRequiredJavaScripts");
		for (var i = 0; i < this.mtAddtionalRequiredJavaScripts.size(); i++)
		{
			var lScript = this.mtAddtionalRequiredJavaScripts.get(i);
			if (oFF.isNull(lScript))
			{
				continue;
			}
			loRenderSerializer.addSimpleValueToArray(lScript);
		}
		loRenderSerializer.closeArray();
	}
	this.writeNewRequiredModules(loRenderSerializer);
	loRenderSerializer.closeTag();
	this.setContentChanged(false);
	this.mInitial = false;
	if (lClientServerMode)
	{
		if (oFF.notNull(loStringBuffer))
		{
			this.mJson = loStringBuffer.toString();
		}
	}
	else
	{
		this.moJson = loRenderSerializer.getRenderedObject();
	}
};
