sap.zen.Page.prototype.setVariableValueRange = function(variableName, variableValueLow, variableValueHigh)
{
	var ltDataSources = this.getDataSources();
	if (oFF.isNull(ltDataSources) || ltDataSources.isEmpty())
	{
		return;
	}
	var loDataSourceIterator = ltDataSources.getIterator();
	while (loDataSourceIterator.hasNext())
	{
		var loDataSource = loDataSourceIterator.next();
		if (oFF.isNull(loDataSource))
		{
			continue;
		}
		var loVariableProcessor = loDataSource.getVariableProcessor();
		if (oFF.notNull(loVariableProcessor))
		{
			sap.zen.DataSourceScriptApiUtils.setVariableValueRange(loDataSource, variableName, variableValueLow, variableValueHigh, !this.mInVarSubmitOrBackgroundProcessingScript);
			loDataSource.raiseDataSourceChangedEvent(null, true, false);
			if (this.mInVarSubmitOrBackgroundProcessingScript)
			{
				this.addVariableProcessorInQueue(loDataSource);
			}
		}
	}
	this.invalidateDataSourcesReasonVariablesChange();
};
sap.zen.Page.prototype.setVariableValueFromFilterArray = function(variableName, variableValue, displayKey)
{
	var ltDataSources = this.getDataSources();
	if (oFF.isNull(ltDataSources) || ltDataSources.isEmpty())
	{
		return false;
	}
	var lValuesWereApplied = true;
	var loDataSourceIterator = ltDataSources.getIterator();
	while (loDataSourceIterator.hasNext())
	{
		var loDataSource = loDataSourceIterator.next();
		if (oFF.isNull(loDataSource))
		{
			continue;
		}
		if (sap.zen.VariablesUtils.getInputEnabledVariable_DataSource(loDataSource, variableName) !== null)
		{
			var lValuesAppliedLocally = sap.zen.DataSourceScriptApiUtils.setVariableValue(loDataSource, variableName, variableValue, displayKey);
			if (lValuesAppliedLocally)
			{
				loDataSource.raiseDataSourceChangedEvent(null, true, false);
				if (this.mInVarSubmitOrBackgroundProcessingScript)
				{
					this.addVariableProcessorInQueue(loDataSource);
				}
			}
			else
			{
				lValuesWereApplied = false;
			}
		}
		else
		{
			lValuesWereApplied = false;
		}
	}
	this.invalidateDataSourcesReasonVariablesChange();
	return lValuesWereApplied;
};
