sap.zen.Page.prototype.initializePlanning = function(oApplicationProperties)
{
	var lPlanningConnection = null;
	if (this.isHanaMode() === true)
	{
		lPlanningConnection = "self";
	}
	else
	{
		lPlanningConnection = oApplicationProperties.getStringPropertyWithDefault("PLANNING_CONNECTION", null);
	}
	if (oFF.notNull(lPlanningConnection) && this.isBWSystem(lPlanningConnection))
	{
		var lPlanningModelAndEnvironment = oApplicationProperties.getStringPropertyWithDefault("PLANNING_MODEL", null);
		var lEnvironment = null;
		var lModel = null;
		if (oFF.notNull(lPlanningModelAndEnvironment) && oFF.XString.size(lPlanningModelAndEnvironment) > 0)
		{
			lEnvironment = oFF.XString.substring(lPlanningModelAndEnvironment, 0, 20);
			lModel = oFF.XString.substring(lPlanningModelAndEnvironment, 20, oFF.XString.size(lPlanningModelAndEnvironment));
		}
		var loPlanningServiceConfig = oFF.OlapApiModule.SERVICE_TYPE_PLANNING.createServiceConfig(this.getApplication());
		loPlanningServiceConfig.setSystemName(lPlanningConnection);
		var loConfigProperties = loPlanningServiceConfig.getProperties();
		loConfigProperties.put(oFF.PlanningConstants.DATA_AREA, "MY_DATA_AREA");
		loConfigProperties.put(oFF.PlanningConstants.ENVIRONMENT, lEnvironment);
		loConfigProperties.put(oFF.PlanningConstants.MODEL, lModel);
		loConfigProperties.put(oFF.PlanningConstants.CELL_LOCKING, oFF.CellLockingType.DEFAULT_SETTING_BACKEND.toString());
		var loResult = null;
		try
		{
			loResult = loPlanningServiceConfig.processServiceCreation(oFF.SyncType.BLOCKING, null, null);
		}
		catch (e)
		{
			sap.zen.CLocalizationDataSourceMessages.PLANNING_ERR_LONG.addMessageToMessageHandler(this.getMessageManager(), oFF.Severity.ERROR, null, null, null);
			return;
		}
		if (loResult.hasErrors() === false)
		{
			var loPlanningService = loResult.getData();
			if (oFF.notNull(loPlanningService))
			{
				this.moPlanningContext = loPlanningService.getPlanningContext();
			}
		}
		else
		{
			sap.zen.CLocalizationDataSourceMessages.PLANNING_ERR_LONG.addMessageToMessageHandler(this.getMessageManager(), oFF.Severity.ERROR, null, null, null);
		}
		this.createMessagesFromCollection(loResult);
	}
};
