sap.zen.ApplicationPropertiesComponent.prototype.addGlobalVariables = function(oWindow, tParameters)
{
	var loInitParametersNode = this.getInitParameters();
	if (oFF.isNull(loInitParametersNode))
	{
		return;
	}
	var loGlobalVariablesNode = loInitParametersNode.getFirstChildWithNameTag("GLOBALVARIABLES");
	if (oFF.isNull(loGlobalVariablesNode))
	{
		return;
	}
	var ltGlobalVariableNode = loGlobalVariablesNode.getChildren("property");
	var loGlobalVariableNodeIterator = ltGlobalVariableNode.getIterator();
	while (loGlobalVariableNodeIterator.hasNext())
	{
		var loGlobalVariableNode = loGlobalVariableNodeIterator.next();
		if (oFF.isNull(loGlobalVariableNode))
		{
			continue;
		}
		var loNameNode = loGlobalVariableNode.getFirstChildWithNameTag("NAME");
		var lName = null;
		if (oFF.notNull(loNameNode))
		{
			lName = loNameNode.getAttribute("value");
		}
		var loValueNode = loGlobalVariableNode.getFirstChildWithNameTag("VALUE");
		var lValue = null;
		if (oFF.notNull(loValueNode))
		{
			lValue = loValueNode.getAttribute("value");
		}
		var loTypeNode = loGlobalVariableNode.getFirstChildWithNameTag("GLOBAL_VAR_TYPE");
		var lType = "";
		if (oFF.notNull(loTypeNode))
		{
			lType = loTypeNode.getAttribute("value");
		}
		var loUrlParamNode = loGlobalVariableNode.getFirstChildWithNameTag("URL_PARAM");
		var lIsUrlParam = false;
		if (oFF.notNull(loUrlParamNode))
		{
			var lUrlParam = loUrlParamNode.getAttribute("value");
			lIsUrlParam = oFF.XString.startsWith(lUrlParam, "X");
		}
		var lUrlParameterValue = null;
		if (lIsUrlParam && tParameters.containsKey(lName))
		{
			lUrlParameterValue = tParameters.getByKey(lName);
		}
		var loValue = null;
		if (oFF.notNull(lValue))
		{
			if (oFF.XString.endsWith(lValue, "'"))
			{
				if (oFF.isNull(lUrlParameterValue))
				{
					loValue = oFF.XStringValue.create(oFF.XString.substring(lValue, 1, oFF.XString.size(lValue) - 1));
				}
				else
				{
					loValue = oFF.XStringValue.create(lUrlParameterValue);
				}
			}
			else if (oFF.XString.startsWith(lValue, "true") || oFF.XString.startsWith(lValue, "false"))
			{
				if (oFF.isNull(lUrlParameterValue) || !(oFF.XString.startsWith(lUrlParameterValue, "true") || oFF.XString.startsWith(lUrlParameterValue, "false")))
				{
					loValue = oFF.XBooleanValue.create(oFF.XString.startsWith(lValue, "true"));
				}
				else
				{
					loValue = oFF.XBooleanValue.create(oFF.XString.startsWith(lUrlParameterValue, "true"));
				}
			}
			else if (oFF.XString.indexOf(lValue, ".") >= 0)
			{
				var loDouble = oFF.XDoubleValue.create(oFF.XDouble.convertFromString(lValue));
				loValue = loDouble;
				if (oFF.notNull(lUrlParameterValue))
				{
					loValue = oFF.XDoubleValue.create(oFF.XDouble.convertFromStringWithDefault(lUrlParameterValue, loDouble.getDouble()));
				}
			}
			else
			{
				var loInteger = oFF.XIntegerValue.create(oFF.XInteger.convertFromString(lValue));
				loValue = loInteger;
				if (oFF.notNull(lUrlParameterValue))
				{
					loValue = oFF.XIntegerValue.create(oFF.XInteger.convertFromStringWithDefault(lUrlParameterValue, loInteger.getInteger()));
				}
			}
		}
		else
		{
			if (oFF.XString.endsWith(lType, "Array"))
			{
				loValue = oFF.XArray.create(0);
			}
		}
		oWindow.setContextForGlobalVariable(lName, loValue, lIsUrlParam);
	}
};
sap.zen.ApplicationPropertiesComponent.prototype.applyGlobalVariableValues = function(oWindow)
{
	var loInitParametersNode = this.getInitParameters();
	if (oFF.isNull(loInitParametersNode))
	{
		return;
	}
	var loGlobalVariablesNode = loInitParametersNode.getFirstChildWithNameTag("GLOBALVARIABLES");
	if (oFF.isNull(loGlobalVariablesNode))
	{
		return;
	}
	var ltGlobalVariableNode = loGlobalVariablesNode.getChildren("property");
	var loGlobalVariableNodeIterator = ltGlobalVariableNode.getIterator();
	while (loGlobalVariableNodeIterator.hasNext())
	{
		var loGlobalVariableNode = loGlobalVariableNodeIterator.next();
		if (oFF.isNull(loGlobalVariableNode))
		{
			continue;
		}
		var loNameNode = loGlobalVariableNode.getFirstChildWithNameTag("NAME");
		var lName = null;
		if (oFF.notNull(loNameNode))
		{
			lName = loNameNode.getAttribute("value");
		}
		var loValueNode = loGlobalVariableNode.getFirstChildWithNameTag("VALUE");
		var lValue = null;
		if (oFF.notNull(loValueNode))
		{
			lValue = loValueNode.getAttribute("value");
		}
		var loUrlParamNode = loGlobalVariableNode.getFirstChildWithNameTag("URL_PARAM");
		var lIsUrlParam = false;
		if (oFF.notNull(loUrlParamNode))
		{
			var lUrlParam = loUrlParamNode.getAttribute("value");
			lIsUrlParam = oFF.XString.startsWith(lUrlParam, "X");
		}
		var loValue = null;
		if (oFF.XString.isEqual(lValue, "true") || oFF.XString.isEqual(lValue, "false"))
		{
			loValue = oFF.XBooleanValue.create(oFF.XString.startsWith(lValue, "true"));
		}
		if (oFF.isNull(loValue) && oFF.XString.indexOf(lValue, ".") >= 0)
		{
			try
			{
				loValue = oFF.XDoubleValue.create(oFF.XDouble.convertFromString(lValue));
			}
			catch (valueNotADoubleEx)
			{
				loValue = null;
			}
		}
		if (oFF.isNull(loValue))
		{
			try
			{
				loValue = oFF.XIntegerValue.create(oFF.XInteger.convertFromString(lValue));
			}
			catch (valueNotAnIntegerEx)
			{
				loValue = null;
			}
		}
		if (oFF.isNull(loValue))
		{
			loValue = oFF.XStringValue.create(lValue);
		}
		oWindow.setContextForGlobalVariable(lName, loValue, lIsUrlParam);
	}
};
