sap.zen.ApplicationPropertiesComponent.prototype.getOnBeforePromptsSubmitScript = function()
{
	var lcScript = "";
	var loInitParametersNode = this.getInitParameters();
	if (oFF.isNull(loInitParametersNode))
	{
		return lcScript;
	}
	var loOnBeforePromptsSubmitNode = loInitParametersNode.getFirstChildWithNameTag("ON_BEFORE_PROMPTS_SUBMIT");
	if (oFF.notNull(loOnBeforePromptsSubmitNode))
	{
		var loValueNode = loOnBeforePromptsSubmitNode.getFirstChild("value");
		if (oFF.notNull(loValueNode))
		{
			var lScript = loValueNode.getText();
			if (oFF.notNull(lScript))
			{
				return lScript;
			}
		}
	}
	return lcScript;
};
sap.zen.ApplicationPropertiesComponent.prototype.execOnBeforePromptsSubmitScript = function()
{
	var lScript = this.getOnBeforePromptsSubmitScript();
	if (oFF.isNull(lScript) || oFF.XString.size(lScript) <= 0)
	{
		return;
	}
	var loPage = this.getPage();
	if (oFF.isNull(loPage))
	{
		return;
	}
	loPage.setOnBeforePromptsSubmit(true);
	var loLogging = this.getPage().getLogging();
	if (oFF.notNull(loLogging) && loLogging.isLoggable(sap.buddha.XLogging.XDEBUG))
	{
		loLogging.debug("Page: enter exec ON_BEFORE_PROMPTS_SUBMIT", lScript, "SCRIPT");
	}
	loPage.executeScriptInWindow(lScript);
	if (oFF.notNull(loLogging) && loLogging.isLoggable(sap.buddha.XLogging.XDEBUG))
	{
		loLogging.debug("Page: leave exec ON_BEFORE_PROMPTS_SUBMIT", "", "SCRIPT");
	}
	loPage.setOnBeforePromptsSubmit(false);
};
