sap.zen.ConditionsDialog = function() {};
sap.zen.ConditionsDialog.prototype = new sap.zen.Component();
sap.zen.ConditionsDialog.prototype._ff_c = "ConditionsDialog";

sap.zen.ConditionsDialog.prototype.moDataSource = null;
sap.zen.ConditionsDialog.prototype.mSubmitCommand = null;
sap.zen.ConditionsDialog.prototype.mDimensionEvaluationType = null;
sap.zen.ConditionsDialog.prototype.mEvaluateRulesWithAnd = false;
sap.zen.ConditionsDialog.prototype.CONDITION_NAME = null;
sap.zen.ConditionsDialog.prototype.create = function()
{
	var lUid = oFF.XStringUtils.concatenate2(this.getName(), "_conditionsdialog");
	this.getPage().addRequireModule("zen.rt.components.dialog/resources/js/conditionsdialog_handler");
	this.initControl(lUid, "CONDITIONS_DIALOG");
	var lCommand = oFF.XStringUtils.concatenate2(this.getId(), ".doSubmitCommand('__arguments__');");
	this.mSubmitCommand = this.createScriptAction(lCommand, "__JSON__");
	this.CONDITION_NAME = "ZENCONDITION";
	this.mDimensionEvaluationType = oFF.ConditionDimensionEvaluationType.MOST_DETAILED_ON_ROWS;
	this.mEvaluateRulesWithAnd = false;
};
sap.zen.ConditionsDialog.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	if (oFF.notNull(this.moDataSource) && this.moDataSource.getQueryManager() !== null)
	{
		var loQueryModel = this.moDataSource.getQueryManager().getQueryModel();
		var loMeasureDimension = loQueryModel.getMeasureDimension();
		if (oFF.isNull(loMeasureDimension))
		{
			return;
		}
		var ltMeasures = loMeasureDimension.getAllStructureMembers();
		loRenderSerializer.openArray("measures");
		for (var lMeasureIndex = 0; lMeasureIndex < ltMeasures.size(); lMeasureIndex++)
		{
			var loMeasure = ltMeasures.get(lMeasureIndex);
			loRenderSerializer.openJsonTag();
			loRenderSerializer.addAttribute("key", loMeasure.getName());
			loRenderSerializer.addAttribute("text", loMeasure.getText());
			loRenderSerializer.closeJsonTag();
		}
		loRenderSerializer.closeArray();
		var loCondition = this.getCondition(0, true);
		loRenderSerializer.openTag("condition");
		loRenderSerializer.openArray("thresholds");
		this.renderThresholds(loRenderSerializer, loCondition);
		if (this.mEvaluateRulesWithAnd)
		{
			var continueConditionsearch = true;
			for (var j = 1; continueConditionsearch; j++)
			{
				var andCondition = this.getCondition(j, false);
				continueConditionsearch = oFF.notNull(andCondition);
				if (continueConditionsearch)
				{
					this.renderThresholds(loRenderSerializer, andCondition);
				}
			}
		}
		loRenderSerializer.closeArray();
		loRenderSerializer.addAttribute("dimensionEvaluationType", loCondition.getDimensionEvaluationType().getName());
		if (this.mEvaluateRulesWithAnd)
		{
			loRenderSerializer.addBooleanAttribute("evaluateRulesWithAnd", true);
		}
		loRenderSerializer.closeTag();
		loRenderSerializer.addAttribute("submitCommand", this.mSubmitCommand);
	}
};
sap.zen.ConditionsDialog.prototype.renderThresholds = function(oRenderSerializer, oCondition)
{
	var tThresholds = oCondition.getThresholds();
	for (var lThresholdIndex = 0; lThresholdIndex < tThresholds.size(); lThresholdIndex++)
	{
		var loThreshold = tThresholds.get(lThresholdIndex);
		oRenderSerializer.openJsonTag();
		oRenderSerializer.addAttribute("keyField", loThreshold.getMeasureCoordinates().get(0).getName());
		var lComparisonOperator = loThreshold.getComparisonOperator();
		oRenderSerializer.addAttribute("operation", this.converteComparisonOperatorToString(lComparisonOperator));
		oRenderSerializer.addBooleanAttribute("exclude", false);
		oRenderSerializer.addAttribute("value1", loThreshold.getLow().getString());
		oRenderSerializer.addAttribute("value2", loThreshold.getHigh().getString());
		oRenderSerializer.closeJsonTag();
	}
};
sap.zen.ConditionsDialog.prototype.converteComparisonOperatorToString = function(comparisonOperator)
{
	if (comparisonOperator === oFF.ConditionComparisonOperator.NOT_EQUAL)
	{
		return "ZENNEQ";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.BETWEEN)
	{
		return "BT";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.NOT_BETWEEN)
	{
		return "ZENNBT";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.LESS_THAN)
	{
		return "LT";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.LESS_EQUAL)
	{
		return "LE";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.GREATER_THAN)
	{
		return "GT";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.GREATER_EQUAL)
	{
		return "GE";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.TOP_N)
	{
		return "ZENTopN";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.TOP_PERCENT)
	{
		return "ZENTopPercent";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.TOP_SUM)
	{
		return "ZENTopSum";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_N)
	{
		return "ZENBottomN";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_PERCENT)
	{
		return "ZENBottomPercent";
	}
	if (comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_SUM)
	{
		return "ZENBottomSum";
	}
	return "EQ";
};
sap.zen.ConditionsDialog.prototype.setDataSource = function(oDataSource)
{
	this.moDataSource = oDataSource;
};
sap.zen.ConditionsDialog.prototype.doSubmitCommand = function(conditions)
{
	var loQueryModel = this.moDataSource.getQueryManager().getQueryModel();
	loQueryModel.getConditionManager().clear();
	this.moDataSource.raiseDataSourceChangedEvent(null, false, true);
	var loJsonParser = this.getJsonParser();
	var loJsonStructureConditions = loJsonParser.parse(conditions).asStructure();
	this.mEvaluateRulesWithAnd = loJsonStructureConditions.getByKey("evaluateRulesWithAnd").asBoolean().getBoolean();
	var thresholds = loJsonStructureConditions.getByKey("thresholds").asList();
	var size = thresholds.size();
	var dimensionEvaluationType = this.convertDimensionEvaluationType(loJsonStructureConditions.getByKey("dimensionEvaluationType").asString().getString());
	if (size === 0)
	{
		this.mDimensionEvaluationType = dimensionEvaluationType;
		return;
	}
	var loCondition = this.getCondition(0, true);
	loCondition.clearThresholds();
	loCondition.setDimensionEvaluationType(dimensionEvaluationType);
	for (var i = 0; i < size; i++)
	{
		var threshold = thresholds.get(i).asStructure();
		if (this.mEvaluateRulesWithAnd && i > 0)
		{
			loCondition = this.getCondition(i, true);
			loCondition.clearThresholds();
			loCondition.setDimensionEvaluationType(dimensionEvaluationType);
		}
		var loConditionThreshold = loCondition.createThreshold();
		loConditionThreshold.addMeasureCoordinate(loQueryModel.getMeasureDimension().getStructureMember(threshold.getByKey("keyField").asString().getString()).getDimensionMember());
		loConditionThreshold.setComparisonOperator(this.convertComparisonOperator(threshold.getByKey("operation").asString().getString()));
		loConditionThreshold.getLow().setString(threshold.getByKey("value1").getStringRepresentation());
		var high = threshold.getByKey("value2");
		if (oFF.notNull(high) && !oFF.XString.isEqual("null", high.getStringRepresentation()))
		{
			loConditionThreshold.getHigh().setString(high.getStringRepresentation());
		}
	}
};
sap.zen.ConditionsDialog.prototype.getCondition = function(index, createNew)
{
	var loQueryModel = this.moDataSource.getQueryManager().getQueryModel();
	var loConditionManager = loQueryModel.getConditionManager();
	var lConditionName = this.CONDITION_NAME;
	if (index > 0)
	{
		lConditionName = oFF.XStringUtils.concatenate2(this.CONDITION_NAME, oFF.XInteger.convertToString(index));
	}
	var loCondition = loConditionManager.getConditionByName(lConditionName);
	if (oFF.isNull(loCondition) && createNew)
	{
		loCondition = loConditionManager.addNewCondition(lConditionName);
		loCondition.setDimensionEvaluationType(this.mDimensionEvaluationType);
	}
	return loCondition;
};
sap.zen.ConditionsDialog.prototype.convertComparisonOperator = function(op)
{
	if (oFF.XString.isEqual("ZENNEQ", op))
	{
		return oFF.ConditionComparisonOperator.NOT_EQUAL;
	}
	if (oFF.XString.isEqual("BT", op))
	{
		return oFF.ConditionComparisonOperator.BETWEEN;
	}
	if (oFF.XString.isEqual("ZENNBT", op))
	{
		return oFF.ConditionComparisonOperator.NOT_BETWEEN;
	}
	if (oFF.XString.isEqual("LT", op))
	{
		return oFF.ConditionComparisonOperator.LESS_THAN;
	}
	if (oFF.XString.isEqual("LE", op))
	{
		return oFF.ConditionComparisonOperator.LESS_EQUAL;
	}
	if (oFF.XString.isEqual("GT", op))
	{
		return oFF.ConditionComparisonOperator.GREATER_THAN;
	}
	if (oFF.XString.isEqual("GE", op))
	{
		return oFF.ConditionComparisonOperator.GREATER_EQUAL;
	}
	if (oFF.XString.isEqual("ZENTopN", op))
	{
		return oFF.ConditionComparisonOperator.TOP_N;
	}
	if (oFF.XString.isEqual("ZENTopPercent", op))
	{
		return oFF.ConditionComparisonOperator.TOP_PERCENT;
	}
	if (oFF.XString.isEqual("ZENTopSum", op))
	{
		return oFF.ConditionComparisonOperator.TOP_SUM;
	}
	if (oFF.XString.isEqual("ZENBottomN", op))
	{
		return oFF.ConditionComparisonOperator.BOTTOM_N;
	}
	if (oFF.XString.isEqual("ZENBottomPercent", op))
	{
		return oFF.ConditionComparisonOperator.BOTTOM_PERCENT;
	}
	if (oFF.XString.isEqual("ZENBottomSum", op))
	{
		return oFF.ConditionComparisonOperator.BOTTOM_SUM;
	}
	return oFF.ConditionComparisonOperator.EQUAL;
};
sap.zen.ConditionsDialog.prototype.convertDimensionEvaluationType = function(type)
{
	if (oFF.XString.isEqual("mostDetailedOnRows", type))
	{
		return oFF.ConditionDimensionEvaluationType.MOST_DETAILED_ON_ROWS;
	}
	if (oFF.XString.isEqual("mostDetailedOnCols", type))
	{
		return oFF.ConditionDimensionEvaluationType.MOST_DETAILED_ON_COLS;
	}
	return oFF.ConditionDimensionEvaluationType.ALL_IN_DRILL_DOWN;
};

sap.zen.ContextMenuControl = function() {};
