sap.zen.ContextMenuControl.SCALING_PREFIX = "SCALING_";
sap.zen.ContextMenuControl.DECIMAL_PREFIX = "DECIMAL_";
sap.zen.ContextMenuControl.deserialize = function(serialisation)
{
	var result = oFF.XListOfString.create();
	var length = oFF.XString.size(serialisation);
	var counterBackslash = 0;
	var start = 0;
	for (var i = 0; i < length; i++)
	{
		var charAt = oFF.XString.getCharAt(serialisation, i);
		if (charAt === oFF.XString.getCharAt("/", 0))
		{
			if (counterBackslash === 0)
			{
				var string = oFF.XString.substring(serialisation, start, i);
				result.add(sap.zen.ContextMenuControl.unEscapeComponent(string));
				start = i + 1;
			}
			else
			{
				counterBackslash = 0;
			}
		}
		else if (charAt === oFF.XString.getCharAt("\\", 0))
		{
			counterBackslash++;
		}
		else
		{
			counterBackslash = 0;
		}
	}
	if (start <= length)
	{
		result.add(sap.zen.ContextMenuControl.unEscapeComponent(oFF.XString.substring(serialisation, start, -1)));
	}
	return result;
};
sap.zen.ContextMenuControl.unEscapeComponent = function(component)
{
	var length = oFF.XString.size(component);
	var shift = 0;
	var result = component;
	for (var i = 0; i < length - 1; i++)
	{
		if (oFF.XString.getCharAt(component, i) === oFF.XString.getCharAt("\\", 0))
		{
			var charAt = oFF.XString.getCharAt(component, i + 1);
			if (charAt === oFF.XString.getCharAt("\\", 0) || charAt === oFF.XString.getCharAt("/", 0))
			{
				var start = i - shift + 1;
				var end = i - shift;
				result = oFF.XStringUtils.concatenate2(oFF.XString.substring(result, 0, end), oFF.XString.substring(result, start, -1));
				i++;
				shift++;
			}
		}
	}
	return result;
};
