sap.zen.ContextMenuControl.prototype.processOpenContextMenu = function(sourceComponentName, mode, context)
{
	var loDimension = this.moDimension;
	var loDimensionMember = this.moDimensionMember;
	var loInternalAttribute = this.moInternalAttribute;
	var loResultSet = this.moResultSet;
	var loResultDataCell = this.moResultDataCell;
	var loResultSetInfo = this.moResultSetInfo;
	this.resetControl();
	this.mSourceComponentName = sourceComponentName;
	this.mMode = mode;
	var lValid = false;
	if (context === sap.zen.CContextMenuContext.DIMENSION)
	{
		if (oFF.notNull(loDimension))
		{
			this.moDimension = loDimension;
			this.moResultSet = this.moDimension.getResultSet();
			lValid = true;
		}
	}
	else if (context === sap.zen.CContextMenuContext.DIMENSION_MEMBER)
	{
		if (oFF.notNull(loDimensionMember))
		{
			this.moDimensionMember = loDimensionMember;
			this.moDimension = this.moDimensionMember.getDimension();
			this.moResultSet = this.moDimension.getResultSet();
			lValid = true;
		}
	}
	else if (context === sap.zen.CContextMenuContext.ATTRIBUTE)
	{
		if (oFF.notNull(loInternalAttribute) && oFF.notNull(loResultSet))
		{
			this.moInternalAttribute = loInternalAttribute;
			this.moResultSet = loResultSet;
			var loInternalDimension = this.moInternalAttribute.getDimension();
			this.moDimension = sap.zen.Dimension.sGetDimension(this.moResultSet.getDataSource(), loInternalDimension.getName());
			this.mMode = sap.zen.CContextMenuMode.CROSSTAB;
			lValid = true;
		}
	}
	else if (context === sap.zen.CContextMenuContext.DATA_CELL)
	{
		if (oFF.notNull(loResultDataCell))
		{
			this.moResultDataCell = loResultDataCell;
			this.moResultSet = this.moResultDataCell.getResultSet();
			this.mMode = sap.zen.CContextMenuMode.CROSSTAB;
			lValid = true;
		}
	}
	else if (context === sap.zen.CContextMenuContext.FIELD)
	{
		if (oFF.notNull(loResultSetInfo))
		{
			this.moResultSetInfo = loResultSetInfo;
			this.moDimension = this.moResultSetInfo.getDimension();
			this.moResultSet = this.moResultSetInfo.getResultSet();
			var loField = this.moResultSetInfo.getField();
			if (oFF.notNull(loField))
			{
				var loAttribute = loField.getAttribute();
				if (sap.zen.DataSourceScriptApiUtils.isAttribute(this.moResultSet.getDataSource(), loAttribute))
				{
					this.moInternalAttribute = loAttribute;
				}
			}
			var loFieldValue = this.moResultSetInfo.getFieldValue();
			if (oFF.notNull(loFieldValue))
			{
				this.moDimensionMember = this.moResultSetInfo.getDimensionMember();
			}
			this.mMode = sap.zen.CContextMenuMode.CROSSTAB;
			if (oFF.notNull(this.moDimension) || oFF.notNull(loField))
			{
				lValid = true;
			}
		}
	}
	if (lValid)
	{
		this.openContextMenu();
	}
};
