sap.zen.ContextMenuControl.prototype.renderUDH = function(oRenderSerializer, oDimension)
{
	if (oFF.isNull(oDimension))
	{
		return;
	}
	if (oDimension.isStructure())
	{
		return;
	}
	var loProperties = oDimension.getProperties();
	if (!loProperties.isUDHSupported())
	{
		return;
	}
	var lText = null;
	if (oDimension.getAxis() === oFF.AxisType.ROWS)
	{
		lText = sap.zen.CLocalizationContextMenuTexts.UDH_DISPLAY_IN_ROWS.getText(this.getMessageWriter().getLocalization(), null, null, null);
	}
	else
	{
		lText = sap.zen.CLocalizationContextMenuTexts.UDH_DISPLAY_IN_COLUMNS.getText(this.getMessageWriter().getLocalization(), null, null, null);
	}
	var lUDHIsActive = loProperties.isUDHActive();
	if (lUDHIsActive)
	{
		this.addEntryFull(oRenderSerializer, lText, this.buildSetUDHAction(loProperties.getDimension(), !lUDHIsActive), false, lUDHIsActive);
		oRenderSerializer.openTag("entry");
		oRenderSerializer.addAttribute("text", sap.zen.CLocalizationContextMenuTexts.UDH_EXPAND_TO_LEVEL.getTextWithTripleDots(this.getMessageWriter().getLocalization(), null, null, null));
		if (lUDHIsActive)
		{
			this.startDialog(oRenderSerializer, sap.zen.CContextMenuDialog.HIERARCHY_LEVEL.getValue(), sap.zen.CLocalizationContextMenuTexts.HIERARCHY_EXPAND_TO_LEVEL.getText(this.getMessageWriter().getLocalization(), null, null, null), 1);
			oRenderSerializer.openTag("element");
			oRenderSerializer.addAttribute("type", "dropdown");
			oRenderSerializer.addAttribute("id", "dd_levels");
			oRenderSerializer.addAttribute("text", sap.zen.CLocalizationContextMenuTexts.SELECT_DIMENSION.getText(this.getMessageWriter().getLocalization(), null, null, null));
			oRenderSerializer.openArray("entries");
			var lCurrentExpandingLevel = loProperties.getUDHDrillLevel();
			var ltUDHDimensions = loProperties.getUDHDimensions();
			for (var lDimensionIndex = 0; lDimensionIndex < ltUDHDimensions.size(); lDimensionIndex++)
			{
				var lDimensionName = ltUDHDimensions.get(lDimensionIndex);
				if (oFF.isNull(lDimensionName))
				{
					continue;
				}
				var lLevelIndex = lDimensionIndex + 1;
				var loUDHDimension = sap.zen.Dimension.sGetDimension(oDimension.getDataSource(), lDimensionName);
				this.addDropDownItem(oRenderSerializer, oFF.XInteger.convertToString(lLevelIndex), loUDHDimension.getHeaderText(null), lCurrentExpandingLevel === lLevelIndex);
			}
			oRenderSerializer.closeArray();
			oRenderSerializer.closeTag();
			this.closeDialog(oRenderSerializer);
		}
		oRenderSerializer.closeTag();
		var lAlignment = loProperties.getUDHAlignment();
		if (oFF.notNull(lAlignment))
		{
			oRenderSerializer.openTag("entry");
			oRenderSerializer.addAttribute("text", sap.zen.CLocalizationContextMenuTexts.UDH_NODE_ALIGNMENT.getText(this.getMessageWriter().getLocalization(), null, null, null));
			oRenderSerializer.openArray("entries");
			this.addEntryFull(oRenderSerializer, sap.zen.CLocalizationContextMenuTexts.HIERARCHY_CHILDREN_BELOW_PARENT.getText(this.getMessageWriter().getLocalization(), null, null, null), this.buildSetHierarchyNodeAlignmentAction(oDimension, oFF.Alignment.CHILDREN_BELOW_PARENT.getName()), false, lAlignment !== oFF.Alignment.CHILDREN_ABOVE_PARENT);
			this.addEntryFull(oRenderSerializer, sap.zen.CLocalizationContextMenuTexts.HIERARCHY_CHILDREN_ABOVE_PARENT.getText(this.getMessageWriter().getLocalization(), null, null, null), this.buildSetHierarchyNodeAlignmentAction(oDimension, oFF.Alignment.CHILDREN_ABOVE_PARENT.getName()), false, lAlignment === oFF.Alignment.CHILDREN_ABOVE_PARENT);
			oRenderSerializer.closeArray();
			oRenderSerializer.closeTag();
		}
	}
	else
	{
		this.addEntryFull(oRenderSerializer, lText, this.buildSetUDHAction(loProperties.getDimension(), !lUDHIsActive), false, lUDHIsActive);
	}
};
