sap.zen.FioriHelperControl.prototype.getShellURL = function(URLParameters)
{
	var loUriBase = oFF.XUri.createFromUrl("");
	if (oFF.XStringUtils.isNotNullAndNotEmpty(URLParameters))
	{
		loUriBase.setQuery(URLParameters);
	}
	var ltQueryMap = loUriBase.getQueryMap();
	var loJsonParser = oFF.JsonParserFactory.newInstance();
	var loJsonStructure = loJsonParser.parse(this.mJSON).asStructure();
	var ltJsonStructureElementNames = loJsonStructure.getKeysAsReadOnlyListOfString();
	var lSize = ltJsonStructureElementNames.size();
	var lElementName;
	for (var lElementIndex = 0; lElementIndex < lSize; lElementIndex++)
	{
		lElementName = ltJsonStructureElementNames.get(lElementIndex);
		if (!ltQueryMap.containsKey(lElementName))
		{
			loUriBase.addQueryElement(lElementName, loJsonStructure.getStringByKey(lElementName));
		}
	}
	var loBuffer = oFF.XStringBuffer.create();
	loBuffer.append(this.mBaseURL);
	loBuffer.append("#");
	loBuffer.append(this.mHashBase);
	var lQueryString = loUriBase.getQuery();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(lQueryString))
	{
		loBuffer.append("?");
		loBuffer.append(loUriBase.getQuery());
	}
	var lUrl = loBuffer.toString();
	return lUrl;
};
