sap.zen.FioriHelperControl.prototype.renderContextForTargetFetch = function(oRenderSerializer)
{
	var loDataSource = this.moDataSource;
	if (oFF.isNull(loDataSource) && !this.getPage().getDataSources().isEmpty())
	{
		loDataSource = this.getPage().getDataSources().getValuesAsReadOnlyList().get(0);
	}
	if (oFF.isNull(loDataSource) || !loDataSource.isInitialized())
	{
		return;
	}
	oRenderSerializer.openTag("context");
	if (oFF.notNull(this.mtSelectionCapableElements))
	{
		for (var lElementIndex = 0; lElementIndex < this.mtSelectionCapableElements.size(); lElementIndex++)
		{
			var loSelectionCapableElement = this.mtSelectionCapableElements.get(lElementIndex);
			if (oFF.isNull(loSelectionCapableElement))
			{
				continue;
			}
			var ltSelectionsPerDimension = loSelectionCapableElement.getSelections();
			if (!ltSelectionsPerDimension.isEmpty())
			{
				oRenderSerializer.openArray("selections");
				loDataSource.renderJumpToSelectorContext(oRenderSerializer, ltSelectionsPerDimension);
				oRenderSerializer.closeArray();
				break;
			}
		}
	}
	loDataSource.renderJumpToVariableFilterContext(oRenderSerializer);
	oRenderSerializer.closeTag();
};
sap.zen.FioriHelperControl.prototype.renderNavigationInformation = function(oRenderSerializer)
{
	var ltAllowedDestinations = this.getPage().getNavigationAllowedSemanticSources();
	if (oFF.isNull(ltAllowedDestinations) || ltAllowedDestinations.size() === 0)
	{
		return;
	}
	oRenderSerializer.openTag("navigation");
	oRenderSerializer.openArray("allowed_semantic_sources");
	var lSize = ltAllowedDestinations.size();
	for (var lIndex = 0; lIndex < lSize; lIndex++)
	{
		var lAllowedDestination = ltAllowedDestinations.get(lIndex);
		if (oFF.isNull(lAllowedDestination))
		{
			continue;
		}
		oRenderSerializer.openTag("entry");
		oRenderSerializer.addAttribute("semanticname", lAllowedDestination);
		oRenderSerializer.closeTag();
	}
	oRenderSerializer.closeArray();
	oRenderSerializer.addAttribute("length", oFF.XInteger.convertToString(lSize));
	oRenderSerializer.closeTag();
};
