sap.zen.MessageviewControl.sRenderMessages = function(oRenderSerializer, oPage, tMessages, msgIndex)
{
	var lRendered = false;
	var lMsgIndex = msgIndex;
	var lMessageTypes = sap.zen.MessageviewControl.sGetMessageTypes(oPage);
	var lDisplayAll = oFF.XString.isEqual(lMessageTypes, "ALL");
	var lDisplayOnlyErrors = oFF.XString.isEqual(lMessageTypes, "ERRORS");
	if (!oFF.XString.isEqual(lMessageTypes, "NONE") && oFF.notNull(tMessages) && !tMessages.isEmpty())
	{
		oRenderSerializer.openArray("messages");
		for (var lMessageIndex = 0; lMessageIndex < tMessages.size(); lMessageIndex++)
		{
			var loMessage = tMessages.get(lMessageIndex);
			if (oFF.isNull(loMessage))
			{
				continue;
			}
			var lSeverity = loMessage.getSeverity();
			if (oFF.notNull(lSeverity))
			{
				if (lMsgIndex < 0)
				{
					lMsgIndex = 0;
				}
				if (lDisplayAll && lSeverity.isEqualTo(oFF.Severity.INFO) || lSeverity.isEqualTo(oFF.Severity.ERROR) || lSeverity.isEqualTo(oFF.Severity.SEMANTICAL_ERROR) || lSeverity.isEqualTo(oFF.Severity.WARNING) && !lDisplayOnlyErrors)
				{
					oRenderSerializer.openJsonTag();
					oRenderSerializer.openTag("message");
					oRenderSerializer.addIntegerAttribute("msg_idx", lMsgIndex);
					oRenderSerializer.addAttribute("id", "com.sap.ip.bi.zen.rt.framework.impl.services.command.resolver.PageCommandResolver-MESSAGE");
					oRenderSerializer.addAttribute("short_text", loMessage.getText());
					oRenderSerializer.addAttribute("long_text", loMessage.getText());
					oRenderSerializer.addAttribute("level", sap.zen.MessageviewControl.sTranslateMessageSeverityToLevel(lSeverity));
					oRenderSerializer.closeTag();
					oRenderSerializer.closeJsonTag();
					lMsgIndex++;
				}
			}
		}
		oRenderSerializer.closeArray();
		lRendered = true;
	}
	return lRendered;
};
sap.zen.MessageviewControl.sRenderMessageViewInfo = function(oRenderSerializer, oPage, tMessages, msgIndex)
{
	sap.zen.MessageviewControl.sRenderTexts(oRenderSerializer, oPage);
	return sap.zen.MessageviewControl.sRenderMessages(oRenderSerializer, oPage, tMessages, msgIndex);
};
