sap.zen.SDKDataSource.prototype.create = function()
{
	sap.zen.DataSource.prototype.initFieldBeforeCreate.call( this );
	if (oFF.notNull(this.moFactory.mtJsIncludes))
	{
		var jsIncudesIterator = this.moFactory.mtJsIncludes.getIterator();
		while (jsIncudesIterator.hasNext())
		{
			var next = jsIncudesIterator.next();
			this.getPage().getSDKLoader().loadJS(this.mLibraryId, next.getText());
		}
	}
	if (oFF.notNull(this.moFactory.mtCssIncludes))
	{
		var cssIncludesIterator = this.moFactory.mtCssIncludes.getIterator();
		while (cssIncludesIterator.hasNext())
		{
			var cssNext = cssIncludesIterator.next();
			this.getPage().getSDKLoader().loadCSS(this.mLibraryId, cssNext.getText());
		}
	}
	if (oFF.notNull(this.moFactory.mtProperties))
	{
		var propertiesIterator = this.moFactory.mtProperties.getIterator();
		while (propertiesIterator.hasNext())
		{
			var propertyNode = propertiesIterator.next();
			var key = propertyNode.getAttribute("id");
			var defaultValue = this.getDefaultFor(key);
			if (oFF.notNull(defaultValue) && this.getStringPropertyWithDefault(key, null) === null)
			{
				this.setStringProperty(key, defaultValue);
			}
		}
	}
};
