sap.zen.SDKDataSource.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	loRenderSerializer.addAttribute("handler_name", oFF.XStringUtils.concatenate3(this.mLibraryId, ".", this.mMyD));
	var s0 = oFF.XStringUtils.concatenate2(this.getId(), ".handleON_RESULTSETCHANGEDEvent();");
	var pvtScript0 = this.createScriptAction(s0, "");
	loRenderSerializer.addAttribute("ON_RESULTSETCHANGED", pvtScript0);
	loRenderSerializer.addAttribute("lastCallbackResult", "");
	loRenderSerializer.addAttribute("filters", "{}");
	loRenderSerializer.addAttribute("metadata", "{}");
	if (oFF.notNull(this.moFactory.mtProperties))
	{
		var propertiesIterator = this.moFactory.mtProperties.getIterator();
		while (propertiesIterator.hasNext())
		{
			var propertyNode = propertiesIterator.next();
			var key = propertyNode.getAttribute("id");
			var propertyType = propertyNode.getAttribute("type");
			var jsPropertyName = key;
			if (oFF.XString.isEqual("ScriptText", propertyType))
			{
				var s1 = oFF.XStringUtils.concatenate4(this.getId(), ".runScript('", jsPropertyName, "');");
				var pvtScript = this.createScriptAction(s1, "");
				loRenderSerializer.addAttribute(jsPropertyName, pvtScript);
			}
			else
			{
				var value = this.getStringPropertyWithDefault(key, "");
				if (oFF.XString.isEqual("Url", propertyType))
				{
					loRenderSerializer.addAttribute(jsPropertyName, this.translateUrl(value));
				}
				else if (oFF.XString.isEqual("boolean", propertyType))
				{
					var bVal = this.getBooleanPropertyWithDefault(key, false);
					loRenderSerializer.addBooleanAttribute(jsPropertyName, bVal);
				}
				else if (oFF.XString.isEqual("int", propertyType))
				{
					var intValue = this.getIntPropertyWithDefault(key, 0);
					loRenderSerializer.addIntegerAttribute(jsPropertyName, intValue);
				}
				else if (oFF.XString.isEqual("float", propertyType))
				{
					var doubleValue = this.getDoublePropertyWithDefault(key, 0.0);
					loRenderSerializer.addDoubleAttribute(jsPropertyName, doubleValue);
				}
				else
				{
					var stringValue = value;
					loRenderSerializer.addAttribute(jsPropertyName, stringValue);
				}
			}
		}
	}
};
sap.zen.SDKDataSource.prototype.doSDKPVT = function(obj)
{
	var loJsonObject = sap.buddha.XJsonObject.create(obj);
	var loJsonArray = loJsonObject.getArray();
	var lSizeOfArray = loJsonArray.size();
	for (var lArrayIndex = 0; lArrayIndex < lSizeOfArray; lArrayIndex++)
	{
		var loJsonArrayObject = loJsonArray.get(lArrayIndex);
		if (oFF.isNull(loJsonArrayObject))
		{
			continue;
		}
		var lName = loJsonArrayObject.getString();
		lArrayIndex = lArrayIndex + 1;
		var loJsonArrayObjectNext = loJsonArray.get(lArrayIndex);
		var lValue = loJsonArrayObjectNext.getString();
		this.setStringProperty(lName, lValue);
	}
	this.setContentChanged(false);
};
sap.zen.SDKDataSource.prototype.getDefaultFor = function(key)
{
	if (oFF.notNull(this.moFactory.mtDefaultValues))
	{
		var loDefaultNodeIterator = this.moFactory.mtDefaultValues.getIterator();
		while (loDefaultNodeIterator.hasNext())
		{
			var loDefaultNode = loDefaultNodeIterator.next();
			var lProperty = loDefaultNode.getAttribute("property");
			if (oFF.XString.isEqual(lProperty, key))
			{
				return loDefaultNode.getText();
			}
		}
	}
	return null;
};
