sap.zen.SelectionControl.prototype.create = function()
{
	this.mtAllSelectedItems = oFF.XList.create();
	this.mtAllHighlightedItems = oFF.XList.create();
	var listOfItems = oFF.XList.create();
	var itemsNode = this.getInitParameters().getFirstChildWithNameTag("ITEMS");
	if (oFF.notNull(itemsNode))
	{
		var itemsNodeChildren = itemsNode.getChildren("property");
		if (oFF.notNull(itemsNodeChildren))
		{
			var valuesAsIterator = itemsNodeChildren.getIterator();
			while (valuesAsIterator.hasNext())
			{
				var selectionItemNode = valuesAsIterator.next();
				if (oFF.notNull(selectionItemNode))
				{
					var children = selectionItemNode.getChildren("property");
					var valuesAsIterator2 = children.getIterator();
					var newItem = new sap.zen.ListItem();
					while (valuesAsIterator2.hasNext())
					{
						var next = valuesAsIterator2.next();
						var value = next.getAttribute("value");
						var name = next.getAttribute("name");
						if (oFF.XString.isEqual("SELECTED", name))
						{
							newItem.setSelected(oFF.XString.isEqual(value, "X"));
						}
						else if (oFF.XString.isEqual("VALUE", name))
						{
							newItem.setValue(value);
						}
						else
						{
							newItem.setText(value);
						}
					}
					listOfItems.add(newItem);
				}
			}
		}
	}
	this.setItemsInternal(listOfItems);
};
sap.zen.SelectionControl.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	loRenderSerializer.addAttribute("tooltip", this.getTooltip());
	loRenderSerializer.addBooleanAttribute("enabled", this.isEnabled());
	var lCommand = oFF.XStringUtils.concatenate2(this.getId(), ".setSelection('__arguments__');");
	var lScriptAction = this.createScriptAction(lCommand, "__KEYS__");
	loRenderSerializer.addAttribute("command", lScriptAction);
	loRenderSerializer.openTag("title");
	loRenderSerializer.closeTag();
	loRenderSerializer.openArray("selectedItems");
	if (this.mtAllSelectedItems.size() > 0)
	{
		var loAllSelectedItemsIterator = this.mtAllSelectedItems.getIterator();
		while (loAllSelectedItemsIterator.hasNext())
		{
			var loSelectedItem = loAllSelectedItemsIterator.next();
			loRenderSerializer.openTag("key");
			loRenderSerializer.addAttribute("_v", loSelectedItem.getValue());
			loRenderSerializer.closeTag();
		}
	}
	loRenderSerializer.closeArray();
	loRenderSerializer.openArray("highlightedItems");
	loRenderSerializer.closeArray();
	loRenderSerializer.openArray("items");
	if (this.mtAllItems.size() > 0)
	{
		var loAllItemsIterator = this.mtAllItems.getIterator();
		while (loAllItemsIterator.hasNext())
		{
			var loItem = loAllItemsIterator.next();
			loRenderSerializer.openTag("item");
			loRenderSerializer.addAttribute("key", loItem.getValue());
			loRenderSerializer.addAttribute("val_0", loItem.getText());
			loRenderSerializer.closeTag();
		}
	}
	loRenderSerializer.closeArray();
};
sap.zen.SelectionControl.prototype.setItemsInternal = function(tItems)
{
	this.mtAllItems = tItems;
	if (!(this.mtAllSelectedItems.size() > 0) && tItems.size() > 0)
	{
		this.mtAllSelectedItems.add(tItems.get(0));
	}
};
sap.zen.SelectionControl.prototype.setItems = function(oMemberList)
{
	this.mtAllSelectedItems.clear();
	this.mtAllItems.clear();
	var lFirstItem = true;
	while (oMemberList.hasNext())
	{
		var loMember = oMemberList.next();
		var loNewListItem = new sap.zen.ListItem();
		if (lFirstItem)
		{
			loNewListItem.setSelected(true);
			this.mtAllSelectedItems.add(loNewListItem);
		}
		loNewListItem.setText(loMember.getValue());
		loNewListItem.setValue(loMember.getKey());
		this.mtAllItems.add(loNewListItem);
		lFirstItem = false;
	}
	this.setContentChanged(true);
};
