sap.zen.SelectionControl.prototype.setSelectedValue = function(value)
{
	this.mtAllItems.getIndex(oFF.XStringValue.create(value));
	var ltItemsIterator = this.mtAllItems.getIterator();
	var lFound = false;
	while (ltItemsIterator.hasNext() && !lFound)
	{
		var loListItem = ltItemsIterator.next();
		if (oFF.XString.isEqual(loListItem.mValue, value))
		{
			this.mtAllSelectedItems.clear();
			this.mtAllSelectedItems.add(loListItem);
			lFound = true;
			this.setContentChanged(true);
		}
	}
};
