sap.zen.SelectionControl.prototype.addItem = function(value, text)
{
	this.addItem3(value, text, -1);
};
sap.zen.SelectionControl.prototype.addItem3 = function(value, text, index)
{
	var loListItem = new sap.zen.ListItem();
	loListItem.setText(text);
	loListItem.setValue(value);
	loListItem.setSelected(false);
	if (index < 0 || index >= this.mtAllItems.size())
	{
		this.mtAllItems.add(loListItem);
	}
	else
	{
		this.mtAllItems.insert(index, loListItem);
	}
	if (this.mtAllItems.size() === 1)
	{
		this.mtAllSelectedItems.add(loListItem);
	}
	this.setContentChanged(true);
};
sap.zen.SelectionControl.prototype.removeItem = function(value)
{
	var loAllItemsIterator = this.mtAllItems.getIterator();
	var i = 0;
	var lFound = false;
	var loListItem = null;
	i = 0;
	lFound = false;
	var lSelectedWasRemoved = false;
	while (loAllItemsIterator.hasNext() && !lFound)
	{
		loListItem = loAllItemsIterator.next();
		if (oFF.XString.isEqual(loListItem.getValue(), value))
		{
			this.mtAllItems.removeAt(i);
			lFound = true;
			if (!this.getBooleanPropertyWithDefault("MULTI_SELECTION", false))
			{
				lSelectedWasRemoved = loListItem.isSelected();
			}
		}
		i++;
	}
	if (lFound)
	{
		loAllItemsIterator = this.mtAllSelectedItems.getIterator();
		i = 0;
		lFound = false;
		while (loAllItemsIterator.hasNext() && !lFound)
		{
			loListItem = loAllItemsIterator.next();
			if (oFF.XString.isEqual(loListItem.getValue(), value))
			{
				this.mtAllSelectedItems.removeAt(i);
				lFound = true;
			}
			i++;
		}
		lFound = true;
	}
	if (lFound && !this.getBooleanPropertyWithDefault("MULTI_SELECTION", false) && lSelectedWasRemoved)
	{
		if (this.mtAllItems.size() > 0)
		{
			var loItemObject = this.mtAllItems.get(0);
			this.mtAllSelectedItems.add(loItemObject);
		}
	}
	this.setContentChanged(true);
};
sap.zen.SelectionControl.prototype.removeAllItems = function()
{
	this.mtAllItems.clear();
	this.mtAllSelectedItems.clear();
	this.mtAllHighlightedItems.clear();
	this.setContentChanged(true);
};

