sap.zen.GlobalScriptsControl.prototype._ff_c = "GlobalScriptsControl";

sap.zen.GlobalScriptsControl.prototype.create = function()
{
	if (this.getInitParameters() !== null)
	{
		var lName = this.getId();
		var lScript = "new function(){";
		var loFunctionNodes = this.getInitParameters().getFirstChildWithNameTag("FUNCTIONS");
		if (oFF.notNull(loFunctionNodes))
		{
			var ltFunctionNodes = loFunctionNodes.getChildren("property");
			for (var lFunctionNodeIndex = 0; lFunctionNodeIndex < ltFunctionNodes.size(); lFunctionNodeIndex++)
			{
				var loFunctionNode = ltFunctionNodes.get(lFunctionNodeIndex);
				if (oFF.isNull(loFunctionNode))
				{
					continue;
				}
				var loFunctionNameNode = loFunctionNode.getFirstChildWithNameTag("NAME");
				var lFunctionName = loFunctionNameNode.getAttribute("value");
				lScript = oFF.XStringUtils.concatenate4(lScript, "this.", lFunctionName, " = function(");
				var loFunctionBodyNode = loFunctionNode.getFirstChildWithNameTag("FUNCTION_BODY");
				var loValueNode = loFunctionBodyNode.getFirstChild("value");
				var lValueNodeScript = loValueNode.getText();
				var loInputParametersNode = loFunctionNode.getFirstChildWithNameTag("INPUT_PARAMETERS");
				if (oFF.notNull(loInputParametersNode))
				{
					var loInputParameterNodes = loInputParametersNode.getChildren("property");
					for (var lInputParameterNodeIndex = 0; lInputParameterNodeIndex < loInputParameterNodes.size(); lInputParameterNodeIndex++)
					{
						var loInputParameterNode = loInputParameterNodes.get(lInputParameterNodeIndex);
						if (oFF.isNull(loInputParameterNode))
						{
							continue;
						}
						if (lInputParameterNodeIndex > 0)
						{
							lScript = oFF.XStringUtils.concatenate2(lScript, ",");
						}
						var loInputParameterNameNode = loInputParameterNode.getFirstChildWithNameTag("NAME");
						var lInputParameterName = loInputParameterNameNode.getAttribute("value");
						lScript = oFF.XStringUtils.concatenate2(lScript, lInputParameterName);
					}
				}
				lScript = oFF.XStringUtils.concatenate2(lScript, "){");
				lScript = oFF.XStringUtils.concatenate2(lScript, lValueNodeScript);
				lScript = oFF.XStringUtils.concatenate2(lScript, "\n};");
			}
		}
		lScript = oFF.XStringUtils.concatenate2(lScript, "};");
		this.getPage().getWindow().putGlobalScriptInContext(lName, lScript);
	}
};
sap.zen.GlobalScriptsControl.prototype.renderControlContent = function(oRenderManager) {};
sap.zen.GlobalScriptsControl.prototype.addToContainerChildren = function()
{
	return false;
};

