sap.zen.ContainerComponent.prototype.createChildren = function()
{
	this.mtChildren = oFF.XList.create();
	var loRootNode = this.getInitParameters();
	if (oFF.isNull(loRootNode))
	{
		return;
	}
	var ltComponentNodes = loRootNode.getChildren("component");
	var loComponentNodeIterator = ltComponentNodes.getIterator();
	while (loComponentNodeIterator.hasNext())
	{
		var loComponentNode = loComponentNodeIterator.next();
		var loComponent = this.getPage().createComponentObject(loComponentNode, this);
		if (oFF.notNull(loComponent) && loComponent.addToContainerChildren())
		{
			this.mtChildren.add(loComponent);
		}
	}
};
sap.zen.ContainerComponent.prototype.createChildrenRegardingChildItemRefList = function()
{
	if (oFF.notNull(this.mtChildNames))
	{
		this.mtChildren = oFF.XList.create();
		for (var lChildNameIndex = 0; lChildNameIndex < this.mtChildNames.size(); lChildNameIndex++)
		{
			var lComponentName = this.mtChildNames.get(lChildNameIndex);
			if (oFF.isNull(lComponentName))
			{
				continue;
			}
			var loComponent = this.getPage().getComponent(lComponentName);
			if (oFF.notNull(loComponent) && loComponent.addToContainerChildren())
			{
				loComponent.setParent(this);
				this.mtChildren.add(loComponent);
			}
		}
		this.mtChildNames = null;
	}
};
sap.zen.ContainerComponent.prototype.setContentChangedRecursive = function()
{
	this.setContentChanged(true);
	if (oFF.notNull(this.mtChildren))
	{
		for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
		{
			var loComponent = this.mtChildren.get(lChildIndex);
			if (oFF.isNull(loComponent))
			{
				continue;
			}
			loComponent.setContentChangedRecursive();
		}
	}
};
sap.zen.ContainerComponent.prototype.renderChildren = function(oRenderManager)
{
	if (!this.isVisible())
	{
		return;
	}
	this.createChildrenRegardingChildItemRefList();
	for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
	{
		var loComponent = this.mtChildren.get(lChildIndex);
		if (oFF.isNull(loComponent))
		{
			continue;
		}
		if (loComponent.isVisible() || loComponent.renderEvenIfNotVisible())
		{
			if (this.isContentChanged())
			{
				if (loComponent.hasChildrenContentChanged())
				{
					loComponent.setContentChanged(true);
				}
				else
				{
					loComponent.setRenderOnlyPlaceholder(true);
				}
			}
			loComponent.renderComponentInternal(oRenderManager);
		}
	}
};
sap.zen.ContainerComponent.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	loRenderSerializer.openArray("content");
	if (this.isRenderEmptyContent() === false)
	{
		this.createChildrenRegardingChildItemRefList();
		this.renderChildren(oRenderManager);
	}
	loRenderSerializer.closeArray();
};
