sap.zen.DialogControl.prototype.renderControlProperties = function(oRenderSerializer)
{
	oRenderSerializer.addAttribute("title", this.getTitle());
	oRenderSerializer.addBooleanAttribute("draggable", this.getIsDraggable());
	oRenderSerializer.addBooleanAttribute("resizable", this.getIsResizable());
	oRenderSerializer.addBooleanAttribute("fullscreen", this.getIsFullscreen());
	oRenderSerializer.addBooleanAttribute("show", this.isOpen());
};
sap.zen.DialogControl.prototype.renderButtonsCollection = function(oRenderSerializer)
{
	oRenderSerializer.openArray("Buttons");
	if (this.mtButtons.size() > 0)
	{
		var loButtonIterator = this.mtButtons.getIterator();
		while (loButtonIterator.hasNext())
		{
			var loButton = loButtonIterator.next();
			if (oFF.isNull(loButton))
			{
				continue;
			}
			oRenderSerializer.openTag("Button");
			oRenderSerializer.addAttribute("buttonkey", loButton.getKey());
			oRenderSerializer.addAttribute("text", loButton.getText());
			if (loButton.isEnabled())
			{
				oRenderSerializer.addAttribute("buttonenabled", "X");
			}
			else
			{
				oRenderSerializer.addAttribute("buttonenabled", "");
			}
			if (loButton.isVisible())
			{
				oRenderSerializer.addAttribute("buttonvisible", "X");
			}
			else
			{
				oRenderSerializer.addAttribute("buttonvisible", "");
			}
			var lOnButtonClickAction = oFF.XStringUtils.concatenate2(this.getId(), ".onDlgBtnClick(__arguments__);");
			var lArguments = oFF.XStringUtils.concatenate2("\"", loButton.getKey());
			lArguments = oFF.XStringUtils.concatenate2(lArguments, "\"");
			lOnButtonClickAction = this.createScriptAction(lOnButtonClickAction, lArguments);
			oRenderSerializer.addAttribute("onclick", lOnButtonClickAction);
			oRenderSerializer.closeTag();
		}
	}
	oRenderSerializer.closeArray();
};
sap.zen.DialogControl.prototype.getButtons = function()
{
	var ltButtons = oFF.XList.create();
	var loButtonsNode = this.getInitParameters().getFirstChildWithNameTag("DIALOGBUTTONS");
	if (oFF.isNull(loButtonsNode))
	{
		return ltButtons;
	}
	var ltButtonNodes = loButtonsNode.getChildren("property");
	if (oFF.isNull(ltButtonNodes))
	{
		return ltButtons;
	}
	var loButtonNodeIterator = ltButtonNodes.getIterator();
	while (loButtonNodeIterator.hasNext())
	{
		var loButtonNode = loButtonNodeIterator.next();
		if (oFF.isNull(loButtonNode))
		{
			continue;
		}
		var loButton = new sap.zen.DialogButtonItem();
		var valueNode = loButtonNode.getFirstChildWithNameTag("VALUE");
		if (oFF.notNull(valueNode))
		{
			loButton.setKey(valueNode.getAttribute("value"));
		}
		if (oFF.XStringUtils.isNullOrEmpty(loButton.getKey()))
		{
			var lButtonKey = loButtonNode.getAttribute("value");
			if (oFF.notNull(lButtonKey))
			{
				loButton.setKey(lButtonKey);
			}
		}
		var textNode = loButtonNode.getFirstChildWithNameTag("TEXT");
		if (oFF.notNull(textNode))
		{
			loButton.setText(textNode.getAttribute("value"));
		}
		var enNode = loButtonNode.getFirstChildWithNameTag("ENABLED");
		if (oFF.notNull(enNode))
		{
			loButton.setEnabled(oFF.XString.isEqual(enNode.getAttribute("value"), "X"));
		}
		else
		{
			loButton.setEnabled(true);
		}
		var visNode = loButtonNode.getFirstChildWithNameTag("VISIBLE");
		if (oFF.notNull(visNode))
		{
			loButton.setVisible(oFF.XString.isEqual(visNode.getAttribute("value"), "X"));
		}
		else
		{
			loButton.setVisible(true);
		}
		var actionNode = loButtonNode.getFirstChildWithNameTag("ON_CLICK");
		if (oFF.notNull(actionNode))
		{
			var actionValue = actionNode.getChildren("value");
			if (oFF.notNull(actionValue))
			{
				var action = actionValue.get(0).getText();
				if (oFF.XStringUtils.isNotNullAndNotEmpty(action))
				{
					loButton.setOnClickAction(action);
				}
			}
		}
		ltButtons.add(loButton);
	}
	return ltButtons;
};
