sap.zen.FilterBarControl.prototype.processControlSpecificAddDimensions = function()
{
	if (!this.getPage().isDesignMode())
	{
		var dimensionsConfig = this.getDimensionsConfig();
		var dataSourceName = this.getDataSource();
		var loDataSource = null;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(dataSourceName))
		{
			loDataSource = this.getPage().getDataSource(dataSourceName);
			loDataSource.addDataSourceChangeListener(this, null);
		}
		if (oFF.notNull(loDataSource))
		{
			var loQueryManager = loDataSource.getQueryManager();
			if (oFF.notNull(loQueryManager))
			{
				if (this.mCreateFilters)
				{
					this.mCreateFilters = false;
					this.removeAllComponents();
					if (oFF.XString.isEqual(dimensionsConfig, "") || oFF.XString.isEqual(dimensionsConfig, "[]"))
					{
						var ltDimensions = loQueryManager.getQueryModel().getFilter().getDimensionAccessor().getDimensions();
						var lDimensionIndex = 0;
						var loDimension = null;
						var ltDimensionsSorted = oFF.XList.create();
						var lKeyfigureDimension = null;
						for (lDimensionIndex = 0; lDimensionIndex < ltDimensions.size(); lDimensionIndex++)
						{
							loDimension = ltDimensions.get(lDimensionIndex);
							if (oFF.isNull(loDimension))
							{
								continue;
							}
							if (loDimension.isMeasureStructure())
							{
								lKeyfigureDimension = loDimension;
								continue;
							}
							ltDimensionsSorted.add(loDimension);
						}
						var lComparator = new sap.zen.SortDimensionsAscByTextComparator();
						ltDimensionsSorted.sortByComparator(lComparator);
						if (oFF.notNull(lKeyfigureDimension))
						{
							ltDimensionsSorted.add(lKeyfigureDimension);
						}
						for (lDimensionIndex = 0; lDimensionIndex < ltDimensionsSorted.size(); lDimensionIndex++)
						{
							loDimension = ltDimensionsSorted.get(lDimensionIndex);
							if (oFF.isNull(loDimension))
							{
								continue;
							}
							if (!sap.zen.DataSourceScriptApiUtils.isViewableDimension(loDimension))
							{
								continue;
							}
							if (loDimension.supportsAxis(oFF.AxisType.ROWS) || loDimension.isMeasureStructure())
							{
								this.createDimFilter(dataSourceName, loDimension.getName(), this.getTargetDataSource(), loDimension);
							}
						}
					}
					else if (oFF.notNull(dimensionsConfig))
					{
						var jsonParser = this.getJsonParser();
						var dimensionsConfigList = sap.zen.CharacteristicConfig.parseJSON(jsonParser, dimensionsConfig);
						var dimensionsIterator = dimensionsConfigList.getIterator();
						while (dimensionsIterator.hasNext())
						{
							var cconfig = dimensionsIterator.next();
							this.createDimFilter(dataSourceName, cconfig.getName(), this.getTargetDataSource(), null);
						}
					}
				}
			}
		}
	}
};
