sap.zen.GridlayoutControl.prototype.create = function()
{
	sap.zen.ContainerComponent.prototype.create.call( this );
	this.getPage().addRequireModule("zen.rt.components/resources/js/gridlayout_handler");
	var lUid = oFF.XStringUtils.concatenate2(this.getName(), "_grid");
	this.initControl(lUid, "gridlayout");
	this.mtColumnNodeChildren = oFF.XListOfString.create();
	this.mtRowNodeChildren = oFF.XListOfString.create();
	var loRootNode = this.getInitParameters();
	if (oFF.notNull(loRootNode))
	{
		var loSettingsNode = null;
		var ltChildNode = null;
		var loChildNodeIterator = null;
		var loChildNode = null;
		loSettingsNode = loRootNode.getFirstChildWithNameTag("COLUMN_SETTINGS_LIST");
		if (oFF.notNull(loSettingsNode))
		{
			ltChildNode = loSettingsNode.getChildren("property");
			loChildNodeIterator = ltChildNode.getIterator();
			while (loChildNodeIterator.hasNext())
			{
				loChildNode = loChildNodeIterator.next();
				this.mtColumnNodeChildren.add(loChildNode.getAttribute("value"));
			}
		}
		loSettingsNode = loRootNode.getFirstChildWithNameTag("ROW_SETTINGS_LIST");
		if (oFF.notNull(loSettingsNode))
		{
			ltChildNode = loSettingsNode.getChildren("property");
			loChildNodeIterator = ltChildNode.getIterator();
			while (loChildNodeIterator.hasNext())
			{
				loChildNode = loChildNodeIterator.next();
				this.mtRowNodeChildren.add(loChildNode.getAttribute("value"));
			}
		}
	}
};
sap.zen.GridlayoutControl.prototype.createGrid = function(rows, cols, tRowNodeChildren, tColNodeChildren)
{
	var lRowIndex = 0;
	var lColIndex = 0;
	var lUidIndex = 0;
	for (lRowIndex = 0; lRowIndex < rows; lRowIndex++)
	{
		this.mtRowNodeChildren.add(tRowNodeChildren.get(lRowIndex));
		for (lColIndex = 0; lColIndex < cols; lColIndex++)
		{
			var lUid = oFF.XStringUtils.concatenate2("gc", oFF.XInteger.convertToString(lUidIndex));
			lUidIndex = lUidIndex + 1;
			var loGridCellComponent = null;
			if (this.mSfinMode && lRowIndex === this.mRowIndexForCellSimple)
			{
				loGridCellComponent = this.getPage().createComponentObjectWOInitParameter("GRID_CELL_SIMPLE_COMPONENT", lUid, this);
			}
			else
			{
				loGridCellComponent = this.getPage().createComponentObjectWOInitParameter("GRID_CELL_COMPONENT", lUid, this);
			}
			this.addChild(loGridCellComponent);
		}
	}
	for (lColIndex = 0; lColIndex < cols; lColIndex++)
	{
		this.mtColumnNodeChildren.add(tColNodeChildren.get(lColIndex));
	}
};
sap.zen.GridlayoutControl.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	this.renderControlSpecificContent(loRenderSerializer);
	sap.zen.ContainerComponent.prototype.renderControlContent.call( this , oRenderManager);
};
sap.zen.GridlayoutControl.prototype.renderControlSpecificContent = function(oRenderSerializer)
{
	oRenderSerializer.openArray("rows");
	for (var lRowIndex = 0; lRowIndex < this.mtRowNodeChildren.size(); lRowIndex++)
	{
		var lRow = this.mtRowNodeChildren.get(lRowIndex);
		oRenderSerializer.openTag("row");
		oRenderSerializer.addAttribute("height", lRow);
		oRenderSerializer.closeTag();
	}
	oRenderSerializer.closeArray();
	oRenderSerializer.openArray("cols");
	for (var lColIndex = 0; lColIndex < this.mtColumnNodeChildren.size(); lColIndex++)
	{
		var lCol = this.mtColumnNodeChildren.get(lColIndex);
		oRenderSerializer.openTag("col");
		oRenderSerializer.addAttribute("width", lCol);
		oRenderSerializer.closeTag();
	}
	oRenderSerializer.closeArray();
};
