sap.zen.GridlayoutControl.prototype.moveComponent = function(x, y, object)
{
	var lColumns = this.mtColumnNodeChildren.size();
	var lRows = this.mtRowNodeChildren.size();
	if (y >= lColumns || x >= lRows)
	{
		sap.zen.CLocalizationGridLayoutMessages.GRIDLAYOUT_INVALIDCELLINDEX.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, null, null, null);
		return;
	}
	var lIndex = y * lColumns + x;
	var loContainerComponent = this.mtChildren.get(lIndex);
	loContainerComponent.moveComponentToParent(object);
};

