	var loProjectionInformation = sap.zen.ProjectionInformation.create(this.getId(), "resultset", lCurrentSelection);
	loProjectionInformation.setOption("includeMetadata", "true");
	loProjectionInformation.setOption("fillMetadataProperty", "false");
	loProjectionInformation.setOption("includeAxesTuples", "true");
	loProjectionInformation.setOption("presentationDelimiter", " ");
	loProjectionInformation.setOption("includeResults", oFF.XBoolean.convertToString(resultsVisible));
	loProjectionInformation.setOption("swapAxes", oFF.XBoolean.convertToString(this.isAxisSwapped()));
	var ltProjectionInformation = oFF.XList.create();
	ltProjectionInformation.add(loProjectionInformation);
	oDataSource.renderResultSetAsJSONs(oRenderManager, ltProjectionInformation, false);
