sap.zen.Html5ChartControl.prototype.getSelectedMember = function(dimensionName)
{
	var loScriptableMember = null;
	if (oFF.isNull(this.mtMembers) || this.mtMembers.size() === 0)
	{
		loScriptableMember = sap.zen.ScriptableMember.createForDimensionMemberName("");
		return loScriptableMember;
	}
	for (var lMemberIndex = 0; lMemberIndex < this.mtMembers.size(); lMemberIndex++)
	{
		var loMember = this.mtMembers.get(lMemberIndex);
		if (oFF.isNull(loMember))
		{
			continue;
		}
		if (oFF.XString.isEqual(loMember.getKey(), dimensionName))
		{
			loScriptableMember = sap.zen.ScriptableMember.createForDimensionMemberName(loMember.getValue());
			return loScriptableMember;
		}
	}
	return null;
};
sap.zen.Html5ChartControl.prototype.getSelectedMembers = function(dimensionName)
{
	if (this.mtAllMembers.isEmpty() || this.mtAllMembers.getByKey(dimensionName) === null)
	{
		return this.getPage().getWindow().createJSArray(oFF.XList.create());
	}
	var ltMembers = oFF.XList.create();
	var loListMembers = this.mtAllMembers.getByKey(dimensionName);
	for (var lListIndex = 0; lListIndex < loListMembers.size(); lListIndex++)
	{
		var loStructureMember = loListMembers.getStructureAt(lListIndex);
		if (oFF.isNull(loStructureMember))
		{
			continue;
		}
		var loScriptableMember = sap.zen.ScriptableMember.createForDimensionMemberName(loStructureMember.getStringByKey("key"));
		ltMembers.add(loScriptableMember);
	}
	return this.getPage().getWindow().createJSArray(ltMembers);
};
