sap.zen.Html5ChartControl.prototype.getAdditionalProperty = function()
{
	var lAdditionalProperties = this.getAdditionalProperties();
	if (this.isAdditionalPropertyAtt())
	{
		return this.updateAdditionalProp();
	}
	return lAdditionalProperties;
};
sap.zen.Html5ChartControl.prototype.isAdditionalPropertyAtt = function()
{
	var lAdditionalPropertyAtt = this.getAdditionalPropertyAtt();
	var lAdditionalPropertyValue = this.getAdditionalPropertyValue();
	if (oFF.notNull(lAdditionalPropertyAtt) && oFF.XString.size(lAdditionalPropertyAtt) > 0 && oFF.notNull(lAdditionalPropertyValue) && oFF.XString.size(lAdditionalPropertyValue) > 0)
	{
		return true;
	}
	return false;
};
sap.zen.Html5ChartControl.prototype.updateAdditionalProp = function()
{
	if (oFF.XString.containsString(this.getAdditionalProperties(), this.mapAdditionalProperties(this.getAdditionalPropertyAtt())))
	{
		return this.replaceAdditionalProp();
	}
	return this.addAdditionalProp();
};
sap.zen.Html5ChartControl.prototype.addAdditionalProp = function()
{
	var lAdditionalProperties = this.getAdditionalProperties();
	var lAdditionalPropSubstring = "{";
	if (oFF.notNull(lAdditionalProperties) && oFF.XString.size(lAdditionalProperties) > 0)
	{
		lAdditionalPropSubstring = oFF.XString.substring(lAdditionalProperties, 0, oFF.XString.size(lAdditionalProperties) - 1);
		lAdditionalPropSubstring = oFF.XStringUtils.concatenate2(lAdditionalPropSubstring, ",");
	}
	var additionalPropertyMapped = "";
	additionalPropertyMapped = oFF.XStringUtils.concatenate2(additionalPropertyMapped, this.getQuotedValue(this.mapAdditionalProperties(this.getAdditionalPropertyAtt())));
	additionalPropertyMapped = oFF.XStringUtils.concatenate2(additionalPropertyMapped, ":");
	lAdditionalPropSubstring = oFF.XStringUtils.concatenate2(lAdditionalPropSubstring, additionalPropertyMapped);
	if (oFF.XString.isEqual(this.getAdditionalPropertyValue(), "true") || oFF.XString.isEqual(this.getAdditionalPropertyValue(), "false"))
	{
		lAdditionalPropSubstring = oFF.XStringUtils.concatenate2(lAdditionalPropSubstring, this.getAdditionalPropertyValue());
	}
	else
	{
		lAdditionalPropSubstring = oFF.XStringUtils.concatenate2(lAdditionalPropSubstring, this.getQuotedValue(this.getAdditionalPropertyValue()));
	}
	lAdditionalPropSubstring = oFF.XStringUtils.concatenate2(lAdditionalPropSubstring, "}");
	return lAdditionalPropSubstring;
};
sap.zen.Html5ChartControl.prototype.replaceAdditionalProp = function()
{
	var lAdditionalProperties = this.getAdditionalProperties();
	var lIndex1 = oFF.XString.indexOf(lAdditionalProperties, this.mapAdditionalProperties(this.getAdditionalPropertyAtt()));
	var lAdditionalPropertiesSub = oFF.XString.substring(lAdditionalProperties, lIndex1, oFF.XString.size(lAdditionalProperties));
	var lIndex2 = oFF.XString.indexOf(lAdditionalPropertiesSub, ",") + lIndex1 - 1;
	var lAdditionalProp1 = oFF.XString.substring(lAdditionalProperties, 0, lIndex1 + oFF.XString.size(this.mapAdditionalProperties(this.getAdditionalPropertyAtt())) + 1);
	var lAdditionalProp2 = oFF.XString.substring(lAdditionalProperties, lIndex2, oFF.XString.size(lAdditionalProperties));
	var lAdditionalConcat = "";
	if (oFF.XString.isEqual(this.getAdditionalPropertyValue(), "true") || oFF.XString.isEqual(this.getAdditionalPropertyValue(), "false"))
	{
		lAdditionalConcat = oFF.XStringUtils.concatenate2(lAdditionalProp1, this.getAdditionalPropertyValue());
	}
	else
	{
		lAdditionalConcat = oFF.XStringUtils.concatenate2(lAdditionalProp1, this.getQuotedValue(this.getAdditionalPropertyValue()));
	}
	lAdditionalConcat = oFF.XStringUtils.concatenate2(lAdditionalConcat, lAdditionalProp2);
	return lAdditionalConcat;
};
sap.zen.Html5ChartControl.prototype.getQuotedValue = function(value)
{
	var lAdditionalValue = "";
	lAdditionalValue = oFF.XStringUtils.concatenate2(lAdditionalValue, "\"");
	lAdditionalValue = oFF.XStringUtils.concatenate2(lAdditionalValue, value);
	lAdditionalValue = oFF.XStringUtils.concatenate2(lAdditionalValue, "\"");
	return lAdditionalValue;
};
sap.zen.Html5ChartControl.prototype.renderNewChartOptions = function(oRenderSerializer)
{
	var loChartTypeNode = this.getChartTypeNode(true);
	if (oFF.notNull(loChartTypeNode))
	{
		this.renderNodeAsJSON(loChartTypeNode, oRenderSerializer, "newChartOptions");
	}
};
sap.zen.Html5ChartControl.prototype.renderNodeAsJSON = function(oNode, oRenderSerializer, name)
{
	var lName = name;
	if (oFF.isNull(lName))
	{
		lName = oNode.getAttribute("name");
	}
	var tPropertyNodes = oNode.getChildren("property");
	if (tPropertyNodes.size() > 0)
	{
		oRenderSerializer.openTag(lName);
		for (var lPropertyNodeIndex = 0; lPropertyNodeIndex < tPropertyNodes.size(); lPropertyNodeIndex++)
		{
			var loPropertyNode = tPropertyNodes.get(lPropertyNodeIndex);
			if (oFF.isNull(loPropertyNode))
			{
				continue;
			}
			this.renderNodeAsJSON(loPropertyNode, oRenderSerializer, null);
		}
		oRenderSerializer.closeTag();
	}
	else
	{
		if (oFF.XString.isEqual(oNode.getAttribute("value"), "X"))
		{
			oRenderSerializer.addBooleanAttribute(lName, true);
		}
		else
		{
			oRenderSerializer.addAttribute(lName, oNode.getAttribute("value"));
		}
	}
};
sap.zen.Html5ChartControl.prototype.getNewChartOption = function(path)
{
	var lValue = null;
	var ltPath = this.getNewChartOptionsPaths(path);
	var loChartTypeNode = this.getChartTypeNode(true);
	if (oFF.notNull(loChartTypeNode))
	{
		loChartTypeNode = this.getNodeValue(loChartTypeNode, ltPath);
		if (oFF.notNull(loChartTypeNode))
		{
			lValue = loChartTypeNode.getAttribute("value");
		}
	}
	return lValue;
};
sap.zen.Html5ChartControl.prototype.addToNewChartOptionsXml = function(path, value)
{
	var loChartTypeNode = this.getChartTypeNode(true);
	if (oFF.notNull(loChartTypeNode))
	{
		var loNode = this.findOrCreateNode(loChartTypeNode, this.getNewChartOptionsPaths(path));
		loNode.setAttribute("value", value);
	}
};
sap.zen.Html5ChartControl.prototype.getNewChartOptionsPaths = function(path)
{
	var ltPath = oFF.XStringTokenizer.splitString(path, ".");
	ltPath.insert(0, "properties");
	return ltPath;
};
sap.zen.Html5ChartControl.prototype.getChartTypeNode = function(create)
{
	var loChartTypeNode = null;
	if (this.getPropertyNode("TYPE") === null)
	{
		this.setStringProperty("TYPE", this.getChartType());
	}
	var loTypeNode = this.getPropertyNode("TYPE");
	var lChartType = loTypeNode.getAttribute("value");
	loChartTypeNode = loTypeNode.getFirstChildWithNameTag(lChartType);
	if (oFF.isNull(loChartTypeNode) && create)
	{
		var ltPath = oFF.XListOfString.create();
		ltPath.add(lChartType);
		loChartTypeNode = this.createNodes(loTypeNode, ltPath);
	}
	return loChartTypeNode;
};
sap.zen.Html5ChartControl.prototype.findOrCreateNode = function(oNode, tPath)
{
	var lNodeName = tPath.get(0);
	var loNode = this.findNodeWithName(oNode, lNodeName);
	if (oFF.isNull(loNode))
	{
		loNode = this.createNodes(oNode, tPath);
	}
	else if (tPath.size() > 1)
	{
		tPath.removeAt(0);
		loNode = this.findOrCreateNode(loNode, tPath);
	}
	return loNode;
};
sap.zen.Html5ChartControl.prototype.getNodeValue = function(oParentNode, tPath)
{
	var lNodeName = tPath.get(0);
	var loNode = this.findNodeWithName(oParentNode, lNodeName);
	if (oFF.notNull(loNode) && tPath.size() > 1)
	{
		tPath.removeAt(0);
		loNode = this.getNodeValue(loNode, tPath);
	}
	return loNode;
};
sap.zen.Html5ChartControl.prototype.createNodes = function(oParentNode, tPath)
{
	var lNodeName = tPath.get(0);
	var loNode = oParentNode.createChildWithNameTag(lNodeName);
	if (tPath.size() > 1)
	{
		tPath.removeAt(0);
		loNode = this.createNodes(loNode, tPath);
	}
	return loNode;
};
sap.zen.Html5ChartControl.prototype.findNodeWithName = function(oParentNode, name)
{
	var loNode = null;
	var ltPropertyNodes = oParentNode.getChildren("property");
	for (var lPropertyNodeIndex = 0; lPropertyNodeIndex < ltPropertyNodes.size() && oFF.isNull(loNode); lPropertyNodeIndex++)
	{
		var loPropertyNode = ltPropertyNodes.get(lPropertyNodeIndex);
		if (oFF.isNull(loPropertyNode))
		{
			continue;
		}
		if (oFF.XString.isEqual(name, loPropertyNode.getAttribute("name")))
		{
			loNode = loPropertyNode;
		}
	}
	return loNode;
};

