sap.zen.ImageTableControl.prototype.renderControlContent = function(oRenderManager)
{
	var loDataSource = this.getDataSource();
	if (oFF.isNull(loDataSource))
	{
		return;
	}
	var loQueryManager = loDataSource.getQueryManager();
	if (oFF.isNull(loQueryManager))
	{
		return;
	}
	var loQueryModel = loQueryManager.getQueryModel();
	if (oFF.isNull(loQueryModel))
	{
		return;
	}
	var lDimensionName = this.getStringPropertyWithDefault("DIMENSION_NAME", "");
	var loDimension = sap.zen.Dimension.sGetDimension(this.getDataSource(), lDimensionName);
	if (oFF.isNull(loDimension))
	{
		return;
	}
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(), loQueryManager, "ImageTableControl renderControlContent");
	var loResultSet = this.getDataSource().getResultSet();
	var lAmountOfTuples = loResultSet.getAmountOfTuplesOnAxis(oFF.AxisType.ROWS);
	loRenderSerializer.openArray("images");
	for (var lTupleIndex = 0; lTupleIndex < lAmountOfTuples; lTupleIndex++)
	{
		var loTupleWrapper = loResultSet.getTuple(oFF.AxisType.ROWS, lTupleIndex, null, null);
		if (oFF.isNull(loTupleWrapper))
		{
			continue;
		}
		var loTupleElementWrapper = loTupleWrapper.getTupleElement(-1, loDimension);
		var loDimensionMember = loTupleElementWrapper.getDimensionMember();
		var lDimensionMemberName = loDimensionMember.getName();
		if (oFF.XString.size(lDimensionMemberName) > 0)
		{
			loRenderSerializer.openJsonTag();
			loRenderSerializer.addAttribute("image", lDimensionMemberName);
			loRenderSerializer.closeJsonTag();
		}
	}
	loRenderSerializer.closeArray();
	loRenderSerializer.addBooleanAttribute("enabled", this.isEnabled());
};

