sap.zen.PagebookControl.prototype.setSelectedPageByName = function(pageName)
{
	var loChildIterator = this.mtChildren.getIterator();
	var lFound = false;
	var i = 0;
	while (loChildIterator.hasNext() && !lFound)
	{
		var loChild = loChildIterator.next();
		var name = loChild.getName();
		if (oFF.XString.isEqual(pageName, name))
		{
			this.setSelectedPageIndex(i);
			lFound = true;
		}
		i++;
	}
};
