sap.zen.SDKControl.prototype.create = function()
{
	sap.zen.DataProviderReferenceComponent.prototype.create.call( this );
	var lType = "";
	if (oFF.XString.isEqual("div", this.moFactory.mHandlerType))
	{
		lType = "sdk";
		this.getPage().addRequireModule("zen.rt.components.sdk/resources/js/sdk_handler");
	}
	else if (oFF.XString.isEqual("sapui5", this.moFactory.mHandlerType))
	{
		lType = "sdkui5";
		this.getPage().addRequireModule("zen.rt.components.sdk/resources/js/sdkui5_handler");
	}
	var lUid = oFF.XStringUtils.concatenate2(this.getName(), "_control");
	this.initControl(lUid, lType);
	if (oFF.notNull(this.moFactory.mtJsIncludes))
	{
		var loJsIncludeNodeIterator = this.moFactory.mtJsIncludes.getIterator();
		var loSDKLoader = this.getPage().getSDKLoader();
		while (loJsIncludeNodeIterator.hasNext())
		{
			var loJsIncludeNode = loJsIncludeNodeIterator.next();
			var lUrl = loJsIncludeNode.getText();
			if (this.moFactory.isBuiltIn())
			{
				loSDKLoader.loadBuiltInJs(lUrl);
			}
			else
			{
				loSDKLoader.loadJS(this.moFactory.mLibraryId, lUrl);
			}
		}
	}
	if (oFF.notNull(this.moFactory.mtCssIncludes))
	{
		var loCssIncludeNodeIterator = this.moFactory.mtCssIncludes.getIterator();
		while (loCssIncludeNodeIterator.hasNext())
		{
			var loCssIncludeNode = loCssIncludeNodeIterator.next();
			this.getPage().getSDKLoader().loadCSS(this.moFactory.mLibraryId, loCssIncludeNode.getText());
		}
	}
	if (oFF.notNull(this.moFactory.mtRequireJs))
	{
		var loRequireJsNodeIterator = this.moFactory.mtRequireJs.getIterator();
		while (loRequireJsNodeIterator.hasNext())
		{
			var loRequireJsNode = loRequireJsNodeIterator.next();
			var lModes = loRequireJsNode.getAttribute("modes");
			var splitString = oFF.XStringTokenizer.splitString(lModes, " ");
			var lLoad = splitString.contains("m");
			var lModule = loRequireJsNode.getText();
			if (lLoad)
			{
				if (!this.moFactory.isBuiltIn())
				{
					lModule = oFF.XStringUtils.concatenate4("sdk_include/", this.moFactory.mLibraryId, "/", lModule);
				}
				this.getPage().addRequireModule(lModule);
			}
		}
	}
	if (oFF.notNull(this.moFactory.mtProperties))
	{
		var propertiesIterator = this.moFactory.mtProperties.getIterator();
		while (propertiesIterator.hasNext())
		{
			var propertyNode = propertiesIterator.next();
			var key = propertyNode.getAttribute("id");
			var defaultValue = this.getDefaultFor(key);
			if (oFF.notNull(defaultValue) && this.getStringPropertyWithDefault(key, null) === null)
			{
				this.setStringProperty(key, defaultValue);
			}
		}
	}
};
