sap.zen.SDKControl.prototype.wrapComponent = function(libraryId, componentName, tPropertyNodes, myD)
{
	var lJavaScriptToExecute = "";
	var lZtlClass = oFF.XStringUtils.concatenate3(libraryId, ".", myD);
	lZtlClass = oFF.XString.replace(lZtlClass, ".", "_");
	lZtlClass = oFF.XStringUtils.concatenate2("sap.zen.dsh.", lZtlClass);
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, "sap.zen.dsh.initSdkControl(");
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, lZtlClass);
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, ", ");
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, componentName);
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, ", [");
	if (oFF.notNull(tPropertyNodes))
	{
		var loPropertyNodeIterator = tPropertyNodes.getIterator();
		while (loPropertyNodeIterator.hasNext())
		{
			var loPropertyNode = loPropertyNodeIterator.next();
			var lPropertyID = loPropertyNode.getAttribute("id");
			var lPropertyType = loPropertyNode.getAttribute("type");
			lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, "{name: '");
			lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, lPropertyID);
			lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, "', type: '");
			lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, lPropertyType);
			lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, "'}");
			if (loPropertyNodeIterator.hasNext())
			{
				lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, ", ");
			}
		}
	}
	lJavaScriptToExecute = oFF.XStringUtils.concatenate2(lJavaScriptToExecute, "]);");
	return lJavaScriptToExecute;
};
