sap.zen.SDKControl.prototype.getProjectionInformation = function(propertyName, selection, oPropertyNode)
{
	var lPropertyType = oPropertyNode.getAttribute("type");
	var loProjectionInformation = sap.zen.ProjectionInformation.create(this.getId(), propertyName, selection);
	if (oFF.XString.isEqual("ResultCellList", lPropertyType))
	{
		loProjectionInformation.setOption("selectionShape", "1");
	}
	else if (oFF.XString.isEqual("ResultCell", lPropertyType))
	{
		loProjectionInformation.setOption("selectionShape", "0");
	}
	else if (oFF.XString.isEqual("ResultSet", lPropertyType))
	{
		loProjectionInformation.setOption("includeMetadata", "true");
		loProjectionInformation.setOption("fillMetadataProperty", "false");
		loProjectionInformation.setOption("includeAxesTuples", "true");
	}
	var ltOptionNodes = oPropertyNode.getAllChildren();
	for (var lOptionNodeIndex = 0; lOptionNodeIndex < ltOptionNodes.size(); lOptionNodeIndex++)
	{
		var loOptionNode = ltOptionNodes.get(lOptionNodeIndex);
		if (oFF.isNull(loOptionNode))
		{
			continue;
		}
		if (oFF.XString.isEqual("option", loOptionNode.getNodeName()))
		{
			var lOptionName = loOptionNode.getAttribute("name");
			var lOptionValue = loOptionNode.getAttribute("value");
			loProjectionInformation.setOption(lOptionName, lOptionValue);
		}
	}
	return loProjectionInformation;
};
sap.zen.SDKControl.prototype.renderControlContent = function(oRenderManager)
{
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	loRenderSerializer.addAttribute("handler_name", oFF.XStringUtils.concatenate3(this.moFactory.mLibraryId, ".", this.moFactory.mComponentTypeId));
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getPage().getDshControlId()))
	{
		loRenderSerializer.addAttribute("pureId", this.getId());
		loRenderSerializer.addAttribute("buddhaId", oFF.XStringUtils.concatenate2(this.getPage().getDshControlId(), "Buddha"));
	}
	var loDataSource = this.getDataSource();
	if (oFF.notNull(loDataSource))
	{
		loRenderSerializer.addAttribute("DATA_SOURCE_ALIAS_REF", loDataSource.getName());
	}
	var ltProjectionInformation = oFF.XList.create();
	if (oFF.notNull(this.moFactory.mtProperties))
	{
		var loPropertyNodeIterator = this.moFactory.mtProperties.getIterator();
		while (loPropertyNodeIterator.hasNext())
		{
			var loPropertyNode = loPropertyNodeIterator.next();
			var lPropertyID = loPropertyNode.getAttribute("id");
			var lPropertyType = loPropertyNode.getAttribute("type");
			if (oFF.XString.isEqual("Array", lPropertyType))
			{
				var realArrayNode = this.getPropertyNode(lPropertyID);
				if (oFF.notNull(realArrayNode))
				{
					var arrayEntryPropertyNode = loPropertyNode.getFirstChildWoBiNameSpace("property");
					if (oFF.notNull(arrayEntryPropertyNode))
					{
						var arrayEntryType = arrayEntryPropertyNode.getAttribute("type");
						var realArrayEntries = realArrayNode.getChildren("property");
						var expectedProps = oFF.XHashMapOfStringByString.create();
						if (oFF.XString.isEqual("Object", arrayEntryType))
						{
							loRenderSerializer.openArray(lPropertyID);
							var objectProperties = arrayEntryPropertyNode.getChildrenWoBiNameSpace("property");
							var objectPropertiesIterator = objectProperties.getIterator();
							while (objectPropertiesIterator.hasNext())
							{
								var objectProperty = objectPropertiesIterator.next();
								expectedProps.put(objectProperty.getAttribute("id"), objectProperty.getAttribute("type"));
							}
							var realArrayEntriesIterator = realArrayEntries.getIterator();
							while (realArrayEntriesIterator.hasNext())
							{
								var realArrayEntry = realArrayEntriesIterator.next();
								loRenderSerializer.openJsonTag();
								var realEntryProperties = realArrayEntry.getChildren("property");
								var realEntryPropertiesIterator = realEntryProperties.getIterator();
								while (realEntryPropertiesIterator.hasNext())
								{
									var realEntryProperty = realEntryPropertiesIterator.next();
									var entryName = realEntryProperty.getAttribute("name");
									var entryValue = realEntryProperty.getAttribute("value");
									if (expectedProps.containsKey(entryName))
									{
										var expectedType = expectedProps.getByKey(entryName);
										if (oFF.XString.isEqual("boolean", expectedType))
										{
											loRenderSerializer.addBooleanAttribute(entryName, this.makeBooleanPropertyWithDefault(entryValue, false));
										}
										else if (oFF.XString.isEqual("int", expectedType))
										{
											loRenderSerializer.addIntegerAttribute(entryName, oFF.XInteger.convertFromStringWithDefault(entryValue, 0));
										}
										else if (oFF.XString.isEqual("float", expectedType))
										{
											loRenderSerializer.addDoubleAttribute(entryName, oFF.XDouble.convertFromStringWithDefault(entryValue, 0.));
										}
										else
										{
											if (oFF.XString.isEqual("Url", expectedType))
											{
												entryValue = this.translateUrl(entryValue);
											}
											loRenderSerializer.addAttribute(entryName, entryValue);
										}
									}
								}
								loRenderSerializer.closeJsonTag();
							}
							loRenderSerializer.closeArray();
						}
					}
				}
			}
			else
			{
				var jsPropertyName = lPropertyID;
				var value = this.getStringPropertyWithDefault(lPropertyID, "");
				if (oFF.XString.isEqual("ScriptText", lPropertyType))
				{
					oFF.XString.asString("");
				}
				else if (oFF.XString.isEqual("ResultCellSet", lPropertyType) || oFF.XString.isEqual("ResultCellList", lPropertyType) || oFF.XString.isEqual("ResultCell", lPropertyType) || oFF.XString.isEqual("ResultSet", lPropertyType))
				{
					var projectionInformation = this.getProjectionInformation(jsPropertyName, value, loPropertyNode);
					if (projectionInformation.isFillMetadataProperty())
					{
						ltProjectionInformation.add(projectionInformation);
					}
					else if (this.getDataSource() !== null)
					{
						var projectionInformations = oFF.XList.create();
						projectionInformations.add(projectionInformation);
						this.getDataSource().renderResultSetAsJSONs(oRenderManager, projectionInformations, false);
					}
				}
				else if (oFF.XString.isEqual("Url", lPropertyType))
				{
					loRenderSerializer.addAttribute(jsPropertyName, this.translateUrl(value));
				}
				else if (oFF.XString.isEqual("boolean", lPropertyType))
				{
					var bVal = this.getBooleanPropertyWithDefault(lPropertyID, false);
					loRenderSerializer.addBooleanAttribute(jsPropertyName, bVal);
				}
				else if (oFF.XString.isEqual("int", lPropertyType))
				{
					var intValue = this.getIntPropertyWithDefault(lPropertyID, 0);
					loRenderSerializer.addIntegerAttribute(jsPropertyName, intValue);
				}
				else if (oFF.XString.isEqual("float", lPropertyType))
				{
					var doubleValue = this.getDoublePropertyWithDefault(lPropertyID, 0.0);
					loRenderSerializer.addDoubleAttribute(jsPropertyName, doubleValue);
				}
				else
				{
					var stringValue = value;
					loRenderSerializer.addAttribute(jsPropertyName, stringValue);
				}
			}
		}
	}
};
sap.zen.SDKControl.prototype.doSDKPVT = function(obj)
{
	var loJsonObject = sap.buddha.XJsonObject.create(obj);
	var loJsonArray = loJsonObject.getArray();
	var lArraySize = loJsonArray.size();
	for (var lArrayIndex = 0; lArrayIndex < lArraySize; lArrayIndex++)
	{
		var loJsonArrayObject = loJsonArray.get(lArrayIndex);
		if (oFF.isNull(loJsonArrayObject))
		{
			continue;
		}
		var lName = null;
		if (loJsonArrayObject.isDefined())
		{
			lName = loJsonArrayObject.getString();
		}
		lArrayIndex = lArrayIndex + 1;
		var lValue = null;
		loJsonArrayObject = loJsonArray.get(lArrayIndex);
		if (loJsonArrayObject.isDefined())
		{
			lValue = loJsonArrayObject.getString();
		}
		this.setStringProperty(lName, lValue);
	}
};
