sap.zen.SmartlayoutControl.prototype.removeChild = function(oComponent)
{
	if (!oComponent.isSmartLayout() || this.mtChildren.size() > 2)
	{
		sap.zen.ContainerComponent.prototype.removeChild.call( this , oComponent);
	}
	else
	{
		if (this.mtChildren.size() === 2)
		{
			var loSmartLayoutControl = oComponent;
			var lIndex = this.mtChildren.getIndex(loSmartLayoutControl);
			var loOtherSmartLayoutControl;
			if (lIndex === 0)
			{
				loOtherSmartLayoutControl = this.mtChildren.get(1);
			}
			else
			{
				loOtherSmartLayoutControl = this.mtChildren.get(0);
			}
			this.mtChildren.clear();
			var loChildIteratorOfOtherSmartLayoutControl = loOtherSmartLayoutControl.mtChildren.getIterator();
			var lChangeInOrientation = !oFF.XString.isEqual(this.getOrientation(), loOtherSmartLayoutControl.getOrientation());
			this.setOrientation(loOtherSmartLayoutControl.getOrientation());
			var loSmartLayoutControlParent = this;
			if (this.getParent().isSmartLayout())
			{
				if (oFF.XString.isEqual(this.getOrientation(), this.getParent().getOrientation()))
				{
					this.getParent().mtChildren.removeElement(this);
					this.getParent().setContentChangedRecursive();
					loSmartLayoutControlParent = this.getParent();
				}
			}
			while (loChildIteratorOfOtherSmartLayoutControl.hasNext())
			{
				if (oFF.XString.isEqual(loOtherSmartLayoutControl.getOrientation(), "VERTICAL"))
				{
					loSmartLayoutControlParent.addTop(loChildIteratorOfOtherSmartLayoutControl.next(), lChangeInOrientation, loSmartLayoutControlParent);
				}
				else
				{
					loSmartLayoutControlParent.addRight(loChildIteratorOfOtherSmartLayoutControl.next(), lChangeInOrientation, loSmartLayoutControlParent);
				}
			}
			this.setContentChangedRecursive();
		}
	}
};

