sap.zen.ContentAreaControl.prototype.setSize = function(size)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(size))
	{
		var lOffset = 0;
		var lLength = oFF.XString.size(size);
		for (lOffset = 0; lOffset < lLength; lOffset++)
		{
			var lSubstring = oFF.XString.substring(size, 0, lOffset + 1);
			try
			{
				oFF.XInteger.convertFromString(lSubstring);
			}
			catch (loException)
			{
				break;
			}
		}
		var lContentSize = oFF.XString.substring(size, 0, lOffset);
		var lUnitOfSize = oFF.XString.substring(size, lOffset, -1);
		if (oFF.XString.containsString(lUnitOfSize, "px"))
		{
			lUnitOfSize = "px";
		}
		else if (oFF.XString.containsString(lUnitOfSize, "%"))
		{
			lUnitOfSize = "%";
		}
		else if (oFF.XString.containsString(lUnitOfSize, "auto"))
		{
			lContentSize = "auto";
			lUnitOfSize = this.getUnitOfSize();
		}
		else
		{
			lUnitOfSize = this.getUnitOfSize();
		}
		if (oFF.XStringUtils.isNullOrEmpty(lContentSize))
		{
			lContentSize = "0";
		}
		this.setStringProperty(sap.zen.CSplitterControl.CONTENT_SIZE.getMetadataPropertyName(), lContentSize);
		this.setStringProperty(sap.zen.CSplitterControl.UNIT_OF_SIZE.getMetadataPropertyName(), lUnitOfSize);
	}
	this.setContentChangedRecursive();
};
