sap.zen.SplitterControl.prototype.parseJsonFromEventOnResize = function(jsonString)
{
	var ltSizes = oFF.XListOfString.create();
	var loJsonParser = this.getJsonParser();
	var loJsonObject = loJsonParser.parse(jsonString);
	var loJsonElement = loJsonObject.asStructure().getByKey("tNewSizes");
	if (oFF.notNull(loJsonElement))
	{
		var loJsonList = loJsonElement.asList();
		for (var lListIndex = 0; lListIndex < loJsonList.size(); lListIndex++)
		{
			loJsonElement = loJsonList.get(lListIndex);
			if (oFF.isNull(loJsonElement))
			{
				continue;
			}
			var lSize = null;
			if (loJsonElement.isString())
			{
				lSize = loJsonElement.asString().getString();
			}
			else
			{
				if (loJsonElement.isDouble())
				{
					lSize = oFF.XInteger.convertToString(loJsonElement.asDouble().getInteger());
				}
				else if (loJsonElement.isInteger())
				{
					lSize = oFF.XInteger.convertToString(loJsonElement.asInteger().getInteger());
				}
				else if (loJsonElement.isLong())
				{
					lSize = oFF.XInteger.convertToString(loJsonElement.asLong().getInteger());
				}
				else if (loJsonElement.isNumeric())
				{
					lSize = oFF.XInteger.convertToString(loJsonElement.asNumber().getInteger());
				}
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(lSize))
			{
				ltSizes.add(lSize);
			}
		}
	}
	return ltSizes;
};
sap.zen.SplitterControl.prototype.getUsedDataSourcesByDummyRendering = function(tDataSources)
{
	if (this.isVisible())
	{
		this.createChildrenRegardingChildItemRefList();
		for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
		{
			var loComponent = this.mtChildren.get(lChildIndex);
			if (oFF.isNull(loComponent))
			{
				continue;
			}
			if (this.isContentChanged())
			{
				if (!(loComponent.hasChildrenContentChanged() || loComponent.isContentChanged()))
				{
					continue;
				}
			}
			loComponent.getUsedDataSourcesByDummyRendering(tDataSources);
		}
	}
};
