sap.zen.TabstripControl = function() {};
sap.zen.TabstripControl.prototype = new sap.zen.ContainerComponent();
sap.zen.TabstripControl.prototype._ff_c = "TabstripControl";

sap.zen.TabstripControl.prototype.mOldIndex = 0;
sap.zen.TabstripControl.prototype.create = function()
{
	sap.zen.ContainerComponent.prototype.create.call( this );
	var lUid = oFF.XStringUtils.concatenate2(this.getName(), "_tf1");
	this.initControl(lUid, "tabstrip");
	this.getPage().addRequireModule("zen.rt.components.tabstrip/resources/js/tabstrip_handler");
	this.mOldIndex = -1;
};
sap.zen.TabstripControl.prototype.renderControlContent = function(oRenderManager)
{
	this.createChildrenRegardingChildItemRefList();
	this.setContentChangedAccordingToCaching(this.mOldIndex);
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	var lSelectedPageIndex = this.renderControlSpecificContent(loRenderSerializer);
	loRenderSerializer.openArray("content");
	for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
	{
		var loTabControl = this.mtChildren.get(lChildIndex);
		if (oFF.isNull(loTabControl))
		{
			continue;
		}
		if (lChildIndex === lSelectedPageIndex)
		{
			loTabControl.setRenderEmptyContent(false);
		}
		else
		{
			loTabControl.setRenderEmptyContent(true);
		}
	}
	this.renderChildren(oRenderManager);
	loRenderSerializer.closeArray();
	this.mOldIndex = lSelectedPageIndex;
};
sap.zen.TabstripControl.prototype.renderChildren = function(oRenderManager)
{
	if (this.isContentChanged())
	{
		sap.zen.ContainerComponent.prototype.renderChildren.call( this , oRenderManager);
	}
	else
	{
		if (this.isVisible())
		{
			this.createChildrenRegardingChildItemRefList();
			var lSelectedPageIndex = this.correctIndexIfNeeded(this.getSelectedTabIndex());
			for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
			{
				var loComponent = this.mtChildren.get(lChildIndex);
				if (oFF.isNull(loComponent))
				{
					continue;
				}
				if (lChildIndex === lSelectedPageIndex)
				{
					if (loComponent.isVisible() === true)
					{
						if (this.isContentChanged())
						{
							if (loComponent.hasChildrenContentChanged())
							{
								loComponent.setContentChanged(true);
							}
							else
							{
								loComponent.setRenderOnlyPlaceholder(true);
							}
						}
						loComponent.renderComponentInternal(oRenderManager);
					}
				}
				else
				{
					if (loComponent.isVisible() === true)
					{
						if (loComponent.isContentChanged())
						{
							loComponent.setRenderOnlyPlaceholder(true);
							loComponent.renderComponentInternal(oRenderManager);
						}
					}
				}
			}
		}
	}
};
sap.zen.TabstripControl.prototype.renderControlSpecificContent = function(oRenderSerializer)
{
	var lSelectedPageIndex = this.correctIndexIfNeeded(this.getSelectedTabIndex());
	oRenderSerializer.addIntegerAttribute("selectedtabindex", lSelectedPageIndex);
	oRenderSerializer.addAttribute("tablocation", "TOP");
	var lScript = oFF.XStringUtils.concatenate2(this.getId(), ".setSelectedTabIndexByUi(__arguments__);");
	var lScriptAction = this.createScriptAction(lScript, "__KEY__");
	oRenderSerializer.addAttribute("command", lScriptAction);
	return lSelectedPageIndex;
};
sap.zen.TabstripControl.prototype.getOnSelect = function()
{
	return this.getStringPropertyWithDefault("ON_SELECT", "");
};
sap.zen.TabstripControl.prototype.setOnSelect = function(value)
{
	this.setStringProperty("ON_SELECT", value);
};
sap.zen.TabstripControl.prototype.getSelectedTabIndex = function()
{
	return this.getIntPropertyWithDefault("SELECTED_TAB_INDEX", 0);
};
sap.zen.TabstripControl.prototype.setSelectedTabIndex = function(tabIndex)
{
	var lOldTabIndex = this.getSelectedTabIndex();
	if (lOldTabIndex === tabIndex)
	{
		return;
	}
	this.setIntProperty("SELECTED_TAB_INDEX", tabIndex);
	this.setContentChangedAccordingToCaching(lOldTabIndex);
};
sap.zen.TabstripControl.prototype.setSelectedTabIndexByUi = function(tabIndex)
{
	var lOldTabIndex = this.getSelectedTabIndex();
	if (lOldTabIndex === tabIndex)
	{
		return;
	}
	this.setIntProperty("SELECTED_TAB_INDEX", tabIndex);
	this.setContentChangedAccordingToCaching(this.mOldIndex);
	this.getPage().execWithoutRerender(this.getOnSelect());
};
