sap.zen.TabstripControl.prototype.setSelectedTabByName = function(pageName)
{
	var lFound = false;
	var lTabIndex = 0;
	var loComponentIterator = this.mtChildren.getIterator();
	while (loComponentIterator.hasNext() && !lFound)
	{
		var loComponent = loComponentIterator.next();
		var lComponentName = loComponent.getName();
		if (oFF.XString.isEqual(pageName, lComponentName))
		{
			this.setSelectedTabIndex(lTabIndex);
			lFound = true;
		}
		lTabIndex++;
	}
};
sap.zen.TabstripControl.prototype.getSelectedTab = function()
{
	return this.mtChildren.get(this.getSelectedTabIndex()).getName();
};
sap.zen.TabstripControl.prototype.onSelect = function()
{
	var lOnSelect = this.getOnSelect();
	if (oFF.XString.size(lOnSelect) > 0)
	{
		this.getPage().execWithoutRerender(lOnSelect);
	}
};
sap.zen.TabstripControl.prototype.setSelectedTab = function(tabName)
{
	this.setSelectedTabByName(tabName);
};
sap.zen.TabstripControl.prototype.isSelectedIndexAlsoEnabled = function(tabIndex)
{
	if (tabIndex < 0 || tabIndex >= this.mtChildren.size())
	{
		return false;
	}
	if (this.getPage().isDesignMode())
	{
		return true;
	}
	var loTabControl = this.mtChildren.get(tabIndex);
	return loTabControl.isEnabled();
};
sap.zen.TabstripControl.prototype.correctIndexIfNeeded = function(tabIndex)
{
	var lTabIndex = tabIndex;
	if (this.mtChildren.size() === 0)
	{
		return lTabIndex;
	}
	var lIsEnabled = this.isSelectedIndexAlsoEnabled(lTabIndex);
	var lMaxCounter = 0;
	if (!lIsEnabled)
	{
		while (!lIsEnabled)
		{
			lTabIndex++;
			if (lTabIndex >= this.mtChildren.size())
			{
				lTabIndex = 0;
			}
			lIsEnabled = this.isSelectedIndexAlsoEnabled(lTabIndex);
			lMaxCounter++;
			if (lMaxCounter >= this.mtChildren.size())
			{
				lIsEnabled = true;
			}
		}
	}
	return lTabIndex;
};
sap.zen.TabstripControl.prototype.setContentChangedAccordingToCaching = function(oldPageIndex)
{
	for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
	{
		var loComponent = this.mtChildren.get(lChildIndex);
		if (oFF.isNull(loComponent))
		{
			continue;
		}
		if (lChildIndex === this.getSelectedTabIndex())
		{
			if (oldPageIndex !== lChildIndex)
			{
				loComponent.setContentChangedRecursive();
			}
			else
			{
				loComponent.setContentChanged(true);
			}
		}
		else
		{
			loComponent.setContentChanged(true);
		}
	}
	this.setContentChanged(true);
};
sap.zen.TabstripControl.prototype.getUsedDataSourcesByDummyRendering = function(tDataSources)
{
	if (this.isVisible())
	{
		this.createChildrenRegardingChildItemRefList();
		var lSelectedPageIndex = this.correctIndexIfNeeded(this.getSelectedTabIndex());
		for (var lChildIndex = 0; lChildIndex < this.mtChildren.size(); lChildIndex++)
		{
			var loComponent = this.mtChildren.get(lChildIndex);
			if (oFF.isNull(loComponent))
			{
				continue;
			}
			if (lChildIndex === lSelectedPageIndex)
			{
				if (loComponent.isVisible() === true)
				{
					if (this.isContentChanged())
					{
						if (!(loComponent.hasChildrenContentChanged() || loComponent.isContentChanged()))
						{
							continue;
						}
					}
					loComponent.getUsedDataSourcesByDummyRendering(tDataSources);
				}
			}
		}
	}
};
sap.zen.TabstripControl.prototype.moveComponent = function(tabIndex, oObject)
{
	if (tabIndex >= this.mtChildren.size())
	{
		sap.zen.CLocalizationTabstripMessages.INVALID_TABINDEX.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, null, null, null);
		return;
	}
	var loTabControl = this.getTab(tabIndex);
	loTabControl.moveComponentToParent(oObject);
};

