sap.zen.ZCrosstabControl.prototype.renderCrosstab = function(oRenderSerializer)
{
	oRenderSerializer.addIntegerAttribute("fixedrowheaders", this.moGrid.getRowHeaders());
	oRenderSerializer.addIntegerAttribute("fixedcolheaders", this.moGrid.getColumnHeaders());
	oRenderSerializer.addIntegerAttribute("totaldatarows", this.moGrid.getDataRows());
	oRenderSerializer.addIntegerAttribute("totaldatacols", this.moGrid.getDataColumns());
	oRenderSerializer.addBooleanAttribute("pixelscrolling", this.mPixelScrolling);
	oRenderSerializer.addIntegerAttribute("tilerows", this.mRowsPerRequest);
	oRenderSerializer.addIntegerAttribute("tilecols", this.mColsPerRequest);
	oRenderSerializer.addIntegerAttribute("sentdatarows", this.moGrid.getPageDataRows());
	oRenderSerializer.addIntegerAttribute("sentdatacols", this.moGrid.getPageDataColumns());
	this.mtDimNameLookup = oFF.XSetOfNameObject.create();
	this.mtHeaderInfoMap = oFF.XHashMapByString.create();
	this.mtDimHeaderLookUp = oFF.XHashMapByString.create();
	oRenderSerializer.openArray("rows");
	for (var lCrosstabRow = 0; lCrosstabRow < this.moGrid.getPageRows(); lCrosstabRow++)
	{
		oRenderSerializer.openTag("row");
		oRenderSerializer.addIntegerAttribute("rowidx", lCrosstabRow + 1);
		oRenderSerializer.openArray("cells");
		for (var lCrosstabCol = 0; lCrosstabCol < this.moGrid.getPageColumns(); lCrosstabCol++)
		{
			var loGridCell = this.moGrid.getPageCell(lCrosstabRow, lCrosstabCol);
			if (oFF.isNull(loGridCell))
			{
				continue;
			}
			if (loGridCell.getRowSpan() <= 0 || loGridCell.getColumnSpan() <= 0)
			{
				continue;
			}
			oRenderSerializer.openTag("control");
			oRenderSerializer.addIntegerAttribute("colidx", lCrosstabCol + 1);
			if (loGridCell.getRowSpan() > 1)
			{
				var lRowSpan = loGridCell.getRowSpan();
				oRenderSerializer.addIntegerAttribute("rowspan", lRowSpan);
			}
			if (loGridCell.getColumnSpan() > 1)
			{
				var lColSpan = loGridCell.getColumnSpan();
				oRenderSerializer.addIntegerAttribute("colspan", lColSpan);
			}
			if (loGridCell.isTotal() === true)
			{
				oRenderSerializer.addBooleanAttribute("isresult", true);
			}
			if (loGridCell.isInputEnabled())
			{
				oRenderSerializer.addBooleanAttribute("isdataentryenabled", true);
			}
			if (loGridCell.isHeaderCell())
			{
				this.renderCrosstabHeaderCell(oRenderSerializer, loGridCell, lCrosstabRow, lCrosstabCol);
				oRenderSerializer.addText(loGridCell.getFormattedValue());
			}
			else
			{
				oRenderSerializer.addText(loGridCell.getFormattedValue());
			}
			oRenderSerializer.closeTag();
		}
		oRenderSerializer.closeArray();
		oRenderSerializer.closeTag();
	}
	oRenderSerializer.closeArray();
};
sap.zen.ZCrosstabControl.prototype.renderCrosstabHeaderCell = function(oRenderSerializer, oGridCell, crosstabRow, crosstabCol)
{
	if (!oGridCell.isHeaderCell())
	{
		return;
	}
	var ltHeaderData = oGridCell.getHeaderInfo().getHeaderData();
	var loDimension = null;
	var loDimensionMember = null;
	var loInternalField = null;
	var loTuple = null;
	var loTupleElement = null;
	if (oFF.notNull(ltHeaderData) && !ltHeaderData.isEmpty())
	{
		loDimension = ltHeaderData.get(0).getDimension();
		loDimensionMember = ltHeaderData.get(0).getDimensionMember();
		loInternalField = ltHeaderData.get(0).getField();
		loTuple = ltHeaderData.get(0).getTuple();
		loTupleElement = ltHeaderData.get(0).getTupleElement();
	}
	if (oFF.notNull(ltHeaderData) && !ltHeaderData.isEmpty())
	{
		for (var lHeaderDataIndex = 0; lHeaderDataIndex < ltHeaderData.size(); lHeaderDataIndex++)
		{
			var loHeaderData = ltHeaderData.get(lHeaderDataIndex);
			if (oFF.isNull(loHeaderData))
			{
				continue;
			}
			if (oFF.isNull(loTuple))
			{
				var lRowColKey = oFF.XStringUtils.concatenate3(oFF.XInteger.convertToString(crosstabRow), "/", oFF.XInteger.convertToString(crosstabCol));
				this.createDimHeaderLookup(lRowColKey, loHeaderData);
			}
			if (loHeaderData.getAxis() === oFF.AxisType.ROWS)
			{
				this.createHeaderInfo(loHeaderData, crosstabCol, oGridCell.getGrid().getRowHeaders(), oGridCell.getGrid().getColumnHeaders());
			}
			else if (loHeaderData.getAxis() === oFF.AxisType.COLUMNS)
			{
				this.createHeaderInfo(loHeaderData, crosstabRow, oGridCell.getGrid().getRowHeaders(), oGridCell.getGrid().getColumnHeaders());
			}
		}
	}
	if (oFF.notNull(loDimension))
	{
		var lSortDirection = oGridCell.getHeaderInfo().getSortDirection();
		if (oFF.notNull(lSortDirection))
		{
			var lSortAction = null;
			var lIsDimensionSorting = false;
			var lIsKeyField = false;
			if (loDimension.isMeasureStructure())
			{
				if (oFF.notNull(loDimensionMember))
				{
					var loInternalDimensionMember = loDimensionMember.getInternalObject();
					var loStructureMember = loInternalDimensionMember;
					var loMeasureDimension = this.getQueryModel().getMeasureDimension();
					loStructureMember = loMeasureDimension.getStructureMember(loStructureMember.getName());
					if (oFF.notNull(loStructureMember))
					{
						lIsDimensionSorting = false;
						lIsKeyField = false;
						lSortAction = this.createCommandSortDimension(loStructureMember.getName(), lIsKeyField, lSortDirection, lIsDimensionSorting);
					}
				}
			}
			else
			{
				lIsDimensionSorting = true;
				var lIsAttributeSorting = false;
				if (oFF.notNull(loInternalField))
				{
					lIsKeyField = loInternalField.getPresentationType().isTypeOf(oFF.PresentationType.ABSTRACT_KEY);
					lIsAttributeSorting = sap.zen.DataSourceScriptApiUtils.isAttribute(this.getDataSource(), loInternalField.getAttribute());
				}
				if (lIsAttributeSorting && oFF.notNull(loInternalField))
				{
					lSortAction = this.createCommandSortAttribute(loDimension.getName(), loInternalField.getAttribute().getName(), lIsKeyField, lSortDirection);
				}
				else
				{
					lSortAction = this.createCommandSortDimension(loDimension.getName(), lIsKeyField, lSortDirection, lIsDimensionSorting);
				}
			}
			this.renderSortInformation(oRenderSerializer, lSortDirection, lSortAction);
		}
	}
	if (oFF.notNull(ltHeaderData) && !ltHeaderData.isEmpty())
	{
		if (oFF.notNull(loTuple))
		{
			if (ltHeaderData.get(0).getMergeKey() !== null)
			{
				oRenderSerializer.addAttribute("key", ltHeaderData.get(0).getMergeKey());
			}
			if (ltHeaderData.get(0).isInnerMember())
			{
				oRenderSerializer.addBooleanAttribute("isinnermember", true);
			}
		}
	}
	if (oFF.notNull(ltHeaderData) && !ltHeaderData.isEmpty() && oFF.notNull(loTuple) && oFF.notNull(loTupleElement))
	{
		if (oGridCell.isHierarchical())
		{
			var lAxis = oGridCell.getHeaderInfo().getAxis();
			var lNodeState = oGridCell.getNodeState();
			var lNodeLevel = oGridCell.getNodeLevel();
			var lNodeAlignment = oGridCell.getNodeAlignment();
			if (this.getBooleanPropertyWithDefault(sap.zen.ZCrosstabControlMetadataProvider.CROSSTAB_ENABLE_HIERARCHY_NAVIGATION, true))
			{
				var lWriteHierarchyAction = false;
				if (oFF.DrillState.EXPANDED.isEqualTo(lNodeState))
				{
					oRenderSerializer.addIntegerAttribute("level", lNodeLevel);
					oRenderSerializer.addAttribute("drillstate", "O");
					lWriteHierarchyAction = true;
				}
				else if (oFF.DrillState.COLLAPSED.isEqualTo(lNodeState))
				{
					oRenderSerializer.addIntegerAttribute("level", lNodeLevel);
					oRenderSerializer.addAttribute("drillstate", "C");
					lWriteHierarchyAction = true;
				}
				else if (oFF.DrillState.LEAF.isEqualTo(lNodeState))
				{
					if (lNodeLevel > 0)
					{
						oRenderSerializer.addIntegerAttribute("level", lNodeLevel);
						oRenderSerializer.addAttribute("drillstate", "L");
					}
				}
				if (lWriteHierarchyAction)
				{
					var lDataSourceName = this.getDataSource().getId();
					var lCommand = oFF.XStringUtils.concatenate2(lDataSourceName, ".toggleDrillState('");
					lCommand = oFF.XStringUtils.concatenate2(lCommand, lAxis.getName());
					lCommand = oFF.XStringUtils.concatenate2(lCommand, "',");
					lCommand = oFF.XStringUtils.concatenate2(lCommand, oFF.XInteger.convertToString(loTuple.getIndex()));
					lCommand = oFF.XStringUtils.concatenate2(lCommand, ",");
					var lOtherAxisIndex = loTupleElement.getIndex();
					if (lAxis === oFF.AxisType.ROWS)
					{
						lOtherAxisIndex = oGridCell.getColumnIndex();
					}
					else if (lAxis === oFF.AxisType.COLUMNS)
					{
						lOtherAxisIndex = oGridCell.getRowIndex();
					}
					lCommand = oFF.XStringUtils.concatenate2(lCommand, oFF.XInteger.convertToString(lOtherAxisIndex));
					lCommand = oFF.XStringUtils.concatenate2(lCommand, ",'");
					lCommand = oFF.XStringUtils.concatenate2(lCommand, "');");
					if (this.getQueryManager() !== null && this.getQueryManager().isDataEntryEnabled() && !this.getQueryManager().isDataEntryReadOnly())
					{
						var lScriptSequence = new sap.zen.ScriptSequence();
						var lScriptSequenceItemRecalc = this.createScriptSequenceItemMethodCall(this, "recalculate");
						lScriptSequence.add(lScriptSequenceItemRecalc);
						var lScriptSequenceItemSetDrillState = this.createScriptSequenceItem(lCommand);
						lScriptSequence.add(lScriptSequenceItemSetDrillState);
						lCommand = lScriptSequence.createScript(this.getPage());
					}
					else
					{
						lCommand = this.createScript(lCommand);
					}
					oRenderSerializer.addAttribute("hierarchyaction", lCommand);
					if (oFF.Alignment.CHILDREN_ABOVE_PARENT.isEqualTo(lNodeAlignment))
					{
						oRenderSerializer.addAttribute("nodeAlignment", "bottom");
					}
				}
			}
		}
	}
	if (oFF.XMath.binaryAnd(oGridCell.getStyle(), sap.zen.GridCell.STYLE_INTERNAL_VALUE) > 0)
	{
		oRenderSerializer.addAttribute("valueType", oGridCell.getValueType().getName());
		if (oGridCell.getValueType().isNumber())
		{
			var lDecimals = 0;
			if (oFF.notNull(loDimensionMember))
			{
				lDecimals = loDimensionMember.getDecimals();
			}
			oRenderSerializer.addIntegerAttribute("decimals", lDecimals);
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(oGridCell.getFormatString()))
		{
			oRenderSerializer.addAttribute("formatString", oGridCell.getFormatString());
		}
	}
};
