sap.zen.ZCrosstabControl.prototype.renderCheckPlanningValue = function(oRenderSerializer, rowHeaders, colHeaders)
{
	oRenderSerializer.addIntegerAttribute("vlhlpstatus", 0);
	if (oFF.notNull(this.mtPlanningCellInputInfoList) && this.mtPlanningCellInputInfoList.size() > 0)
	{
		oRenderSerializer.openTag("pvcheck");
		oRenderSerializer.addIntegerAttribute("length", this.mtPlanningCellInputInfoList.size());
		for (var index = 0; index < this.mtPlanningCellInputInfoList.size(); index++)
		{
			var loCellInfo = this.mtPlanningCellInputInfoList.get(index);
			if (oFF.isNull(loCellInfo))
			{
				continue;
			}
			loCellInfo.finalizeData(colHeaders, rowHeaders, "");
			oRenderSerializer.openTag(oFF.XInteger.convertToString(index));
			oRenderSerializer.addIntegerAttribute("tabrow", loCellInfo.getTableRow());
			oRenderSerializer.addIntegerAttribute("tabcol", loCellInfo.getTableCol());
			oRenderSerializer.addBooleanAttribute("valid", loCellInfo.isValid());
			oRenderSerializer.addBooleanAttribute("newval", loCellInfo.isNewValue());
			oRenderSerializer.addAttribute("text", sap.buddha.XSSEncoder.encodeHtml(loCellInfo.getText()));
			oRenderSerializer.closeTag();
		}
		oRenderSerializer.closeTag();
	}
};
