sap.zen.ZCrosstabControl.prototype.setSelection = function(oSelectionJson)
{
	var loJsonObject = sap.buddha.XJsonObject.create(oSelectionJson);
	var lJsonString = loJsonObject.getString();
	var loJsonParser = this.getJsonParser();
	var loJsonElement = loJsonParser.parse(lJsonString);
	var loJsonStructure = loJsonElement.asStructure();
	var ltJsonListSelectedElements;
	var loJsonListSelectedElement;
	var lJsonListSelectedElementIndex;
	var lRowIndex;
	var lColIndex;
	this.moSelectionStore = sap.zen.ZCrosstabSelectionStore.create(this.moResultSet, this);
	ltJsonListSelectedElements = loJsonStructure.getListByKey("ROW");
	if (oFF.notNull(ltJsonListSelectedElements))
	{
		for (lJsonListSelectedElementIndex = 0; lJsonListSelectedElementIndex < ltJsonListSelectedElements.size(); lJsonListSelectedElementIndex++)
		{
			loJsonListSelectedElement = ltJsonListSelectedElements.getStructureAt(lJsonListSelectedElementIndex);
			if (oFF.isNull(loJsonListSelectedElement))
			{
				continue;
			}
			lRowIndex = loJsonListSelectedElement.getIntegerByKey("row");
			lColIndex = loJsonListSelectedElement.getIntegerByKey("col");
			lColIndex = this.correctIndexForHiddenDimensions(lColIndex, oFF.AxisType.ROWS);
			this.moSelectionStore.collectSelectedTupleElements(oFF.AxisType.ROWS, lRowIndex, lColIndex);
		}
	}
	else
	{
		ltJsonListSelectedElements = loJsonStructure.getListByKey("COL");
		if (oFF.notNull(ltJsonListSelectedElements))
		{
			for (lJsonListSelectedElementIndex = 0; lJsonListSelectedElementIndex < ltJsonListSelectedElements.size(); lJsonListSelectedElementIndex++)
			{
				loJsonListSelectedElement = ltJsonListSelectedElements.getStructureAt(lJsonListSelectedElementIndex);
				if (oFF.isNull(loJsonListSelectedElement))
				{
					continue;
				}
				lRowIndex = loJsonListSelectedElement.getIntegerByKey("row");
				lRowIndex = this.correctIndexForHiddenDimensions(lRowIndex, oFF.AxisType.COLUMNS);
				lColIndex = loJsonListSelectedElement.getIntegerByKey("col");
				this.moSelectionStore.collectSelectedTupleElements(oFF.AxisType.COLUMNS, lRowIndex, lColIndex);
			}
		}
		else
		{
			ltJsonListSelectedElements = loJsonStructure.getListByKey("DATA");
			if (oFF.notNull(ltJsonListSelectedElements))
			{
				loJsonListSelectedElement = ltJsonListSelectedElements.getStructureAt(0);
				lRowIndex = loJsonListSelectedElement.getIntegerByKey("row");
				lRowIndex = this.correctIndexForHiddenDimensions(lRowIndex, oFF.AxisType.COLUMNS);
				lColIndex = loJsonListSelectedElement.getIntegerByKey("col");
				lColIndex = this.correctIndexForHiddenDimensions(lColIndex, oFF.AxisType.ROWS);
				var lFixedRowHeaders = this.moResultSet.getTuple(oFF.AxisType.ROWS, 0, null, null).getAmountOfTupleElements() - 1;
				var lFixedColHeaders = this.moResultSet.getTuple(oFF.AxisType.COLUMNS, 0, null, null).getAmountOfTupleElements() - 1;
				this.moSelectionStore.collectSelectedTupleElements(oFF.AxisType.ROWS, lRowIndex, lFixedRowHeaders);
				this.moSelectionStore.collectSelectedTupleElements(oFF.AxisType.COLUMNS, lFixedColHeaders, lColIndex);
			}
			else
			{
				this.moSelectionStore = null;
			}
		}
	}
	this.onSelect();
};
sap.zen.ZCrosstabControl.prototype.correctIndexForHiddenDimensions = function(index, axis)
{
	var lCorrectIndex = index;
	var ltDimensions = sap.zen.Dimension.sGetAxisDimensions(this.getDataSource(), axis);
	var loDimensionIterator = ltDimensions.getIterator();
	while (loDimensionIterator.hasNext())
	{
		var loDimension = loDimensionIterator.next();
		if (oFF.isNull(loDimension))
		{
			continue;
		}
		var lVisible = false;
		var lMemberDisplay = loDimension.getProperties().getMemberDisplayMode(null);
		if (lMemberDisplay === sap.zen.CMemberDisplayMode.KEY || lMemberDisplay === sap.zen.CMemberDisplayMode.KEY_TEXT || lMemberDisplay === sap.zen.CMemberDisplayMode.TEXT || lMemberDisplay === sap.zen.CMemberDisplayMode.TEXT_KEY)
		{
			lVisible = true;
		}
		if (!lVisible)
		{
			lCorrectIndex++;
		}
	}
	return lCorrectIndex;
};
sap.zen.ZCrosstabControl.prototype.getSelectedMember = function(dimensionName)
{
	var loDimensionMember = null;
	if (oFF.notNull(this.moSelectionStore))
	{
		var loDimension = sap.zen.Dimension.sGetDimension(this.moResultSet.getDataSource(), dimensionName);
		if (oFF.notNull(loDimension))
		{
			var ltSelectedTuples = this.moSelectionStore.getSelectedTuples();
			if (ltSelectedTuples.size() > 0)
			{
				var loTuple = ltSelectedTuples.get(0);
				var lAxisContainsDimension = this.selectionAxisContainsRequestedDimension(loTuple, dimensionName);
				if (lAxisContainsDimension)
				{
					var loTupleElement = loTuple.getTupleElement(-1, loDimension);
					if (oFF.notNull(loTupleElement))
					{
						loDimensionMember = loTupleElement.getDimensionMember();
					}
				}
			}
		}
	}
	var loScriptableMember = null;
	if (oFF.notNull(loDimensionMember))
	{
		loScriptableMember = sap.zen.ScriptableMember.createForDimensionMember(loDimensionMember);
	}
	else
	{
		loScriptableMember = sap.zen.ScriptableMember.createForDimensionMemberName("");
	}
	return loScriptableMember;
};
sap.zen.ZCrosstabControl.prototype.getSelectedMembers = function(dimensionName)
{
	var ltScriptableMembers = oFF.XList.create();
	var loDimension = sap.zen.Dimension.sGetDimension(this.moResultSet.getDataSource(), dimensionName);
	var ltLookupSetDimensionMembers = oFF.XSetOfNameObject.create();
	if (oFF.notNull(this.moSelectionStore) && oFF.notNull(loDimension))
	{
		var ltSelectedTuples = this.moSelectionStore.getSelectedTuples();
		for (var lTupleIndex = 0; lTupleIndex < ltSelectedTuples.size(); lTupleIndex++)
		{
			var loTuple = ltSelectedTuples.get(lTupleIndex);
			if (oFF.isNull(loTuple))
			{
				continue;
			}
			var lAxisContainsDimension = this.selectionAxisContainsRequestedDimension(loTuple, dimensionName);
			if (lAxisContainsDimension)
			{
				var loTupleElement = loTuple.getTupleElement(-1, loDimension);
				if (oFF.notNull(loTupleElement))
				{
					var loDimensionMember = loTupleElement.getDimensionMember();
					if (oFF.notNull(loDimensionMember) && !ltLookupSetDimensionMembers.contains(loDimensionMember))
					{
						var loScriptableMember = sap.zen.ScriptableMember.createForDimensionMember(loDimensionMember);
						ltScriptableMembers.add(loScriptableMember);
						ltLookupSetDimensionMembers.add(loDimensionMember);
					}
				}
			}
		}
	}
	return this.getPage().getWindow().createJSArray(ltScriptableMembers);
};
