sap.zen.ZCrosstabControl.prototype.doCommandInsertDimension = function(dimensionName, axisName, axisIndexAsString)
{
	var lNewAxis = null;
	if (oFF.XString.isEqual(axisName, "ROWS"))
	{
		lNewAxis = oFF.AxisType.ROWS;
	}
	else if (oFF.XString.isEqual(axisName, "COLS"))
	{
		lNewAxis = oFF.AxisType.COLUMNS;
	}
	var lAxisIndex = this.convertStringToInteger(axisIndexAsString);
	var loDimension = sap.zen.Dimension.sGetDimension(this.moResultSet.getDataSource(), dimensionName);
	loDimension.getProperties().moveDimensionToAxis(lNewAxis, lAxisIndex, true);
};
