sap.zen.ZCrosstabControl.prototype.createContextMenu = function(contextMenuComponentId, row, col, axis, removeSelection)
{
	var lRow = this.convertStringToInteger(row);
	var lCol = this.convertStringToInteger(col);
	var lRowHeader = false;
	var lColumnHeader = false;
	if (lRow <= 0)
	{
		lRowHeader = true;
	}
	if (lCol <= 0)
	{
		lColumnHeader = true;
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(axis))
	{
		var loQueryManager = this.getDataSource().getQueryManager();
		sap.zen.DataSourceScriptApiUtils.logGetResultSet(this.getPage(), loQueryManager, "XTab createContextMenu");
		var loResultSetInfo = new sap.zen.ResultSetHelper();
		if (oFF.XString.isEqual(sap.zen.CCrosstabAxis.ROWS.getValue(), axis))
		{
			lRow = this.correctIndex(sap.zen.CCrosstabAxis.ROWS, lRow);
			loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.ROWS, lRow, lCol);
		}
		else if (oFF.XString.isEqual(sap.zen.CCrosstabAxis.COLS.getValue(), axis))
		{
			lCol = this.correctIndex(sap.zen.CCrosstabAxis.COLS, lCol);
			loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.COLUMNS, lCol, lRow);
		}
		else if (oFF.XString.isEqual(sap.zen.CCrosstabAxis.DIM.getValue(), axis))
		{
			var mapKey = oFF.XStringUtils.concatenate3(row, "/", col);
			loResultSetInfo = this.mtDimHeaderLookUp.getByKey(mapKey);
		}
		var loComponent = this.getPage().getComponent(contextMenuComponentId);
		var loContextMenu = loComponent;
		if (oFF.notNull(loContextMenu) && oFF.notNull(loResultSetInfo))
		{
			if (oFF.XString.isEqual(sap.zen.CCrosstabAxis.DATA.getValue(), axis))
			{
				lRow = this.correctIndex(sap.zen.CCrosstabAxis.ROWS, lRow);
				lCol = this.correctIndex(sap.zen.CCrosstabAxis.COLS, lCol);
				var loResultDataCell = this.moResultSet.getResultDataCell(lRow, lCol);
				loContextMenu.openMenuForDataCell(this.getName(), loResultDataCell);
			}
			else
			{
				if (!oFF.XString.isEqual(sap.zen.CCrosstabAxis.DIM.getValue(), axis))
				{
					if (!loResultSetInfo.getDimension().isMeasureStructure())
					{
						if (loResultSetInfo.getDimension().getAxis() === oFF.AxisType.ROWS && lRowHeader)
						{
							loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.ROWS, -1, lCol);
						}
						else if (loResultSetInfo.getDimension().getAxis() === oFF.AxisType.COLUMNS && lColumnHeader)
						{
							loResultSetInfo = sap.zen.ResultSetHelper.create(this.moResultSet, oFF.AxisType.COLUMNS, -1, lRow);
						}
					}
					loContextMenu.openMenuForFieldValue(this.getName(), loResultSetInfo);
				}
				else
				{
					var loField = loResultSetInfo.getField();
					var loAttribute = loField.getAttribute();
					var lIsAttribute = sap.zen.DataSourceScriptApiUtils.isAttribute(this.getDataSource(), loAttribute);
					if (lIsAttribute)
					{
						loContextMenu.openMenuForAttribute(this.getName(), loResultSetInfo.getResultSet(), loAttribute);
					}
					else
					{
						if (!loResultSetInfo.getDimension().isStructure())
						{
							loContextMenu.openMenuForDimension(this.getName(), sap.zen.CContextMenuMode.CROSSTAB, loResultSetInfo.getDimension());
						}
					}
				}
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(removeSelection))
			{
				var lRemoveSelection = oFF.XBoolean.convertFromString(removeSelection);
				if (lRemoveSelection)
				{
					this.removeSelection();
					this.onSelect();
				}
			}
		}
	}
};
sap.zen.ZCrosstabControl.prototype.correctIndex = function(axis, index)
{
	var lCorrectedIndex = index;
	if (axis === sap.zen.CCrosstabAxis.ROWS)
	{
		lCorrectedIndex = lCorrectedIndex - this.moGrid.getColumnHeaders();
	}
	else if (axis === sap.zen.CCrosstabAxis.COLS)
	{
		lCorrectedIndex = lCorrectedIndex - this.moGrid.getRowHeaders();
	}
	if (lCorrectedIndex < 0)
	{
		lCorrectedIndex = 0;
	}
	return lCorrectedIndex;
};
sap.zen.ZCrosstabControl.prototype.convertStringToInteger = function(stringValue)
{
	if (oFF.XStringUtils.isNullOrEmpty(stringValue))
	{
		return 0;
	}
	return oFF.XInteger.convertFromString(stringValue);
};
sap.zen.ZCrosstabControl.prototype.createUnsupportedApiMessage = function(methodName)
{
	sap.zen.CLocalizationCrosstabMessages.UNSUPPORTED_API.addMessageToMessageHandler(this.getPage(), oFF.Severity.ERROR, methodName, null, null);
};
sap.zen.ZCrosstabControl.prototype.getSelections = function()
{
	var selectionPerDimension = oFF.XHashMapByString.create();
	if (oFF.notNull(this.moSelectionStore) && this.isVisibleRecursive())
	{
		var ltSelectedTuples = this.moSelectionStore.getSelectedTuples();
		for (var lTupleIndex = 0; lTupleIndex < ltSelectedTuples.size(); lTupleIndex++)
		{
			var loTuple = ltSelectedTuples.get(lTupleIndex);
			if (oFF.isNull(loTuple))
			{
				continue;
			}
			var ltTupleElements = loTuple.getTupleElements();
			for (var lTupleElementIndex = 0; lTupleElementIndex < ltTupleElements.size(); lTupleElementIndex++)
			{
				var loTupleElement = ltTupleElements.get(lTupleElementIndex);
				if (oFF.isNull(loTupleElement))
				{
					continue;
				}
				var loDimension = loTupleElement.getDimension();
				var loInternalDimension = loDimension.getInternalObject();
				var lDimensionName = loDimension.getNavigationName();
				if (!selectionPerDimension.containsKey(lDimensionName))
				{
					selectionPerDimension.put(lDimensionName, oFF.XList.create());
				}
				var ltRanges = selectionPerDimension.getByKey(lDimensionName);
				var loInternalDimensionMember = loTupleElement.getDimensionMember().getInternalObject();
				var loMemberWrapper = sap.zen.MemberWrapper.create(loTupleElement.getDataSource(), loInternalDimension, loInternalDimensionMember, false, null);
				var loRange = new sap.zen.Range();
				loRange.initMe2(loMemberWrapper);
				ltRanges.add(loRange);
			}
		}
	}
	return selectionPerDimension;
};
