sap.zen.MultiDataProviderReferenceComponent.prototype.raiseDataSourceChangedEvent = function()
{
	var loDataSource = this.getDataSource();
	if (oFF.notNull(loDataSource))
	{
		loDataSource.raiseDataSourceChangedEvent(null, false, true);
	}
	var lTargetQueryViewsString = this.getStringPropertyWithDefault("TARGET_DATA_SOURCES_ALIAS_REF", "");
	var ltTargetDataSourceNames = null;
	if (!oFF.XString.isEqual("", lTargetQueryViewsString))
	{
		ltTargetDataSourceNames = oFF.XStringTokenizer.splitString(lTargetQueryViewsString, ";");
	}
	if (oFF.notNull(ltTargetDataSourceNames))
	{
		for (var lDataSourceIndex = 0; lDataSourceIndex < ltTargetDataSourceNames.size(); lDataSourceIndex++)
		{
			var lTargetDataSourceName = ltTargetDataSourceNames.get(lDataSourceIndex);
			if (oFF.isNull(lTargetDataSourceName))
			{
				continue;
			}
			loDataSource = this.getPage().getDataSource(lTargetDataSourceName);
			loDataSource.raiseDataSourceChangedEvent(null, false, true);
		}
	}
};
sap.zen.MultiDataProviderReferenceComponent.prototype.getTargetQueryViews = function(tTargetDataSourceNames)
{
	var loDataSource = this.getDataSource();
	var lDataSourceName = null;
	if (oFF.notNull(loDataSource))
	{
		lDataSourceName = this.getDataSource().getName();
	}
	var ltTargetQueryModels = oFF.XList.create();
	for (var lDataSourceIndex = 0; lDataSourceIndex < tTargetDataSourceNames.size(); lDataSourceIndex++)
	{
		var lTargetDataSourceName = tTargetDataSourceNames.get(lDataSourceIndex);
		if (oFF.isNull(lTargetDataSourceName))
		{
			continue;
		}
		if (!oFF.XString.isEqual(lTargetDataSourceName, lDataSourceName))
		{
			loDataSource = this.getPage().getDataSource(lTargetDataSourceName);
			var loQueryManager = loDataSource.getQueryManager();
			if (oFF.notNull(loQueryManager))
			{
				ltTargetQueryModels.add(loQueryManager.getQueryModel());
			}
		}
	}
	return ltTargetQueryModels;
};

