sap.zen.AbstractFilterComponentBase.prototype.recalculate = function() {};
sap.zen.AbstractFilterComponentBase.prototype.doSubmitFilterCommand = function(filter, submitString)
{
	var lSubmit = false;
	if (oFF.XString.isEqual(submitString, "X"))
	{
		lSubmit = true;
		if (this.mVariableScreen && !this.mErrorFree)
		{
			return;
		}
	}
	if (lSubmit)
	{
		this.mtValidatedFilterConfig = null;
	}
	var lDataSourceChange = false;
	var lValuesOk = null;
	if (oFF.notNull(filter))
	{
		var loConfigContainer = this.parseJson(filter);
		var ltFilterConfig = loConfigContainer.mtFilters;
		var axis = loConfigContainer.moAxisConfig;
		if (oFF.notNull(ltFilterConfig) || oFF.notNull(axis))
		{
			lDataSourceChange = true;
			this.recalculate();
		}
		if (oFF.notNull(ltFilterConfig))
		{
			for (var lFilterConfigIndex = 0; lFilterConfigIndex < ltFilterConfig.size(); lFilterConfigIndex++)
			{
				var loFilterConfig = ltFilterConfig.get(lFilterConfigIndex);
				if (oFF.isNull(loFilterConfig))
				{
					continue;
				}
				if (lSubmit || this.mVariableScreen)
				{
					lValuesOk = this.applyFilterConfig(loFilterConfig, lValuesOk);
				}
				else
				{
					if (oFF.isNull(this.mtValidatedFilterConfig))
					{
						this.mtValidatedFilterConfig = oFF.XHashMapByString.create();
					}
					this.mtValidatedFilterConfig.put(loFilterConfig.mName, this.validateFilterConfig(loFilterConfig));
					this.setContentChanged(true);
				}
			}
			this.moView = sap.zen.View.VIEW_DEFAULT;
			this.fireSwitchPageEvent(sap.zen.FilterPage.MAIN);
		}
		if (oFF.notNull(axis))
		{
			this.moAxisWrapper.applyAxisConfig(axis.mtRows, axis.mtColumns);
		}
	}
	if (lSubmit && this.mVariableScreen)
	{
		lValuesOk = oFF.XBooleanValue.create(true);
	}
	else
	{
		lValuesOk = oFF.XBooleanValue.create(this.moCharacteristicContainer.checkValues());
	}
	if (lSubmit === true && lValuesOk.getBoolean())
	{
		if (lSubmit && this.mVariableScreen && oFF.XStringUtils.isNotNullAndNotEmpty(this.getPage().getApplicationPropertiesComponent().getOnBeforePromptsSubmitScript()))
		{
			this.getPage().getApplicationPropertiesComponent().execOnBeforePromptsSubmitScript();
		}
		lValuesOk = oFF.XBooleanValue.create(this.moCharacteristicContainer.submit());
		if (this.mVariableScreen && lValuesOk.getBoolean())
		{
			if (this.getPage().hasErrors())
			{
				lValuesOk = oFF.XBooleanValue.create(false);
				this.forceFullRerendering();
			}
		}
		this.mFilterOrAxisChanged = true;
	}
	this.mErrorFree = lValuesOk.getBoolean();
	lDataSourceChange = lSubmit && lDataSourceChange;
	this.fireChangeEvent(this.mErrorFree, lDataSourceChange);
	if (this.mVariableScreen && lSubmit && this.mErrorFree)
	{
		this.setContentChanged(false);
	}
	else
	{
		this.setContentChanged(true);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.validateFilterConfig = function(oConfig)
{
	var ltRanges = oFF.XList.create();
	var loCharacteristicWrapper = this.moCharacteristicContainer.getElement(oConfig.mName);
	if (oFF.notNull(loCharacteristicWrapper))
	{
		var ltFullRanges = oFF.XList.create();
		var lFullRangeIndex = 0;
		var loRange = null;
		if (oFF.notNull(oConfig.mtFullRanges) && !oConfig.mtFullRanges.isEmpty())
		{
			ltFullRanges = loCharacteristicWrapper.parseFullRangeQuery(oConfig.mtFullRanges);
			for (lFullRangeIndex = 0; lFullRangeIndex < ltFullRanges.size(); lFullRangeIndex++)
			{
				loRange = ltFullRanges.get(lFullRangeIndex);
				if (oFF.isNull(loRange))
				{
					continue;
				}
				ltRanges.add(loRange);
			}
		}
		var ltInputValues = oFF.XListOfString.create();
		if (oFF.notNull(oConfig.mInputValueAsString))
		{
			ltInputValues.add(oConfig.mInputValueAsString);
		}
		if (oFF.notNull(oConfig.mtInputValuesAsString))
		{
			for (var lInputValueAsStringIndex = 0; lInputValueAsStringIndex < oConfig.mtInputValuesAsString.size(); lInputValueAsStringIndex++)
			{
				ltInputValues.add(oConfig.mtInputValuesAsString.get(lInputValueAsStringIndex));
			}
		}
		if (ltInputValues.hasElements())
		{
			ltFullRanges = loCharacteristicWrapper.parseInputString(ltInputValues);
			for (lFullRangeIndex = 0; lFullRangeIndex < ltFullRanges.size(); lFullRangeIndex++)
			{
				loRange = ltFullRanges.get(lFullRangeIndex);
				if (oFF.isNull(loRange))
				{
					continue;
				}
				ltRanges.add(loRange);
			}
		}
	}
	return ltRanges;
};
sap.zen.AbstractFilterComponentBase.prototype.applyFilterConfig = function(oConfig, valuesOk)
{
	var lValuesOk = valuesOk;
	var loCharacteristicWrapper = this.moCharacteristicContainer.getElement(oConfig.mName);
	if (oFF.isNull(oConfig.mInputValueAsString))
	{
		loCharacteristicWrapper.resetQuery();
	}
	if (oFF.notNull(oConfig.mtFullRanges) && !oConfig.mtFullRanges.isEmpty())
	{
		loCharacteristicWrapper.setFullRangeQuery(oConfig.mtFullRanges);
	}
	var ltInputValues = oFF.XListOfString.create();
	if (oFF.notNull(oConfig.mInputValueAsString))
	{
		ltInputValues.add(oConfig.mInputValueAsString);
	}
	if (oFF.notNull(oConfig.mtInputValuesAsString))
	{
		for (var lInputValueAsStringIndex = 0; lInputValueAsStringIndex < oConfig.mtInputValuesAsString.size(); lInputValueAsStringIndex++)
		{
			ltInputValues.add(oConfig.mtInputValuesAsString.get(lInputValueAsStringIndex));
		}
	}
	if (ltInputValues.hasElements())
	{
		var lInputOk = false;
		if (loCharacteristicWrapper.supportsMultiSelection())
		{
			for (var lInputValueIndex = 0; lInputValueIndex < ltInputValues.size(); lInputValueIndex++)
			{
				lInputOk = loCharacteristicWrapper.addInputString(ltInputValues.get(lInputValueIndex));
			}
		}
		else
		{
			lInputOk = loCharacteristicWrapper.setInputString(ltInputValues.get(0));
		}
		if (oFF.isNull(lValuesOk) || lValuesOk.getBoolean())
		{
			lValuesOk = oFF.XBooleanValue.create(lInputOk);
		}
	}
	if (!this.isContentChanged())
	{
		this.filterOrAxisChanged();
		this.setContentChanged(true);
	}
	return lValuesOk;
};
sap.zen.AbstractFilterComponentBase.prototype.doCancelFilterCommand = function()
{
	this.moView = sap.zen.View.VIEW_DEFAULT;
	this.fireSwitchPageEvent(sap.zen.FilterPage.MAIN);
	this.mFilterOrAxisChanged = true;
	this.mFilterCanceled = true;
	this.setContentChanged(true);
};
sap.zen.AbstractFilterComponentBase.prototype.doExpandNodeCommand = function(node, path)
{
	if (oFF.notNull(node) && oFF.notNull(path) && oFF.notNull(this.moFilterDialogFor))
	{
		this.moView = sap.zen.View.EXPAND_NODE;
		var nodeMember = this.moFilterDialogFor.getNode(node);
		this.mMemberToExpand = new sap.zen.MemberToExpand();
		this.mMemberToExpand.setPath(path);
		this.mMemberToExpand.setMember(nodeMember);
		this.setContentChanged(true);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.doCreateContextMenuCommand = function(contextMenuComponentId, dimensionName, memberName)
{
	var loContextMenu = this.getPage().getComponent(contextMenuComponentId);
	if (oFF.isNull(loContextMenu))
	{
		return;
	}
	var loContextMenuHandler = null;
	if (oFF.notNull(dimensionName))
	{
		var loCharacteristicWrapper = this.moCharacteristicContainer.getElement(dimensionName);
		if (oFF.notNull(loCharacteristicWrapper))
		{
			loContextMenuHandler = loCharacteristicWrapper;
			if (oFF.notNull(memberName) && oFF.XString.compare(memberName, "undefined") !== 0)
			{
				var loMemberWrapper = loCharacteristicWrapper.getMember(memberName);
				if (oFF.notNull(loMemberWrapper))
				{
					loContextMenuHandler = loMemberWrapper;
				}
			}
		}
	}
	if (oFF.notNull(loContextMenuHandler))
	{
		loContextMenuHandler.openContextMenu(loContextMenu, this.getName());
	}
};
sap.zen.AbstractFilterComponentBase.prototype.doSetVisiblePrompts = function(visiblePrompts)
{
	this.getPage().setVisiblePrompts(visiblePrompts);
};
sap.zen.AbstractFilterComponentBase.prototype.registerVariableCheckListener = function(checkListener)
{
	if (oFF.isNull(this.mtCheckListeners))
	{
		this.mtCheckListeners = oFF.XList.create();
	}
	if (oFF.notNull(checkListener))
	{
		this.mtCheckListeners.add(checkListener);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.unregisterVariableCheckListener = function(checkListener)
{
	if (oFF.isNull(this.mtCheckListeners))
	{
		return;
	}
	if (oFF.notNull(checkListener))
	{
		this.mtCheckListeners.removeElement(checkListener);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.fireChangeEvent = function(checkResult, wasSubmit)
{
	if (wasSubmit)
	{
		this.raiseDataSourceChangedEvent();
	}
	if (oFF.isNull(this.mtCheckListeners))
	{
		return;
	}
	for (var lCheckListenerIndex = 0; lCheckListenerIndex < this.mtCheckListeners.size(); lCheckListenerIndex++)
	{
		var loCheckListener = this.mtCheckListeners.get(lCheckListenerIndex);
		if (oFF.isNull(loCheckListener))
		{
			continue;
		}
		loCheckListener.check(checkResult);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.fireSwitchPageEvent = function(oFilterPage)
{
	if (oFF.isNull(this.mtCheckListeners))
	{
		return;
	}
	for (var lCheckListenerIndex = 0; lCheckListenerIndex < this.mtCheckListeners.size(); lCheckListenerIndex++)
	{
		var loCheckListener = this.mtCheckListeners.get(lCheckListenerIndex);
		if (oFF.isNull(loCheckListener))
		{
			continue;
		}
		loCheckListener.switchPage(oFilterPage);
	}
};
sap.zen.AbstractFilterComponentBase.prototype.initialCheck = function()
{
	var lCheckOK = true;
	if (oFF.notNull(this.moCharacteristicContainer))
	{
		if (!this.moCharacteristicContainer.checkValues())
		{
			lCheckOK = false;
		}
	}
	return lCheckOK;
};
sap.zen.AbstractFilterComponentBase.prototype.renderControlContent = function(oRenderManager)
{
	if (oFF.isNull(this.moMessageManager))
	{
		this.moMessageManager = sap.zen.ZenMessageManager.create(this.getPage());
	}
	this.moMessageManager.clearMessages();
	if (oFF.isNull(this.moCharacteristicWrappers) && !this.mVariableScreen)
	{
		this.moCharacteristicWrappers = this.getCharacteristicsContainer();
		if (oFF.isNull(this.moCharacteristicWrappers))
		{
			return;
		}
		this.setCharacteristicContainer(this.moCharacteristicWrappers);
		this.forceFullRerendering();
	}
	var loRenderSerializer = oRenderManager.getRenderSerializer();
	loRenderSerializer.addBooleanAttribute("visible", this.mVisibleFlag);
	if (this.mChangeVisibility)
	{
		loRenderSerializer.addBooleanAttribute("changeVisibility", this.mChangeVisibility);
		this.mChangeVisibility = false;
	}
	else
	{
		loRenderSerializer.addAttribute("view", this.moView.toString());
		if (this.mForceFullRerendering)
		{
			loRenderSerializer.addBooleanAttribute("newds", this.mForceFullRerendering);
			this.mForceFullRerendering = false;
		}
		if (oFF.XString.isEqual(this.moView.getValue(), sap.zen.View.VIEW_DEFAULT.getValue()))
		{
			this.moFilterDialogFor = null;
			this.renderFilterPanelJson(loRenderSerializer);
			this.renderAxisJson(loRenderSerializer);
		}
		else if (oFF.XString.isEqual(this.moView.getValue(), sap.zen.View.DIALOG.getValue()))
		{
			this.renderDialogJson(loRenderSerializer);
		}
		else if (oFF.XString.isEqual(this.moView.getValue(), sap.zen.View.DIALOG_SEARCH.getValue()))
		{
			this.renderSearchJson(loRenderSerializer);
		}
		else if (oFF.XString.isEqual(this.moView.getValue(), sap.zen.View.EXPAND_NODE.getValue()))
		{
			this.renderExpandedNode(loRenderSerializer);
		}
		else
		{
			this.moFilterDialogFor = null;
			this.renderFilterPanelJson(loRenderSerializer);
			this.renderAxisJson(loRenderSerializer);
		}
		if (!this.getPage().isDeltaRendering() || this.mSetInitialJson)
		{
			this.renderInitialJson(loRenderSerializer);
			this.mSetInitialJson = false;
		}
		if (this.mFilterOrAxisChanged)
		{
			this.renderFilters(loRenderSerializer);
			this.renderAxisJson(loRenderSerializer);
			this.mFilterOrAxisChanged = false;
		}
		if (oFF.notNull(this.mtValidatedFilterConfig))
		{
			this.renderValidatedFilters(loRenderSerializer);
		}
		if (this.mFilterCanceled)
		{
			loRenderSerializer.addBooleanAttribute("filtercanceled", this.mFilterCanceled);
			this.mFilterCanceled = false;
		}
		if (this.isUseNavigationPanelHandler())
		{
			loRenderSerializer.addBooleanAttribute("pauserefresh", this.isPauseRefresh());
		}
	}
	this.renderMessages(loRenderSerializer);
};
