sap.zen.AbstractFilterComponentBase.prototype.parseJson = function(json)
{
	var loJsonParser = this.getJsonParser();
	var loJsonObject = loJsonParser.parse(json);
	var loConfigContainer = new sap.zen.ConfigContainer();
	var loJsonElementFilters = loJsonObject.asStructure().getByKey(sap.zen.ConfigContainer.FILTERS);
	if (oFF.notNull(loJsonElementFilters))
	{
		loConfigContainer.mtFilters = this.parseJsonElementFilter(loJsonElementFilters);
	}
	var loJsonElementAxes = loJsonObject.asStructure().getByKey(sap.zen.ConfigContainer.AXIS);
	if (oFF.notNull(loJsonElementAxes))
	{
		loConfigContainer.moAxisConfig = this.parseJsonElementAxes(loJsonElementAxes);
	}
	return loConfigContainer;
};
sap.zen.AbstractFilterComponentBase.prototype.parseJsonElementAxes = function(oJsonElementAxes)
{
	var loAxesConfiguration = new sap.zen.AxisConfig();
	var loJsonStructureAxis = oJsonElementAxes.asStructure();
	var loJsonElementRowAxis = loJsonStructureAxis.getByKey("rows");
	if (oFF.notNull(loJsonElementRowAxis))
	{
		loAxesConfiguration.mtRows = this.parseJsonElementAxis(loJsonElementRowAxis);
	}
	var loJsonElementColumnAxis = loJsonStructureAxis.getByKey("columns");
	if (oFF.notNull(loJsonElementColumnAxis))
	{
		loAxesConfiguration.mtColumns = this.parseJsonElementAxis(loJsonElementColumnAxis);
	}
	if (oFF.isNull(loJsonElementRowAxis) && oFF.isNull(loJsonElementColumnAxis))
	{
		return null;
	}
	return loAxesConfiguration;
};
sap.zen.AbstractFilterComponentBase.prototype.parseJsonElementAxis = function(oJsonElementAxis)
{
	var ltAxisDimensionNames = oFF.XListOfString.create();
	var loJsonListAxisDimensions = oJsonElementAxis.asList();
	var lAmountOfDimensionsOnAxis = loJsonListAxisDimensions.size();
	for (var lDimensionIndex = 0; lDimensionIndex < lAmountOfDimensionsOnAxis; lDimensionIndex++)
	{
		var loJsonElementDimension = loJsonListAxisDimensions.get(lDimensionIndex);
		if (oFF.isNull(loJsonElementDimension))
		{
			continue;
		}
		var loJsonStructureDimension = loJsonElementDimension.asStructure();
		var loJsonElementDimensionEntry = loJsonStructureDimension.getByKey("entry");
		var loJsonStructureDimensionEntry = loJsonElementDimensionEntry.asStructure();
		var loJsonElementDimensionName = loJsonStructureDimensionEntry.getByKey("name");
		var lDimensionName = loJsonElementDimensionName.asString().getString();
		ltAxisDimensionNames.add(lDimensionName);
	}
	return ltAxisDimensionNames;
};
sap.zen.AbstractFilterComponentBase.prototype.parseJsonElementFilter = function(oJsonElementFilter)
{
	var ltFilterConfigurations = oFF.XList.create();
	var loJsonElementFilter = oJsonElementFilter;
	var loJsonListFilter = loJsonElementFilter.asList();
	var lJsonFilterListSize = loJsonListFilter.size();
	if (lJsonFilterListSize === 0)
	{
		return oFF.XList.create();
	}
	loJsonElementFilter = loJsonElementFilter.getPermaCopy();
	for (var lListFilterIndex = 0; lListFilterIndex < lJsonFilterListSize; lListFilterIndex++)
	{
		var loJsonListFilterItemElement = loJsonListFilter.get(lListFilterIndex);
		if (oFF.isNull(loJsonListFilterItemElement))
		{
			continue;
		}
		var loJsonListFilterItemStructure = loJsonListFilterItemElement.asStructure();
		var loJsonElementFilterName = loJsonListFilterItemStructure.getByKey(sap.zen.FilterConfig.cNAME);
		if (oFF.notNull(loJsonElementFilterName))
		{
			var loFilterConfig = sap.zen.FilterConfig.create(loJsonElementFilterName.asString().getString());
			var loJsonElementInput = loJsonListFilterItemStructure.getByKey(sap.zen.FilterConfig.cINPUT_STRING);
			if (oFF.notNull(loJsonElementInput))
			{
				if (loJsonElementInput.isList())
				{
					loFilterConfig.mtInputValuesAsString = oFF.XListOfString.create();
					var loJsonListInput = loJsonElementInput.asList();
					for (var lListInputIndex = 0; lListInputIndex < loJsonListInput.size(); lListInputIndex++)
					{
						var loJsonListElementInput = loJsonListInput.get(lListInputIndex);
						if (oFF.isNull(loJsonListElementInput))
						{
							continue;
						}
						loFilterConfig.mtInputValuesAsString.add(loJsonListElementInput.asString().getString());
					}
				}
				else if (loJsonElementInput.isString())
				{
					loFilterConfig.mInputValueAsString = loJsonElementInput.asString().getString();
				}
			}
			var loJsonElementExclude = loJsonListFilterItemStructure.getByKey(sap.zen.FilterConfig.cEXCLUDE);
			if (oFF.notNull(loJsonElementExclude))
			{
				var lIsExcluding = loJsonElementExclude.asBoolean().getBoolean();
				loFilterConfig.mExcludeFlag = lIsExcluding;
			}
			var loJsonElementKeys = loJsonListFilterItemStructure.getByKey(sap.zen.FilterConfig.cKEYS);
			if (oFF.notNull(loJsonElementKeys))
			{
				loFilterConfig.mtKeys = oFF.XListOfString.create();
				var loJsonListKeys = loJsonElementKeys.asList();
				for (var lListKeysIndex = 0; lListKeysIndex < loJsonListKeys.size(); lListKeysIndex++)
				{
					loFilterConfig.mtKeys.add(loJsonListKeys.getStringAt(lListKeysIndex));
				}
			}
			var loJsonElementRanges = loJsonListFilterItemStructure.getByKey(sap.zen.FilterConfig.cRANGES);
			if (oFF.notNull(loJsonElementRanges))
			{
				loFilterConfig.mtFullRanges = oFF.XList.create();
				var loJsonListRanges = loJsonElementRanges.asList();
				for (var lListRangesIndex = 0; lListRangesIndex < loJsonListRanges.size(); lListRangesIndex++)
				{
					var loJsonStructureRanges = loJsonListRanges.get(lListRangesIndex).asStructure();
					var lRangeFromText = loJsonStructureRanges.getStringByKey(sap.zen.Range.FROM_TEXT);
					var lRangeToText = loJsonStructureRanges.getStringByKey(sap.zen.Range.TO_TEXT);
					var lRangeOperation = loJsonStructureRanges.getStringByKey(sap.zen.Range.OPERATION_TEXT);
					var lRangeIsExcluding = false;
					if (loJsonStructureRanges.containsKey(sap.zen.Range.EXCLUDE_TEXT))
					{
						lRangeIsExcluding = loJsonStructureRanges.getBooleanByKey(sap.zen.Range.EXCLUDE_TEXT);
					}
					var loRange = new sap.zen.Range();
					var loMemberWrapper = new sap.zen.MemberKeyWrapper();
					loMemberWrapper.initMe(lRangeFromText);
					loRange.initMe2(loMemberWrapper);
					if (oFF.notNull(lRangeToText))
					{
						var loMemberWrapperTo = new sap.zen.MemberKeyWrapper();
						loMemberWrapperTo.initMe(lRangeToText);
						loRange.setTo(loMemberWrapperTo);
					}
					if (oFF.notNull(lRangeOperation))
					{
						loRange.setOperation(sap.zen.Operation.valueOf2(lRangeOperation));
					}
					loRange.setExclude(lRangeIsExcluding);
					loFilterConfig.mtFullRanges.add(loRange);
				}
			}
			ltFilterConfigurations.add(loFilterConfig);
		}
	}
	return ltFilterConfigurations;
};
