sap.zen.InfoChartControl.prototype.renderAdditionProperties = function(oRenderSerializer)
{
	if (oFF.notNull(this.moResultSet))
	{
		var lReady = true;
		if (this.moResultSet.getState().isTypeOf(oFF.SyncState.PROCESSING))
		{
			lReady = false;
		}
		oRenderSerializer.addBooleanAttribute("chartReady", lReady);
	}
	var loChartTypeNode = this.getPropertyNode("charttype");
	if (oFF.notNull(loChartTypeNode))
	{
		var lChartType = loChartTypeNode.getAttribute("value");
		var loConfigNode = loChartTypeNode.getFirstChildWithNameTag(lChartType);
		if (oFF.notNull(loConfigNode))
		{
			var lConfig = sap.zen.PageObject.convertXXmlNodeToJson(loConfigNode);
			oRenderSerializer.addAttribute("chartconfig", lConfig);
		}
	}
};
sap.zen.InfoChartControl.prototype.getSelections = function()
{
	var ltSelectionsPerDimension = oFF.XHashMapByString.create();
	if (!this.isVisibleRecursive())
	{
		return ltSelectionsPerDimension;
	}
	var loDataSource = this.getDataSource();
	var lDataSelectedJson = this.getStringPropertyWithDefault("dataSelected", "{}");
	var loJsonParser = this.getJsonParser();
	var loJsonRootElement = loJsonParser.parse(lDataSelectedJson);
	var ltJsonElementNames = loJsonRootElement.asStructure().getKeysAsReadOnlyListOfString();
	for (var lElementNameIndex = 0; lElementNameIndex < ltJsonElementNames.size(); lElementNameIndex++)
	{
		var lDimensionName = ltJsonElementNames.get(lElementNameIndex);
		if (!oFF.XString.isEqual("[Measures]", lDimensionName))
		{
			var loDimension = sap.zen.Dimension.sGetDimension(loDataSource, lDimensionName);
			if (oFF.notNull(loDimension))
			{
				var loInternalDimension = loDimension.getInternalObject();
				var loCharacteristicWrapper = sap.zen.CharacteristicWrapper.create(loDataSource, loInternalDimension, null, null, sap.zen.CMemberDisplayMode.KEY_TEXT, false);
				var ltRange = oFF.XList.create();
				var ltJsonList = loJsonRootElement.asStructure().getListByKey(loDimension.getName());
				for (var lListIndex = 0; lListIndex < ltJsonList.size(); lListIndex++)
				{
					var lDimensionMemberKey = ltJsonList.getStringAt(lListIndex);
					var loMemberWrapper = new sap.zen.MemberKeyWrapper();
					loMemberWrapper.initMe(lDimensionMemberKey);
					var loRange = new sap.zen.Range();
					loRange.initMe2(loMemberWrapper);
					ltRange.add(loRange);
				}
				ltRange = loCharacteristicWrapper.parseFullRangeQueryByField(loInternalDimension.getKeyField(), ltRange);
				var lDimensionNameForNav = loDimension.getNavigationName();
				ltSelectionsPerDimension.put(lDimensionNameForNav, ltRange);
			}
		}
	}
	return ltSelectionsPerDimension;
};
